var documenterSearchIndex = {"docs":
[{"location":"apireference/#","page":"Reference","title":"Reference","text":"CurrentModule = MathOptInterface\nDocTestSetup = quote\n    using MathOptInterface\n    const MOI = MathOptInterface\n\n    # For compatibility with both Julia 1.0.5 and 1.5.2\n    # Upon the Julia LTS version becoming 1.6, these imports could be dropped,\n    # and all ScalarAffineTerm and VariableIndex instances in doctests below\n    # could be replaced with MOI.ScalarAffineTerm and MOI.VariableIndex\n    # Check discussion at PR 1184: https://github.com/jump-dev/MathOptInterface.jl/pull/1184#discussion_r515300914\n    import MathOptInterface.ScalarAffineTerm\n    import MathOptInterface.VariableIndex\nend\nDocTestFilters = [r\"MathOptInterface|MOI\"]","category":"page"},{"location":"apireference/#API-Reference-1","page":"Reference","title":"API Reference","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"[Some introduction to API. List basic standalone methods.]","category":"page"},{"location":"apireference/#Attributes-1","page":"Reference","title":"Attributes","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of attribute categories.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractOptimizerAttribute\nAbstractModelAttribute\nAbstractVariableAttribute\nAbstractConstraintAttribute","category":"page"},{"location":"apireference/#MathOptInterface.AbstractOptimizerAttribute","page":"Reference","title":"MathOptInterface.AbstractOptimizerAttribute","text":"AbstractOptimizerAttribute\n\nAbstract supertype for attribute objects that can be used to set or get attributes (properties) of the optimizer.\n\nNote\n\nThe difference between AbstractOptimizerAttribute and AbstractModelAttribute lies in the behavior of is_empty, empty! and copy_to. Typically optimizer attributes only affect how the model is solved.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractModelAttribute","page":"Reference","title":"MathOptInterface.AbstractModelAttribute","text":"AbstractModelAttribute\n\nAbstract supertype for attribute objects that can be used to set or get attributes (properties) of the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractVariableAttribute","page":"Reference","title":"MathOptInterface.AbstractVariableAttribute","text":"AbstractVariableAttribute\n\nAbstract supertype for attribute objects that can be used to set or get attributes (properties) of variables in the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractConstraintAttribute","page":"Reference","title":"MathOptInterface.AbstractConstraintAttribute","text":"AbstractConstraintAttribute\n\nAbstract supertype for attribute objects that can be used to set or get attributes (properties) of constraints in the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Attributes can be set in different ways:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"it is either set when the model is created like SolverName and RawSolver,\nor explicitly when the model is copied like ObjectiveSense,\nor implicitly, e.g., NumberOfVariables is implicitly set by add_variable and ConstraintFunction is implicitly set by add_constraint.\nor it is set to contain the result of the optimization during optimize! like VariablePrimal.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following functions allow to distinguish between some of these different categories:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"is_set_by_optimize\nis_copyable","category":"page"},{"location":"apireference/#MathOptInterface.is_set_by_optimize","page":"Reference","title":"MathOptInterface.is_set_by_optimize","text":"is_set_by_optimize(::AnyAttribute)\n\nReturn a Bool indicating whether the value of the attribute is modified during an optimize! call, that is, the attribute is used to query the result of the optimization.\n\nImportant note when defining new attributes\n\nThis function returns false by default so it should be implemented for attributes that are modified by optimize!.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.is_copyable","page":"Reference","title":"MathOptInterface.is_copyable","text":"is_copyable(::AnyAttribute)\n\nReturn a Bool indicating whether the value of the attribute may be copied during copy_to using set.\n\nImportant note when defining new attributes\n\nBy default is_copyable(attr) returns !is_set_by_optimize(attr). A specific method should be defined for attributes which are copied indirectly during copy_to. For instance, both is_copyable and is_set_by_optimize return false for the following attributes:\n\nListOfOptimizerAttributesSet, ListOfModelAttributesSet, ListOfConstraintAttributesSet and ListOfVariableAttributesSet.\nSolverName and RawSolver: these attributes cannot be set.\nNumberOfVariables and ListOfVariableIndices: these attributes are set indirectly by add_variable and add_variables.\nObjectiveFunctionType: this attribute is set indirectly when setting the ObjectiveFunction attribute.\nNumberOfConstraints, ListOfConstraintIndices, ListOfConstraints, CanonicalConstraintFunction, ConstraintFunction and ConstraintSet: these attributes are set indirectly by add_constraint and add_constraints.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions for getting and setting attributes.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"get\nget!\nset\nsupports","category":"page"},{"location":"apireference/#MathOptInterface.get","page":"Reference","title":"MathOptInterface.get","text":"get(optimizer::AbstractOptimizer, attr::AbstractOptimizerAttribute)\n\nReturn an attribute attr of the optimizer optimizer.\n\nget(model::ModelLike, attr::AbstractModelAttribute)\n\nReturn an attribute attr of the model model.\n\nget(model::ModelLike, attr::AbstractVariableAttribute, v::VariableIndex)\n\nIf the attribute attr is set for the variable v in the model model, return its value, return nothing otherwise. If the attribute attr is not supported by model then an error should be thrown instead of returning nothing.\n\nget(model::ModelLike, attr::AbstractVariableAttribute, v::Vector{VariableIndex})\n\nReturn a vector of attributes corresponding to each variable in the collection v in the model model.\n\nget(model::ModelLike, attr::AbstractConstraintAttribute, c::ConstraintIndex)\n\nIf the attribute attr is set for the constraint c in the model model, return its value, return nothing otherwise. If the attribute attr is not supported by model then an error should be thrown instead of returning nothing.\n\nget(model::ModelLike, attr::AbstractConstraintAttribute, c::Vector{ConstraintIndex{F,S}})\n\nReturn a vector of attributes corresponding to each constraint in the collection c in the model model.\n\nget(model::ModelLike, ::Type{VariableIndex}, name::String)\n\nIf a variable with name name exists in the model model, return the corresponding index, otherwise return nothing. Errors if two variables have the same name.\n\nget(model::ModelLike, ::Type{ConstraintIndex{F,S}}, name::String) where {F<:AbstractFunction,S<:AbstractSet}\n\nIf an F-in-S constraint with name name exists in the model model, return the corresponding index, otherwise return nothing. Errors if two constraints have the same name.\n\nget(model::ModelLike, ::Type{ConstraintIndex}, name::String)\n\nIf any constraint with name name exists in the model model, return the corresponding index, otherwise return nothing. This version is available for convenience but may incur a performance penalty because it is not type stable. Errors if two constraints have the same name.\n\nExamples\n\nget(model, ObjectiveValue())\nget(model, VariablePrimal(), ref)\nget(model, VariablePrimal(5), [ref1, ref2])\nget(model, OtherAttribute(\"something specific to cplex\"))\nget(model, VariableIndex, \"var1\")\nget(model, ConstraintIndex{ScalarAffineFunction{Float64},LessThan{Float64}}, \"con1\")\nget(model, ConstraintIndex, \"con1\")\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.get!","page":"Reference","title":"MathOptInterface.get!","text":"get!(output, model::ModelLike, args...)\n\nAn in-place version of get. The signature matches that of get except that the the result is placed in the vector output.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.set","page":"Reference","title":"MathOptInterface.set","text":"set(optimizer::AbstractOptimizer, attr::AbstractOptimizerAttribute, value)\n\nAssign value to the attribute attr of the optimizer optimizer.\n\nset(model::ModelLike, attr::AbstractModelAttribute, value)\n\nAssign value to the attribute attr of the model model.\n\nset(model::ModelLike, attr::AbstractVariableAttribute, v::VariableIndex, value)\n\nAssign value to the attribute attr of variable v in model model.\n\nset(model::ModelLike, attr::AbstractVariableAttribute, v::Vector{VariableIndex}, vector_of_values)\n\nAssign a value respectively to the attribute attr of each variable in the collection v in model model.\n\nset(model::ModelLike, attr::AbstractConstraintAttribute, c::ConstraintIndex, value)\n\nAssign a value to the attribute attr of constraint c in model model.\n\nset(model::ModelLike, attr::AbstractConstraintAttribute, c::Vector{ConstraintIndex{F,S}}, vector_of_values)\n\nAssign a value respectively to the attribute attr of each constraint in the collection c in model model.\n\nAn UnsupportedAttribute error is thrown if model does not support the attribute attr (see supports) and a SetAttributeNotAllowed error is thrown if it supports the attribute attr but it cannot be set.\n\nReplace set in a constraint\n\nset(model::ModelLike, ::ConstraintSet, c::ConstraintIndex{F,S}, set::S)\n\nChange the set of constraint c to the new set set which should be of the same type as the original set.\n\nExamples\n\nIf c is a ConstraintIndex{F,Interval}\n\nset(model, ConstraintSet(), c, Interval(0, 5))\nset(model, ConstraintSet(), c, GreaterThan(0.0))  # Error\n\nReplace function in a constraint\n\nset(model::ModelLike, ::ConstraintFunction, c::ConstraintIndex{F,S}, func::F)\n\nReplace the function in constraint c with func. F must match the original function type used to define the constraint.\n\nNote\n\nSetting the constraint function is not allowed if F is SingleVariable, it throws a SettingSingleVariableFunctionNotAllowed error. Indeed, it would require changing the index c as the index of SingleVariable constraints should be the same as the index of the variable.\n\nExamples\n\nIf c is a ConstraintIndex{ScalarAffineFunction,S} and v1 and v2 are VariableIndex objects,\n\nset(model, ConstraintFunction(), c,\n    ScalarAffineFunction(ScalarAffineTerm.([1.0, 2.0], [v1, v2]), 5.0))\nset(model, ConstraintFunction(), c, SingleVariable(v1)) # Error\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.supports","page":"Reference","title":"MathOptInterface.supports","text":"supports(model::ModelLike, sub::AbstractSubmittable)::Bool\n\nReturn a Bool indicating whether model supports the submittable sub.\n\nsupports(model::ModelLike, attr::AbstractOptimizerAttribute)::Bool\n\nReturn a Bool indicating whether model supports the optimizer attribute attr. That is, it returns false if copy_to(model, src) shows a warning in case attr is in the ListOfOptimizerAttributesSet of src; see copy_to for more details on how unsupported optimizer attributes are handled in copy.\n\nsupports(model::ModelLike, attr::AbstractModelAttribute)::Bool\n\nReturn a Bool indicating whether model supports the model attribute attr. That is, it returns false if copy_to(model, src) cannot be performed in case attr is in the ListOfModelAttributesSet of src.\n\nsupports(model::ModelLike, attr::AbstractVariableAttribute, ::Type{VariableIndex})::Bool\n\nReturn a Bool indicating whether model supports the variable attribute attr. That is, it returns false if copy_to(model, src) cannot be performed in case attr is in the ListOfVariableAttributesSet of src.\n\nsupports(model::ModelLike, attr::AbstractConstraintAttribute, ::Type{ConstraintIndex{F,S}})::Bool where {F,S}\n\nReturn a Bool indicating whether model supports the constraint attribute attr applied to an F-in-S constraint. That is, it returns false if copy_to(model, src) cannot be performed in case attr is in the ListOfConstraintAttributesSet of src.\n\nFor all five methods, if the attribute is only not supported in specific circumstances, it should still return true.\n\nNote that supports is only defined for attributes for which is_copyable returns true as other attributes do not appear in the list of attributes set obtained by ListOf...AttributesSet.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Fallbacks-1","page":"Reference","title":"Fallbacks","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The value of some attributes can be inferred from the value of other attributes. For instance, the value of ObjectiveValue can be computed using ObjectiveFunction and VariablePrimal. When a solver gives access to the objective value, it is better to return this value but otherwise, Utilities.get_fallback can be used.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"function MOI.get(optimizer::Optimizer, attr::MOI.ObjectiveValue)\n    return MOI.Utilities.get_fallback(optimizer, attr)\nend","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.get_fallback","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.get_fallback","page":"Reference","title":"MathOptInterface.Utilities.get_fallback","text":"get_fallback(model::MOI.ModelLike, ::MOI.ObjectiveValue)\n\nCompute the objective function value using the VariablePrimal results and the ObjectiveFunction value.\n\n\n\n\n\nget_fallback(model::MOI.ModelLike, ::MOI.DualObjectiveValue, T::Type)::T\n\nCompute the dual objective value of type T using the ConstraintDual results and the ConstraintFunction and ConstraintSet values. Note that the nonlinear part of the model is ignored.\n\n\n\n\n\nget_fallback(model::MOI.ModelLike, ::MOI.ConstraintPrimal,\n             constraint_index::MOI.ConstraintIndex)\n\nCompute the value of the function of the constraint of index constraint_index using the VariablePrimal results and the ConstraintFunction values.\n\n\n\n\n\nget_fallback(model::MOI.ModelLike, attr::MOI.ConstraintDual,\n             ci::MOI.ConstraintIndex{Union{MOI.SingleVariable,\n                                           MOI.VectorOfVariables}})\n\nCompute the dual of the constraint of index ci using the ConstraintDual of other constraints and the ConstraintFunction values. Throws an error if some constraints are quadratic or if there is one another MOI.SingleVariable-in-S or MOI.VectorOfVariables-in-S constraint with one of the variables in the function of the constraint ci.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Submit-1","page":"Reference","title":"Submit","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Objects may be submitted to an optimizer using submit.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractSubmittable\nsubmit","category":"page"},{"location":"apireference/#MathOptInterface.AbstractSubmittable","page":"Reference","title":"MathOptInterface.AbstractSubmittable","text":"AbstractSubmittable\n\nAbstract supertype for objects that can be submitted to the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.submit","page":"Reference","title":"MathOptInterface.submit","text":"submit(optimizer::AbstractOptimizer, sub::AbstractSubmittable,\n       values...)::Nothing\n\nSubmit values to the submittable sub of the optimizer optimizer.\n\nAn UnsupportedSubmittable error is thrown if model does not support the attribute attr (see supports) and a SubmitNotAllowed error is thrown if it supports the submittable sub but it cannot be submitted.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of submittables","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"LazyConstraint\nHeuristicSolutionStatus\nHeuristicSolution\nUserCut","category":"page"},{"location":"apireference/#MathOptInterface.LazyConstraint","page":"Reference","title":"MathOptInterface.LazyConstraint","text":"LazyConstraint(callback_data)\n\nLazy constraint func-in-set submitted as func, set. The optimal solution returned by VariablePrimal will satisfy all lazy constraints that have been submitted.\n\nThis can be submitted only from the LazyConstraintCallback. The field callback_data is a solver-specific callback type that is passed as the argument to the feasible solution callback.\n\nExamples\n\nSuppose fx = MOI.SingleVariable(x) and fx = MOI.SingleVariable(y) where x and y are VariableIndexs of optimizer. To add a LazyConstraint for 2x + 3y <= 1, write\n\nfunc = 2.0fx + 3.0fy\nset = MOI.LessThan(1.0)\nMOI.submit(optimizer, MOI.LazyConstraint(callback_data), func, set)\n\ninside a LazyConstraintCallback of data callback_data.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.HeuristicSolutionStatus","page":"Reference","title":"MathOptInterface.HeuristicSolutionStatus","text":"HeuristicSolutionStatus\n\nAn Enum of possible return values for submit with HeuristicSolution. This informs whether the heuristic solution was accepted or rejected. Possible values are:\n\nHEURISTIC_SOLUTION_ACCEPTED: The heuristic solution was accepted.\nHEURISTIC_SOLUTION_REJECTED: The heuristic solution was rejected.\nHEURISTIC_SOLUTION_UNKNOWN: No information available on the acceptance.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.HeuristicSolution","page":"Reference","title":"MathOptInterface.HeuristicSolution","text":"HeuristicSolution(callback_data)\n\nHeuristically obtained feasible solution. The solution is submitted as variables, values where values[i] gives the value of variables[i], similarly to set. The submit call returns a HeuristicSolutionStatus indicating whether the provided solution was accepted or rejected.\n\nThis can be submitted only from the HeuristicCallback. The field callback_data is a solver-specific callback type that is passed as the argument to the heuristic callback.\n\nSome solvers require a complete solution, others only partial solutions.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.UserCut","page":"Reference","title":"MathOptInterface.UserCut","text":"UserCut(callback_data)\n\nConstraint func-to-set suggested to help the solver detect the solution given by CallbackVariablePrimal as infeasible. The cut is submitted as func, set. Typically CallbackVariablePrimal will violate integrality constraints, and a cut would be of the form ScalarAffineFunction-in-LessThan or ScalarAffineFunction-in-GreaterThan. Note that, as opposed to LazyConstraint, the provided constraint cannot modify the feasible set, the constraint should be redundant, e.g., it may be a consequence of affine and integrality constraints.\n\nThis can be submitted only from the UserCutCallback. The field callback_data is a solver-specific callback type that is passed as the argument to the infeasible solution callback.\n\nNote that the solver may silently ignore the provided constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Model-Interface-1","page":"Reference","title":"Model Interface","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"ModelLike\nisempty\nempty!\nwrite_to_file\nread_from_file","category":"page"},{"location":"apireference/#MathOptInterface.ModelLike","page":"Reference","title":"MathOptInterface.ModelLike","text":"ModelLike\n\nAbstract supertype for objects that implement the \"Model\" interface for defining an optimization problem.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Base.isempty","page":"Reference","title":"Base.isempty","text":"isempty(collection) -> Bool\n\nDetermine whether a collection is empty (has no elements).\n\nExamples\n\njulia> isempty([])\ntrue\n\njulia> isempty([1 2 3])\nfalse\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.empty!","page":"Reference","title":"MathOptInterface.empty!","text":"empty!(model::ModelLike)\n\nEmpty the model, that is, remove all variables, constraints and model attributes but not optimizer attributes.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.write_to_file","page":"Reference","title":"MathOptInterface.write_to_file","text":"write_to_file(model::ModelLike, filename::String)\n\nWrites the current model data to the given file. Supported file types depend on the model type.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.read_from_file","page":"Reference","title":"MathOptInterface.read_from_file","text":"read_from_file(model::ModelLike, filename::String)\n\nRead the file filename into the model model. If model is non-empty, this may throw an error.\n\nSupported file types depend on the model type.\n\nNote\n\nOnce the contents of the file are loaded into the model, users can query the variables via get(model, ListOfVariableIndices()). However, some filetypes, such as LP files, do not maintain an explicit ordering of the variables. Therefore, the returned list may be in an arbitrary order. To avoid depending on the order of the indices, users should look up each variable index by name: get(model, VariableIndex, \"name\").\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Copying","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"copy_to","category":"page"},{"location":"apireference/#MathOptInterface.copy_to","page":"Reference","title":"MathOptInterface.copy_to","text":"copy_to(dest::ModelLike, src::ModelLike; copy_names=true, warn_attributes=true)\n\nCopy the model from src into dest. The target dest is emptied, and all previous indices to variables or constraints in dest are invalidated. Returns a dictionary-like object that translates variable and constraint indices from the src model to the corresponding indices in the dest model.\n\nIf copy_names is false, the Name, VariableName and ConstraintName attributes are not copied even if they are set in src. If a constraint that is copied from src is not supported by dest then an UnsupportedConstraint error is thrown. Similarly, if a model, variable or constraint attribute that is copied from src is not supported by dest then an UnsupportedAttribute error is thrown. Unsupported optimizer attributes are treated differently:\n\nIf warn_attributes is true, a warning is displayed, otherwise,\nthe attribute is silently ignored.\n\nExample\n\n# Given empty `ModelLike` objects `src` and `dest`.\n\nx = add_variable(src)\n\nis_valid(src, x)   # true\nis_valid(dest, x)  # false (`dest` has no variables)\n\nindex_map = copy_to(dest, src)\nis_valid(dest, x) # false (unless index_map[x] == x)\nis_valid(dest, index_map[x]) # true\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of model attributes","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Name\nObjectiveSense\nNumberOfVariables\nListOfVariableIndices\nListOfConstraints\nNumberOfConstraints\nListOfConstraintIndices\nListOfOptimizerAttributesSet\nListOfModelAttributesSet\nListOfVariableAttributesSet\nListOfConstraintAttributesSet","category":"page"},{"location":"apireference/#MathOptInterface.Name","page":"Reference","title":"MathOptInterface.Name","text":"Name()\n\nA model attribute for the string identifying the model. It has a default value of \"\" if not set`.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ObjectiveSense","page":"Reference","title":"MathOptInterface.ObjectiveSense","text":"ObjectiveSense()\n\nA model attribute for the objective sense of the objective function, which must be an OptimizationSense: MIN_SENSE, MAX_SENSE, or FEASIBILITY_SENSE. The default is FEASIBILITY_SENSE.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NumberOfVariables","page":"Reference","title":"MathOptInterface.NumberOfVariables","text":"NumberOfVariables()\n\nA model attribute for the number of variables in the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfVariableIndices","page":"Reference","title":"MathOptInterface.ListOfVariableIndices","text":"ListOfVariableIndices()\n\nA model attribute for the Vector{VariableIndex} of all variable indices present in the model (i.e., of length equal to the value of NumberOfVariables()) in the order in which they were added.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfConstraints","page":"Reference","title":"MathOptInterface.ListOfConstraints","text":"ListOfConstraints()\n\nA model attribute for the list of tuples of the form (F,S), where F is a function type and S is a set type indicating that the attribute NumberOfConstraints{F,S}() has value greater than zero.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NumberOfConstraints","page":"Reference","title":"MathOptInterface.NumberOfConstraints","text":"NumberOfConstraints{F,S}()\n\nA model attribute for the number of constraints of the type F-in-S present in the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfConstraintIndices","page":"Reference","title":"MathOptInterface.ListOfConstraintIndices","text":"ListOfConstraintIndices{F,S}()\n\nA model attribute for the Vector{ConstraintIndex{F,S}} of all constraint indices of type F-in-S in the model (i.e., of length equal to the value of NumberOfConstraints{F,S}()) in the order in which they were added.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfOptimizerAttributesSet","page":"Reference","title":"MathOptInterface.ListOfOptimizerAttributesSet","text":"ListOfOptimizerAttributesSet()\n\nAn optimizer attribute for the Vector{AbstractOptimizerAttribute} of all optimizer attributes that were set.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfModelAttributesSet","page":"Reference","title":"MathOptInterface.ListOfModelAttributesSet","text":"ListOfModelAttributesSet()\n\nA model attribute for the Vector{AbstractModelAttribute} of all model attributes attr such that 1) is_copyable(attr) returns true and 2) the attribute was set to the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfVariableAttributesSet","page":"Reference","title":"MathOptInterface.ListOfVariableAttributesSet","text":"ListOfVariableAttributesSet()\n\nA model attribute for the Vector{AbstractVariableAttribute} of all variable attributes attr such that 1) is_copyable(attr) returns true and 2) the attribute was set to variables.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ListOfConstraintAttributesSet","page":"Reference","title":"MathOptInterface.ListOfConstraintAttributesSet","text":"ListOfConstraintAttributesSet{F, S}()\n\nA model attribute for the Vector{AbstractConstraintAttribute} of all constraint attributes attr such that 1) is_copyable(attr) returns true and\n\nthe attribute was set to F-in-S constraints.\n\nNote\n\nThe attributes ConstraintFunction and ConstraintSet should not be included in the list even if then have been set with set.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Optimizers-1","page":"Reference","title":"Optimizers","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractOptimizer\noptimize!\nOptimizerWithAttributes\ninstantiate","category":"page"},{"location":"apireference/#MathOptInterface.AbstractOptimizer","page":"Reference","title":"MathOptInterface.AbstractOptimizer","text":"AbstractOptimizer\n\nAbstract supertype for objects representing an instance of an optimization problem tied to a particular solver. This is typically a solver's in-memory representation. In addition to ModelLike, AbstractOptimizer objects let you solve the model and query the solution.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.optimize!","page":"Reference","title":"MathOptInterface.optimize!","text":"optimize!(optimizer::AbstractOptimizer)\n\nStart the solution procedure.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.OptimizerWithAttributes","page":"Reference","title":"MathOptInterface.OptimizerWithAttributes","text":"struct OptimizerWithAttributes\n    optimizer_constructor\n    params::Vector{Pair{AbstractOptimizerAttribute,<:Any}}\nend\n\nObject grouping an optimizer constructor and a list of optimizer attributes. Instances are created with instantiate.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.instantiate","page":"Reference","title":"MathOptInterface.instantiate","text":"instantiate(optimizer_constructor,\n            with_bridge_type::Union{Nothing, Type}=nothing,\n            with_names::Bool=false)\n\nCreates an instance of optimizer either by calling optimizer_constructor.optimizer_constructor() and setting the parameters in optimizer_constructor.params if optimizer_constructor is a OptimizerWithAttributes or by calling optimizer_constructor() if optimizer_constructor is callable.\n\nIf with_bridge_type is not nothing, it enables all the bridges defined in the MathOptInterface.Bridges submodule with coefficient type with_bridge_type.\n\nIf the optimizer created by optimizer_constructor does not support loading the problem incrementally or does not support names and with_names is true (see Utilities.supports_default_copy_to) then a Utilities.CachingOptimizer is added to store a cache of the bridged model. Hence set with_names to true if names might be set.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of optimizers attributes","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"SolverName\nSilent\nTimeLimitSec\nRawParameter\nNumberOfThreads\nAbstractCallback\nLazyConstraintCallback\nHeuristicCallback\nUserCutCallback","category":"page"},{"location":"apireference/#MathOptInterface.SolverName","page":"Reference","title":"MathOptInterface.SolverName","text":"SolverName()\n\nAn optimizer attribute for the string identifying the solver/optimizer.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Silent","page":"Reference","title":"MathOptInterface.Silent","text":"Silent()\n\nAn optimizer attribute for silencing the output of an optimizer. When set to true, it takes precedence over any other attribute controlling verbosity and requires the solver to produce no output. The default value is false which has no effect. In this case the verbosity is controlled by other attributes.\n\nNote\n\nEvery optimizer should have verbosity on by default. For instance, if a solver has a solver-specific log level attribute, the MOI implementation should set it to 1 by default. If the user sets Silent to true, then the log level should be set to 0, even if the user specifically sets a value of log level. If the value of Silent is false then the log level set to the solver is the value given by the user for this solver-specific parameter or 1 if none is given.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.TimeLimitSec","page":"Reference","title":"MathOptInterface.TimeLimitSec","text":"TimeLimitSec()\n\nAn optimizer attribute for setting a time limit for an optimization. When set to nothing, it deactivates the solver time limit. The default value is nothing. The time limit is in seconds.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RawParameter","page":"Reference","title":"MathOptInterface.RawParameter","text":"RawParameter(name)\n\nAn optimizer attribute for the solver-specific parameter identified by name which is typically an Enum or a String.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NumberOfThreads","page":"Reference","title":"MathOptInterface.NumberOfThreads","text":"NumberOfThreads()\n\nAn optimizer attribute for setting the number of threads used for an optimization. When set to nothing uses solver default. Values are positive integers. The default value is nothing.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractCallback","page":"Reference","title":"MathOptInterface.AbstractCallback","text":"abstract type AbstractCallback <: AbstractModelAttribute end\n\nAbstract type for a model attribute representing a callback function. The value set to subtypes of AbstractCallback is a function that may be called during optimize!. As optimize! is in progress, the result attributes (i.e, the attributes attr such that is_set_by_optimize(attr)) may not be accessible from the callback, hence trying to get result attributes might throw a OptimizeInProgress error.\n\nAt most one callback of each type can be registered. If an optimizer already has a function for a callback type, and the user registers a new function, then the old one is replaced.\n\nThe value of the attribute should be a function taking only one argument, commonly called callback_data, that can be used for instance in LazyConstraintCallback, HeuristicCallback and UserCutCallback.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.LazyConstraintCallback","page":"Reference","title":"MathOptInterface.LazyConstraintCallback","text":"LazyConstraintCallback() <: AbstractCallback\n\nThe callback can be used to reduce the feasible set given the current primal solution by submitting a LazyConstraint. For instance, it may be called at an incumbent of a mixed-integer problem. Note that there is no guarantee that the callback is called at every feasible primal solution.\n\nThe current primal solution is accessed through CallbackVariablePrimal. Trying to access other result attributes will throw OptimizeInProgress as discussed in AbstractCallback.\n\nExamples\n\nx = MOI.add_variables(optimizer, 8)\nMOI.set(optimizer, MOI.LazyConstraintCallback(), callback_data -> begin\n    sol = MOI.get(optimizer, MOI.CallbackVariablePrimal(callback_data), x)\n    if # should add a lazy constraint\n        func = # computes function\n        set = # computes set\n        MOI.submit(optimizer, MOI.LazyConstraint(callback_data), func, set)\n    end\nend)\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.HeuristicCallback","page":"Reference","title":"MathOptInterface.HeuristicCallback","text":"HeuristicCallback() <: AbstractCallback\n\nThe callback can be used to submit HeuristicSolution given the current primal solution. For instance, it may be called at fractional (i.e., non-integer) nodes in the branch and bound tree of a mixed-integer problem. Note that there is not guarantee that the callback is called everytime the solver has an infeasible solution.\n\nThe current primal solution is accessed through CallbackVariablePrimal. Trying to access other result attributes will throw OptimizeInProgress as discussed in AbstractCallback.\n\nExamples\n\nx = MOI.add_variables(optimizer, 8)\nMOI.set(optimizer, MOI.HeuristicCallback(), callback_data -> begin\n    sol = MOI.get(optimizer, MOI.CallbackVariablePrimal(callback_data), x)\n    if # can find a heuristic solution\n        values = # computes heuristic solution\n        MOI.submit(optimizer, MOI.HeuristicSolution(callback_data), x,\n                   values)\n    end\nend\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.UserCutCallback","page":"Reference","title":"MathOptInterface.UserCutCallback","text":"UserCutCallback() <: AbstractCallback\n\nThe callback can be used to submit UserCut given the current primal solution. For instance, it may be called at fractional (i.e., non-integer) nodes in the branch and bound tree of a mixed-integer problem. Note that there is not guarantee that the callback is called everytime the solver has an infeasible solution.\n\nThe infeasible solution is accessed through CallbackVariablePrimal. Trying to access other result attributes will throw OptimizeInProgress as discussed in AbstractCallback.\n\nExamples\n\nx = MOI.add_variables(optimizer, 8)\nMOI.set(optimizer, MOI.UserCutCallback(), callback_data -> begin\n    sol = MOI.get(optimizer, MOI.CallbackVariablePrimal(callback_data), x)\n    if # can find a user cut\n        func = # computes function\n        set = # computes set\n        MOI.submit(optimizer, MOI.UserCut(callback_data), func, set)\n    end\nend\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of attributes useful for optimizers","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"RawSolver\nResultCount\nObjectiveFunction\nObjectiveFunctionType\nObjectiveValue\nDualObjectiveValue\nObjectiveBound\nRelativeGap\nSolveTime\nSimplexIterations\nBarrierIterations\nNodeCount\nTerminationStatus\nRawStatusString\nPrimalStatus\nDualStatus","category":"page"},{"location":"apireference/#MathOptInterface.RawSolver","page":"Reference","title":"MathOptInterface.RawSolver","text":"RawSolver()\n\nA model attribute for the object that may be used to access a solver-specific API for this optimizer.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ResultCount","page":"Reference","title":"MathOptInterface.ResultCount","text":"ResultCount()\n\nA model attribute for the number of results available.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ObjectiveFunction","page":"Reference","title":"MathOptInterface.ObjectiveFunction","text":"ObjectiveFunction{F<:AbstractScalarFunction}()\n\nA model attribute for the objective function which has a type F<:AbstractScalarFunction. F should be guaranteed to be equivalent but not necessarily identical to the function type provided by the user. Throws an InexactError if the objective function cannot be converted to F, e.g. the objective function is quadratic and F is ScalarAffineFunction{Float64} or it has non-integer coefficient and F is ScalarAffineFunction{Int}.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ObjectiveFunctionType","page":"Reference","title":"MathOptInterface.ObjectiveFunctionType","text":"ObjectiveFunctionType()\n\nA model attribute for the type F of the objective function set using the ObjectiveFunction{F} attribute.\n\nExamples\n\nIn the following code, attr should be equal to MOI.SingleVariable:\n\nx = MOI.add_variable(model)\nMOI.set(model, MOI.ObjectiveFunction{MOI.SingleVariable}(),\n         MOI.SingleVariable(x))\nattr = MOI.get(model, MOI.ObjectiveFunctionType())\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ObjectiveValue","page":"Reference","title":"MathOptInterface.ObjectiveValue","text":"ObjectiveValue(resultidx::Int=1)\n\nA model attribute for the objective value of the result_indexth primal result.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.DualObjectiveValue","page":"Reference","title":"MathOptInterface.DualObjectiveValue","text":"DualObjectiveValue(result_index::Int=1)\n\nA model attribute for the value of the objective function of the dual problem for the result_indexth dual result.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ObjectiveBound","page":"Reference","title":"MathOptInterface.ObjectiveBound","text":"ObjectiveBound()\n\nA model attribute for the best known bound on the optimal objective value.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RelativeGap","page":"Reference","title":"MathOptInterface.RelativeGap","text":"RelativeGap()\n\nA model attribute for the final relative optimality gap, defined as fracb-ff, where b is the best bound and f is the best feasible objective value.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SolveTime","page":"Reference","title":"MathOptInterface.SolveTime","text":"SolveTime()\n\nA model attribute for the total elapsed solution time (in seconds) as reported by the optimizer.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SimplexIterations","page":"Reference","title":"MathOptInterface.SimplexIterations","text":"SimplexIterations()\n\nA model attribute for the cumulative number of simplex iterations during the optimization process. In particular, for a mixed-integer program (MIP), the total simplex iterations for all nodes.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.BarrierIterations","page":"Reference","title":"MathOptInterface.BarrierIterations","text":"BarrierIterations()\n\nA model attribute for the cumulative number of barrier iterations while solving a problem.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NodeCount","page":"Reference","title":"MathOptInterface.NodeCount","text":"NodeCount()\n\nA model attribute for the total number of branch-and-bound nodes explored while solving a mixed-integer program (MIP).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.TerminationStatus","page":"Reference","title":"MathOptInterface.TerminationStatus","text":"TerminationStatus()\n\nA model attribute for the TerminationStatusCode explaining why the optimizer stopped.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RawStatusString","page":"Reference","title":"MathOptInterface.RawStatusString","text":"RawStatusString()\n\nA model attribute for a solver specific string explaining why the optimizer stopped.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.PrimalStatus","page":"Reference","title":"MathOptInterface.PrimalStatus","text":"PrimalStatus(N)\nPrimalStatus()\n\nA model attribute for the ResultStatusCode of the primal result N. If N is omitted, it defaults to 1. If N is larger than the value of ResultCount then NO_SOLUTION is returned.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.DualStatus","page":"Reference","title":"MathOptInterface.DualStatus","text":"DualStatus(N)\nDualStatus()\n\nA model attribute for the ResultStatusCode of the dual result N. If N is omitted, it defaults to 1. If N is larger than the value of ResultCount then NO_SOLUTION is returned.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Termination-Status-1","page":"Reference","title":"Termination Status","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The TerminationStatus attribute indicates why the optimizer stopped executing. The value of the attribute is of type TerminationStatusCode.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"TerminationStatusCode","category":"page"},{"location":"apireference/#MathOptInterface.TerminationStatusCode","page":"Reference","title":"MathOptInterface.TerminationStatusCode","text":"TerminationStatusCode\n\nAn Enum of possible values for the TerminationStatus attribute. This attribute is meant to explain the reason why the optimizer stopped executing in the most recent call to optimize!.\n\nIf no call has been made to optimize!, then the TerminationStatus is:\n\nOPTIMIZE_NOT_CALLED: The algorithm has not started.\n\nOK\n\nThese are generally OK statuses, i.e., the algorithm ran to completion normally.\n\nOPTIMAL: The algorithm found a globally optimal solution.\nINFEASIBLE: The algorithm concluded that no feasible solution exists.\nDUAL_INFEASIBLE: The algorithm concluded that no dual bound exists for the problem. If, additionally, a feasible (primal) solution is known to exist, this status typically implies that the problem is unbounded, with some technical exceptions.\nLOCALLY_SOLVED: The algorithm converged to a stationary point, local optimal solution, could not find directions for improvement, or otherwise completed its search without global guarantees.\nLOCALLY_INFEASIBLE: The algorithm converged to an infeasible point or otherwise completed its search without finding a feasible solution, without guarantees that no feasible solution exists.\nINFEASIBLE_OR_UNBOUNDED: The algorithm stopped because it decided that the problem is infeasible or unbounded; this occasionally happens during MIP presolve.\n\nSolved to relaxed tolerances\n\nALMOST_OPTIMAL: The algorithm found a globally optimal solution to relaxed tolerances.\nALMOST_INFEASIBLE: The algorithm concluded that no feasible solution exists within relaxed tolerances.\nALMOST_DUAL_INFEASIBLE: The algorithm concluded that no dual bound exists for the problem within relaxed tolerances.\nALMOST_LOCALLY_SOLVED: The algorithm converged to a stationary point, local optimal solution, or could not find directions for improvement within relaxed tolerances.\n\nLimits\n\nThe optimizer stopped because of some user-defined limit.\n\nITERATION_LIMIT: An iterative algorithm stopped after conducting the maximum number of iterations.\nTIME_LIMIT: The algorithm stopped after a user-specified computation time.\nNODE_LIMIT: A branch-and-bound algorithm stopped because it explored a maximum number of nodes in the branch-and-bound tree.\nSOLUTION_LIMIT: The algorithm stopped because it found the required number of solutions. This is often used in MIPs to get the solver to return the first feasible solution it encounters.\nMEMORY_LIMIT: The algorithm stopped because it ran out of memory.\nOBJECTIVE_LIMIT: The algorithm stopped because it found a solution better than a minimum limit set by the user.\nNORM_LIMIT: The algorithm stopped because the norm of an iterate became too large.\nOTHER_LIMIT: The algorithm stopped due to a limit not covered by one of the above.\n\nProblematic\n\nThis group of statuses means that something unexpected or problematic happened.\n\nSLOW_PROGRESS: The algorithm stopped because it was unable to continue making progress towards the solution.\nNUMERICAL_ERROR: The algorithm stopped because it encountered unrecoverable numerical error.\nINVALID_MODEL: The algorithm stopped because the model is invalid.\nINVALID_OPTION: The algorithm stopped because it was provided an invalid option.\nINTERRUPTED: The algorithm stopped because of an interrupt signal.\nOTHER_ERROR: The algorithm stopped because of an error not covered by one of the statuses defined above.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Conflict-Status-1","page":"Reference","title":"Conflict Status","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The ConflictStatus attribute indicates why the conflict finder stopped executing. The value of the attribute is of type ConflictStatusCode.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"compute_conflict!\nConflictStatus\nConflictStatusCode\nConstraintConflictStatus\nConflictParticipationStatusCode","category":"page"},{"location":"apireference/#MathOptInterface.compute_conflict!","page":"Reference","title":"MathOptInterface.compute_conflict!","text":"compute_conflict!(optimizer::AbstractOptimizer)\n\nComputes a minimal subset of constraints such that the model with the other constraint removed is still infeasible.\n\nSome solvers call a set of conflicting constraints an Irreducible Inconsistent Subsystem (IIS).\n\nSee also ConflictStatus and ConstraintConflictStatus.\n\nNote\n\nIf the model is modified after a call to compute_conflict!, the implementor is not obliged to purge the conflict. Any calls to the above attributes may return values for the original conflict without a warning. Similarly, when modifying the model, the conflict can be discarded.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.ConflictStatus","page":"Reference","title":"MathOptInterface.ConflictStatus","text":"ConflictStatus()\n\nA model attribute for the ConflictStatusCode explaining why the conflict refiner stopped when computing the conflict.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConflictStatusCode","page":"Reference","title":"MathOptInterface.ConflictStatusCode","text":"ConflictStatusCode\n\nAn Enum of possible values for the ConflictStatus attribute. This attribute is meant to explain the reason why the conflict finder stopped executing in the most recent call to compute_conflict!.\n\nPossible values are:\n\nCOMPUTE_CONFLICT_NOT_CALLED: the function compute_conflict! has not yet been called\nNO_CONFLICT_EXISTS: there is no conflict because the problem is feasible\nNO_CONFLICT_FOUND: the solver could not find a conflict\nCONFLICT_FOUND: at least one conflict could be found\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintConflictStatus","page":"Reference","title":"MathOptInterface.ConstraintConflictStatus","text":"ConstraintConflictStatus()\n\nA constraint attribute indicating whether the constraint participates in the conflict. Its type is ConflictParticipationStatusCode.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConflictParticipationStatusCode","page":"Reference","title":"MathOptInterface.ConflictParticipationStatusCode","text":"ConflictParticipationStatusCode\n\nAn Enum of possible values for the ConstraintConflictStatus attribute. This attribute is meant to indicate whether a given constraint participates or not in the last computed conflict.\n\nPossible values are:\n\nNOT_IN_CONFLICT: the constraint does not participate in the conflict\nIN_CONFLICT: the constraint participates in the conflict\nMAYBE_IN_CONFLICT: the constraint may participate in the conflict, the solver was not able to prove that the constraint can be excluded from the conflict\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Result-Status-1","page":"Reference","title":"Result Status","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The PrimalStatus and DualStatus attributes indicate how to interpret the result returned by the solver. The value of the attribute is of type ResultStatusCode.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"ResultStatusCode","category":"page"},{"location":"apireference/#MathOptInterface.ResultStatusCode","page":"Reference","title":"MathOptInterface.ResultStatusCode","text":"ResultStatusCode\n\nAn Enum of possible values for the PrimalStatus and DualStatus attributes. The values indicate how to interpret the result vector.\n\nNO_SOLUTION: the result vector is empty.\nFEASIBLE_POINT: the result vector is a feasible point.\nNEARLY_FEASIBLE_POINT: the result vector is feasible if some constraint tolerances are relaxed.\nINFEASIBLE_POINT: the result vector is an infeasible point.\nINFEASIBILITY_CERTIFICATE: the result vector is an infeasibility certificate. If the PrimalStatus is INFEASIBILITY_CERTIFICATE, then the primal result vector is a certificate of dual infeasibility. If the DualStatus is INFEASIBILITY_CERTIFICATE, then the dual result vector is a proof of primal infeasibility.\nNEARLY_INFEASIBILITY_CERTIFICATE: the result satisfies a relaxed criterion for a certificate of infeasibility.\nREDUCTION_CERTIFICATE: the result vector is an ill-posed certificate; see this article for details. If the PrimalStatus is REDUCTION_CERTIFICATE, then the primal result vector is a proof that the dual problem is ill-posed. If the DualStatus is REDUCTION_CERTIFICATE, then the dual result vector is a proof that the primal is ill-posed.\nNEARLY_REDUCTION_CERTIFICATE: the result satisfies a relaxed criterion for an ill-posed certificate.\nUNKNOWN_RESULT_STATUS: the result vector contains a solution with an unknown interpretation.\nOTHER_RESULT_STATUS: the result vector contains a solution with an interpretation not covered by one of the statuses defined above.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Variables-and-Constraints-1","page":"Reference","title":"Variables and Constraints","text":"","category":"section"},{"location":"apireference/#Basis-Status-1","page":"Reference","title":"Basis Status","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The BasisStatus attribute of a constraint describes its status with respect to a basis, if one is known. The value of the attribute is of type BasisStatusCode.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"BasisStatusCode","category":"page"},{"location":"apireference/#MathOptInterface.BasisStatusCode","page":"Reference","title":"MathOptInterface.BasisStatusCode","text":"BasisStatusCode\n\nAn Enum of possible values for the ConstraintBasisStatus attribute. This explains the status of a given element with respect to an optimal solution basis. Possible values are:\n\nBASIC: element is in the basis\nNONBASIC: element is not in the basis\nNONBASIC_AT_LOWER: element is not in the basis and is at its lower bound\nNONBASIC_AT_UPPER: element is not in the basis and is at its upper bound\nSUPER_BASIC: element is not in the basis but is also not at one of its bounds\n\nNote: NONBASIC_AT_LOWER and NONBASIC_AT_UPPER should be used only for constraints with the Interval. In this case cases they are necessary to distinguish which side of the constraint. One-sided constraints (e.g., LessThan and GreaterThan) should use NONBASIC instead of the NONBASIC_AT_* values.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Index-types-1","page":"Reference","title":"Index types","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"VariableIndex\nConstraintIndex\nis_valid\nthrow_if_not_valid\ndelete(::ModelLike, ::Index)\ndelete(::ModelLike, ::Vector{<:Index})","category":"page"},{"location":"apireference/#MathOptInterface.VariableIndex","page":"Reference","title":"MathOptInterface.VariableIndex","text":"VariableIndex\n\nA type-safe wrapper for Int64 for use in referencing variables in a model. To allow for deletion, indices need not be consecutive.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintIndex","page":"Reference","title":"MathOptInterface.ConstraintIndex","text":"ConstraintIndex{F, S}\n\nA type-safe wrapper for Int64 for use in referencing F-in-S constraints in a model. The parameter F is the type of the function in the constraint, and the parameter S is the type of set in the constraint. To allow for deletion, indices need not be consecutive. Indices within a constraint type (i.e. F-in-S) must be unique, but non-unique indices across different constraint types are allowed. If F is SingleVariable then the index is equal to the index of the variable. That is for an index::ConstraintIndex{SingleVariable}, we always have\n\nindex.value == MOI.get(model, MOI.ConstraintFunction(), index).variable.value\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.is_valid","page":"Reference","title":"MathOptInterface.is_valid","text":"is_valid(model::ModelLike, index::Index)::Bool\n\nReturn a Bool indicating whether this index refers to a valid object in the model model.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.throw_if_not_valid","page":"Reference","title":"MathOptInterface.throw_if_not_valid","text":"throw_if_not_valid(model::ModelLike, index::Index)\n\nThrow an InvalidIndex(index) error if MOI.is_valid(model, index) returns false.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.delete-Tuple{MathOptInterface.ModelLike,Union{VariableIndex, ConstraintIndex}}","page":"Reference","title":"MathOptInterface.delete","text":"delete(model::ModelLike, index::Index)\n\nDelete the referenced object from the model. Throw DeleteNotAllowed if if index cannot be deleted.\n\nThe following modifications also take effect if Index is VariableIndex:\n\nIf index used in the objective function, it is removed from the function, i.e., it is substituted for zero.\nFor each func-in-set constraint of the model:\nIf func isa SingleVariable and func.variable == index then the constraint is deleted.\nIf func isa VectorOfVariables and index in func.variable then\nif length(func.variable) == 1 is one, the constraint is deleted;\nif length(func.variable) > 1 and supports_dimension_update(set) then then the variable is removed from func and set is replaced by update_dimension(set, MOI.dimension(set) - 1).\nOtherwise, a DeleteNotAllowed error is thrown.\nOtherwise, the variable is removed from func, i.e., it is substituted for zero.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.delete-Tuple{MathOptInterface.ModelLike,Array{#s1,1} where #s1<:Union{VariableIndex, ConstraintIndex}}","page":"Reference","title":"MathOptInterface.delete","text":"delete(model::ModelLike, indices::Vector{R<:Index}) where {R}\n\nDelete the referenced objects in the vector indices from the model. It may be assumed that R is a concrete type. The default fallback sequentially deletes the individual items in indices, although specialized implementations may be more efficient.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#Variables-1","page":"Reference","title":"Variables","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Free variables are the variables created with add_variable or add_variables while constrained variables are the variables created with add_constrained_variable or add_constrained_variables. Adding constrained variables instead of constraining free variables with add_constraint allows variable bridges to be used. Note further that free variables that are constrained with add_constraint may be copied by copy_to with add_constrained_variable or add_constrained_variables by the Utilities.CachingOptimizer. More precisely, the attributes do not distinguish constraints on variables created with add_constrained_variable(s) or add_variable(s)/add_constraint. When the model is copied, if a variable is constrained in several sets, the implementation of copy_to can determine whether it is added using add_variable or add_constrained_variable with one of the sets. The rest of the constraints on the variables are added with add_constraint. For deleting, see Index types.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"add_variable\nadd_variables\nadd_constrained_variable\nadd_constrained_variables\nsupports_add_constrained_variable\nsupports_add_constrained_variables","category":"page"},{"location":"apireference/#MathOptInterface.add_variable","page":"Reference","title":"MathOptInterface.add_variable","text":"add_variable(model::ModelLike)::VariableIndex\n\nAdd a scalar variable to the model, returning a variable index.\n\nA AddVariableNotAllowed error is thrown if adding variables cannot be done in the current state of the model model.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.add_variables","page":"Reference","title":"MathOptInterface.add_variables","text":"add_variables(model::ModelLike, n::Int)::Vector{VariableIndex}\n\nAdd n scalar variables to the model, returning a vector of variable indices.\n\nA AddVariableNotAllowed error is thrown if adding variables cannot be done in the current state of the model model.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.add_constrained_variable","page":"Reference","title":"MathOptInterface.add_constrained_variable","text":"add_constrained_variable(\n    model::ModelLike,\n    set::AbstractScalarSet\n)::Tuple{MOI.VariableIndex,\n         MOI.ConstraintIndex{MOI.SingleVariable, typeof(set)}}\n\nAdd to model a scalar variable constrained to belong to set, returning the index of the variable created and the index of the constraint constraining the variable to belong to set.\n\nBy default, this function falls back to creating a free variable with add_variable and then constraining it to belong to set with add_constraint.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.add_constrained_variables","page":"Reference","title":"MathOptInterface.add_constrained_variables","text":"add_constrained_variables(\n    model::ModelLike,\n    sets::AbstractVector{<:AbstractScalarSet}\n)::Tuple{Vector{MOI.VariableIndex},\n         Vector{MOI.ConstraintIndex{MOI.SingleVariable, eltype(sets)}}}\n\nAdd to model scalar variables constrained to belong to sets, returning the indices of the variables created and the indices of the constraints constraining the variables to belong to each set in sets. That is, if it returns variables and constraints, constraints[i] is the index of the constraint constraining variable[i] to belong to sets[i].\n\nBy default, this function falls back to calling add_constrained_variable on each set.\n\n\n\n\n\nadd_constrained_variables(\n    model::ModelLike,\n    set::AbstractVectorSet\n)::Tuple{Vector{MOI.VariableIndex},\n         MOI.ConstraintIndex{MOI.VectorOfVariables, typeof(set)}}\n\nAdd to model a vector of variables constrained to belong to set, returning the indices of the variables created and the index of the constraint constraining the vector of variables to belong to set.\n\nBy default, this function falls back to creating free variables with add_variables and then constraining it to belong to set with add_constraint.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.supports_add_constrained_variable","page":"Reference","title":"MathOptInterface.supports_add_constrained_variable","text":"supports_add_constrained_variable(\n    model::ModelLike,\n    S::Type{<:AbstractScalarSet}\n)::Bool\n\nReturn a Bool indicating whether model supports constraining a variable to belong to a set of type S either on creation of the variable with add_constrained_variable or after the variable is created with add_constraint.\n\nBy default, this function falls back to supports_add_constrained_variables(model, Reals) && supports_constraint(model, MOI.SingleVariable, S) which is the correct definition for most models.\n\nExample\n\nSuppose that a solver supports only two kind of variables: binary variables and continuous variables with a lower bound. If the solver decides not to support SingleVariable-in-Binary and SingleVariable-in-GreaterThan constraints, it only has to implement add_constrained_variable for these two sets which prevents the user to add both a binary constraint and a lower bound on the same variable. Moreover, if the user adds a SingleVariable-in-GreaterThan constraint, implementing this interface (i.e., supports_add_constrained_variables) enables the constraint to be transparently bridged into a supported constraint.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.supports_add_constrained_variables","page":"Reference","title":"MathOptInterface.supports_add_constrained_variables","text":"supports_add_constrained_variables(\n    model::ModelLike,\n    S::Type{<:AbstractVectorSet}\n)::Bool\n\nReturn a Bool indicating whether model supports constraining a vector of variables to belong to a set of type S either on creation of the vector of variables with add_constrained_variables or after the variable is created with add_constraint.\n\nBy default, if S is Reals then this function returns true and otherwise, it falls back to supports_add_constrained_variables(model, Reals) && supports_constraint(model, MOI.VectorOfVariables, S) which is the correct definition for most models.\n\nExample\n\nIn the standard conic form (see Duals), the variables are grouped into several cones and the constraints are affine equality constraints. If Reals is not one of the cones supported by the solvers then it needs to implement supports_add_constrained_variables(::Optimizer, ::Type{Reals}) = false as free variables are not supported. The solvers should then implement supports_add_constrained_variables(::Optimizer, ::Type{<:SupportedCones}) = true where SupportedCones is the union of all cone types that are supported; it does not have to implement the method supports_constraint(::Type{VectorOfVariables}, Type{<:SupportedCones}) as it should return false and it's the default. This prevents the user to constrain the same variable in two different cones. When a VectorOfVariables-in-S is added, the variables of the vector have already been created so they already belong to given cones. If bridges are enabled, the constraint will therefore be bridged by adding slack variables in S and equality constraints ensuring that the slack variables are equal to the corresponding variables of the given constraint function.\n\nNote that there may also be sets for which !supports_add_constrained_variables(model, S) and supports_constraint(model, MOI.VectorOfVariables, S). For instance, suppose a solver supports positive semidefinite variable constraints and two types of variables: binary variables and nonnegative variables. Then the solver should support adding VectorOfVariables-in-PositiveSemidefiniteConeTriangle constraints, but it should not support creating variables constrained to belong to the PositiveSemidefiniteConeTriangle because the variables in PositiveSemidefiniteConeTriangle should first be created as either binary or non-negative.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of attributes associated with variables. [category AbstractVariableAttribute] Calls to get and set should include as an argument a single VariableIndex or a vector of VariableIndex objects.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"VariableName\nVariablePrimalStart\nVariablePrimal\nCallbackVariablePrimal","category":"page"},{"location":"apireference/#MathOptInterface.VariableName","page":"Reference","title":"MathOptInterface.VariableName","text":"VariableName()\n\nA variable attribute for a string identifying the variable. It is valid for two variables to have the same name; however, variables with duplicate names cannot be looked up using get. It has a default value of \"\" if not set`.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VariablePrimalStart","page":"Reference","title":"MathOptInterface.VariablePrimalStart","text":"VariablePrimalStart()\n\nA variable attribute for the initial assignment to some primal variable's value that the optimizer may use to warm-start the solve. May be a number or nothing (unset).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VariablePrimal","page":"Reference","title":"MathOptInterface.VariablePrimal","text":"VariablePrimal(N)\nVariablePrimal()\n\nA variable attribute for the assignment to some primal variable's value in result N. If N is omitted, it is 1 by default.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.CallbackVariablePrimal","page":"Reference","title":"MathOptInterface.CallbackVariablePrimal","text":"CallbackVariablePrimal(callback_data)\n\nA variable attribute for the assignment to some primal variable's value during the callback identified by callback_data.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Constraints-1","page":"Reference","title":"Constraints","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions for adding and modifying constraints.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"is_valid(::ModelLike,::ConstraintIndex)\nadd_constraint\nadd_constraints\ntransform\nsupports_constraint","category":"page"},{"location":"apireference/#MathOptInterface.is_valid-Tuple{MathOptInterface.ModelLike,MathOptInterface.ConstraintIndex}","page":"Reference","title":"MathOptInterface.is_valid","text":"is_valid(model::ModelLike, index::Index)::Bool\n\nReturn a Bool indicating whether this index refers to a valid object in the model model.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.add_constraint","page":"Reference","title":"MathOptInterface.add_constraint","text":"add_constraint(model::ModelLike, func::F, set::S)::ConstraintIndex{F,S} where {F,S}\n\nAdd the constraint f(x) in mathcalS where f is defined by func, and mathcalS is defined by set.\n\nadd_constraint(model::ModelLike, v::VariableIndex, set::S)::ConstraintIndex{SingleVariable,S} where {S}\nadd_constraint(model::ModelLike, vec::Vector{VariableIndex}, set::S)::ConstraintIndex{VectorOfVariables,S} where {S}\n\nAdd the constraint v in mathcalS where v is the variable (or vector of variables) referenced by v and mathcalS is defined by set.\n\nAn UnsupportedConstraint error is thrown if model does not support F-in-S constraints,\na AddConstraintNotAllowed error is thrown if it supports F-in-S constraints but it cannot add the constraint(s) in its current state and\na ScalarFunctionConstantNotZero error may be thrown if func is an AbstractScalarFunction with nonzero constant and set is EqualTo, GreaterThan, LessThan or Interval.\na LowerBoundAlreadySet error is thrown if F is a SingleVariable and a constraint was already added to this variable that sets a lower bound.\na UpperBoundAlreadySet error is thrown if F is a SingleVariable and a constraint was already added to this variable that sets an upper bound.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.add_constraints","page":"Reference","title":"MathOptInterface.add_constraints","text":"add_constraints(model::ModelLike, funcs::Vector{F}, sets::Vector{S})::Vector{ConstraintIndex{F,S}} where {F,S}\n\nAdd the set of constraints specified by each function-set pair in funcs and sets. F and S should be concrete types. This call is equivalent to add_constraint.(model, funcs, sets) but may be more efficient.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.transform","page":"Reference","title":"MathOptInterface.transform","text":"Transform Constraint Set\n\ntransform(model::ModelLike, c::ConstraintIndex{F,S1}, newset::S2)::ConstraintIndex{F,S2}\n\nReplace the set in constraint c with newset. The constraint index c will no longer be valid, and the function returns a new constraint index with the correct type.\n\nSolvers may only support a subset of constraint transforms that they perform efficiently (for example, changing from a LessThan to GreaterThan set). In addition, set modification (where S1 = S2) should be performed via the modify function.\n\nTypically, the user should delete the constraint and add a new one.\n\nExamples\n\nIf c is a ConstraintIndex{ScalarAffineFunction{Float64},LessThan{Float64}},\n\nc2 = transform(model, c, GreaterThan(0.0))\ntransform(model, c, LessThan(0.0)) # errors\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.supports_constraint","page":"Reference","title":"MathOptInterface.supports_constraint","text":"MOI.supports_constraint(BT::Type{<:AbstractBridge}, F::Type{<:MOI.AbstractFunction}, S::Type{<:MOI.AbstractSet})::Bool\n\nReturn a Bool indicating whether the bridges of type BT support bridging F-in-S constraints.\n\n\n\n\n\nsupports_constraint(model::ModelLike, ::Type{F}, ::Type{S})::Bool where {F<:AbstractFunction,S<:AbstractSet}\n\nReturn a Bool indicating whether model supports F-in-S constraints, that is, copy_to(model, src) does not throw UnsupportedConstraint when src contains F-in-S constraints. If F-in-S constraints are only not supported in specific circumstances, e.g. F-in-S constraints cannot be combined with another type of constraint, it should still return true.\n\nsupports_constraint(model::ModelLike, ::Type{VectorOfVariables}, ::Type{Reals})::Bool\n\nReturn a Bool indicating whether model supports free variables. That is, copy_to(model, src) does not error when src contains variables that are not constrained by any SingleVariable or VectorOfVariables constraint. By default, this method returns true so it should only be implemented if model does not support free variables. For instance, if a solver requires all variables to be nonnegative, it should implement this method and return false because free variables cannot be copied to the solver.\n\nNote that free variables are not explicitly set to be free by calling add_constraint with the set Reals, instead, free variables are created with add_variable and add_variables. If model does not support free variables, it should not implement add_variable nor add_variables but should implement this method and return false. This allows free variables to be bridged as the sum of a nonnegative and a nonpositive variables.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of attributes associated with constraints. [category AbstractConstraintAttribute] Calls to get and set should include as an argument a single ConstraintIndex or a vector of ConstraintIndex{F,S} objects.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"ConstraintName\nConstraintPrimalStart\nConstraintDualStart\nConstraintPrimal\nConstraintDual\nConstraintBasisStatus\nConstraintFunction\nCanonicalConstraintFunction\nConstraintSet","category":"page"},{"location":"apireference/#MathOptInterface.ConstraintName","page":"Reference","title":"MathOptInterface.ConstraintName","text":"ConstraintName()\n\nA constraint attribute for a string identifying the constraint. It is valid for constraints variables to have the same name; however, constraints with duplicate names cannot be looked up using get regardless of if they have the same F-in-S type. It has a default value of \"\" if not set.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintPrimalStart","page":"Reference","title":"MathOptInterface.ConstraintPrimalStart","text":"ConstraintPrimalStart()\n\nA constraint attribute for the initial assignment to some constraint's primal value(s) that the optimizer may use to warm-start the solve. May be a number or nothing (unset).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintDualStart","page":"Reference","title":"MathOptInterface.ConstraintDualStart","text":"ConstraintDualStart()\n\nA constraint attribute for the initial assignment to some constraint's dual value(s) that the optimizer may use to warm-start the solve. May be a number or nothing (unset).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintPrimal","page":"Reference","title":"MathOptInterface.ConstraintPrimal","text":"ConstraintPrimal(N)\nConstraintPrimal()\n\nA constraint attribute for the assignment to some constraint's primal value(s) in result N. If N is omitted, it is 1 by default.\n\nGiven a constraint function-in-set, the ConstraintPrimal is the value of the function evaluated at the primal solution of the variables. For example, given the constraint ScalarAffineFunction([x,y], [1, 2], 3)-in-Interval(0, 20) and a primal solution of (x,y) = (4,5), the ConstraintPrimal solution of the constraint is 1 * 4 + 2 * 5 + 3 = 17.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintDual","page":"Reference","title":"MathOptInterface.ConstraintDual","text":"ConstraintDual(N)\nConstraintDual()\n\nA constraint attribute for the assignment to some constraint's dual value(s) in result N. If N is omitted, it is 1 by default.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintBasisStatus","page":"Reference","title":"MathOptInterface.ConstraintBasisStatus","text":"ConstraintBasisStatus(result_index)\nConstraintBasisStatus()\n\nA constraint attribute for the BasisStatusCode of some constraint in result result_index, with respect to an available optimal solution basis. If result_index is omitted, it is 1 by default.\n\nFor the basis status of a variable, query the corresponding SingleVariable constraint that enforces the variable's bounds.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintFunction","page":"Reference","title":"MathOptInterface.ConstraintFunction","text":"ConstraintFunction()\n\nA constraint attribute for the AbstractFunction object used to define the constraint. It is guaranteed to be equivalent but not necessarily identical to the function provided by the user.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.CanonicalConstraintFunction","page":"Reference","title":"MathOptInterface.CanonicalConstraintFunction","text":"CanonicalConstraintFunction()\n\nA constraint attribute for a canonical representation of the AbstractFunction object used to define the constraint. Getting this attribute is guaranteed to return a function that is equivalent but not necessarily identical to the function provided by the user.\n\nBy default, MOI.get(model, MOI.CanonicalConstraintFunction(), ci) fallbacks to MOI.Utilities.canonical(MOI.get(model, MOI.ConstraintFunction(), ci)). However, if model knows that the constraint function is canonical then it can implement a specialized method that directly return the function without calling Utilities.canonical. Therefore, the value returned cannot be assumed to be a copy of the function stored in model. Moreover, Utilities.Model checks with Utilities.is_canonical whether the function stored internally is already canonical and if it's the case, then it returns the function stored internally instead of a copy.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ConstraintSet","page":"Reference","title":"MathOptInterface.ConstraintSet","text":"ConstraintSet()\n\nA constraint attribute for the AbstractSet object used to define the constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Note that setting the ConstraintFunction of a [SingleVariable] constraint is not allowed:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"SettingSingleVariableFunctionNotAllowed","category":"page"},{"location":"apireference/#MathOptInterface.SettingSingleVariableFunctionNotAllowed","page":"Reference","title":"MathOptInterface.SettingSingleVariableFunctionNotAllowed","text":"SettingSingleVariableFunctionNotAllowed()\n\nError type that should be thrown when the user calls set to change the ConstraintFunction of a SingleVariable constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Functions-and-function-modifications-1","page":"Reference","title":"Functions and function modifications","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of recognized functions.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractFunction\nAbstractVectorFunction\nSingleVariable\nVectorOfVariables\nScalarAffineTerm\nScalarAffineFunction\nVectorAffineTerm\nVectorAffineFunction\nScalarQuadraticTerm\nScalarQuadraticFunction\nVectorQuadraticTerm\nVectorQuadraticFunction","category":"page"},{"location":"apireference/#MathOptInterface.AbstractFunction","page":"Reference","title":"MathOptInterface.AbstractFunction","text":"AbstractFunction\n\nAbstract supertype for function objects.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractVectorFunction","page":"Reference","title":"MathOptInterface.AbstractVectorFunction","text":"AbstractVectorFunction\n\nAbstract supertype for vector-valued function objects.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SingleVariable","page":"Reference","title":"MathOptInterface.SingleVariable","text":"SingleVariable(variable)\n\nThe function that extracts the scalar variable referenced by variable, a VariableIndex. This function is naturally be used for single variable bounds or integrality constraints.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorOfVariables","page":"Reference","title":"MathOptInterface.VectorOfVariables","text":"VectorOfVariables(variables)\n\nThe function that extracts the vector of variables referenced by variables, a Vector{VariableIndex}. This function is naturally be used for constraints that apply to groups of variables, such as an \"all different\" constraint, an indicator constraint, or a complementarity constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarAffineTerm","page":"Reference","title":"MathOptInterface.ScalarAffineTerm","text":"struct ScalarAffineTerm{T}\n    coefficient::T\n    variable_index::VariableIndex\nend\n\nRepresents c x_i where c is coefficient and x_i is the variable identified by variable_index.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarAffineFunction","page":"Reference","title":"MathOptInterface.ScalarAffineFunction","text":"ScalarAffineFunction{T}(terms, constant)\n\nThe scalar-valued affine function a^T x + b, where:\n\na is a sparse vector specified by a list of ScalarAffineTerm structs.\nb is a scalar specified by constant::T\n\nDuplicate variable indices in terms are accepted, and the corresponding coefficients are summed together.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorAffineTerm","page":"Reference","title":"MathOptInterface.VectorAffineTerm","text":"struct VectorAffineTerm{T}\n    output_index::Int64\n    scalar_term::ScalarAffineTerm{T}\nend\n\nA ScalarAffineTerm plus its index of the output component of a VectorAffineFunction or VectorQuadraticFunction. output_index can also be interpreted as a row index into a sparse matrix, where the scalar_term contains the column index and coefficient.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorAffineFunction","page":"Reference","title":"MathOptInterface.VectorAffineFunction","text":"VectorAffineFunction{T}(terms, constants)\n\nThe vector-valued affine function A x + b, where:\n\nA is a sparse matrix specified by a list of VectorAffineTerm objects.\nb is a vector specified by constants\n\nDuplicate indices in the A are accepted, and the corresponding coefficients are summed together.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarQuadraticTerm","page":"Reference","title":"MathOptInterface.ScalarQuadraticTerm","text":"struct ScalarQuadraticTerm{T}\n    coefficient::T\n    variable_index_1::VariableIndex\n    variable_index_2::VariableIndex\nend\n\nRepresents c x_i x_j where c is coefficient, x_i is the variable identified by variable_index_1 and x_j is the variable identified by variable_index_2.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarQuadraticFunction","page":"Reference","title":"MathOptInterface.ScalarQuadraticFunction","text":"ScalarQuadraticFunction{T}(affine_terms, quadratic_terms, constant)\n\nThe scalar-valued quadratic function frac12x^TQx + a^T x + b, where:\n\na is a sparse vector specified by a list of ScalarAffineTerm structs.\nb is a scalar specified by constant.\nQ is a symmetric matrix specified by a list of ScalarQuadraticTerm structs.\n\nDuplicate indices in a or Q are accepted, and the corresponding coefficients are summed together. \"Mirrored\" indices (q,r) and (r,q) (where r and q are VariableIndexes) are considered duplicates; only one need be specified.\n\nFor example, for two scalar variables y z, the quadratic expression yz + y^2 is represented by the terms ScalarQuadraticTerm.([1.0, 2.0], [y, y], [z, y]).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorQuadraticTerm","page":"Reference","title":"MathOptInterface.VectorQuadraticTerm","text":"struct VectorQuadraticTerm{T}\n    output_index::Int64\n    scalar_term::ScalarQuadraticTerm{T}\nend\n\nA ScalarQuadraticTerm plus its index of the output component of a VectorQuadraticFunction. Each output component corresponds to a distinct sparse matrix Q_i.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorQuadraticFunction","page":"Reference","title":"MathOptInterface.VectorQuadraticFunction","text":"VectorQuadraticFunction{T}(affine_terms, quadratic_terms, constant)\n\nThe vector-valued quadratic function with ith component (\"output index\") defined as frac12x^TQ_ix + a_i^T x + b_i, where:\n\na_i is a sparse vector specified by the VectorAffineTerms with output_index == i.\nb_i is a scalar specified by constants[i]\nQ_i is a symmetric matrix specified by the VectorQuadraticTerm with output_index == i.\n\nDuplicate indices in a_i or Q_i are accepted, and the corresponding coefficients are summed together. \"Mirrored\" indices (q,r) and (r,q) (where r and q are VariableIndexes) are considered duplicates; only one need be specified.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions for getting and setting properties of functions.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"output_dimension\nconstant(f::Union{ScalarAffineFunction, ScalarQuadraticFunction})\nconstant(f::Union{VectorAffineFunction, VectorQuadraticFunction})\nconstant(f::SingleVariable, ::DataType)\nconstant(f::VectorOfVariables, T::DataType)","category":"page"},{"location":"apireference/#MathOptInterface.output_dimension","page":"Reference","title":"MathOptInterface.output_dimension","text":"output_dimension(f::AbstractFunction)\n\nReturn 1 if f has a scalar output and the number of output components if f has a vector output.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.constant-Tuple{Union{ScalarAffineFunction, ScalarQuadraticFunction}}","page":"Reference","title":"MathOptInterface.constant","text":"constant(f::Union{ScalarAffineFunction, ScalarQuadraticFunction})\n\nReturns the constant term of the scalar function\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.constant-Tuple{Union{VectorAffineFunction, VectorQuadraticFunction}}","page":"Reference","title":"MathOptInterface.constant","text":"constant(f::Union{VectorAffineFunction, VectorQuadraticFunction})\n\nReturns the vector of constant terms of the vector function\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.constant-Tuple{MathOptInterface.SingleVariable,DataType}","page":"Reference","title":"MathOptInterface.constant","text":"constant(f::SingleVariable, T::DataType)\n\nThe constant term of a SingleVariable function is the zero value of the specified type T.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.constant-Tuple{MathOptInterface.VectorOfVariables,DataType}","page":"Reference","title":"MathOptInterface.constant","text":"constant(f::VectorOfVariables, T::DataType)\n\nThe constant term of a VectorOfVariables function is a vector of zero values of the specified type T.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#Sets-1","page":"Reference","title":"Sets","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"All sets are subtypes of AbstractSet and they should either be scalar or vector sets.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractSet\nAbstractScalarSet\nAbstractVectorSet","category":"page"},{"location":"apireference/#MathOptInterface.AbstractSet","page":"Reference","title":"MathOptInterface.AbstractSet","text":"AbstractSet\n\nAbstract supertype for set objects used to encode constraints. A set object should not contain any VariableIndex or ConstraintIndex as the set is passed unmodifed during copy_to.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractScalarSet","page":"Reference","title":"MathOptInterface.AbstractScalarSet","text":"AbstractScalarSet\n\nAbstract supertype for subsets of mathbbR.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractVectorSet","page":"Reference","title":"MathOptInterface.AbstractVectorSet","text":"AbstractVectorSet\n\nAbstract supertype for subsets of mathbbR^n for some n.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions for getting properties of sets.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"dimension\ndual_set\ndual_set_type\nconstant(s::EqualTo)\nsupports_dimension_update\nupdate_dimension","category":"page"},{"location":"apireference/#MathOptInterface.dimension","page":"Reference","title":"MathOptInterface.dimension","text":"dimension(s::AbstractSet)\n\nReturn the output_dimension that an AbstractFunction should have to be used with the set s.\n\nExamples\n\njulia> dimension(Reals(4))\n4\n\njulia> dimension(LessThan(3.0))\n1\n\njulia> dimension(PositiveSemidefiniteConeTriangle(2))\n3\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.dual_set","page":"Reference","title":"MathOptInterface.dual_set","text":"dual_set(s::AbstractSet)\n\nReturn the dual set of s, that is the dual cone of the set. This follows the definition of duality discussed in Duals. See Dual cone for more information. If the dual cone is not defined it returns an error.\n\nExamples\n\njulia> dual_set(Reals(4))\nZeros(4)\n\njulia> dual_set(SecondOrderCone(5))\nSecondOrderCone(5)\n\njulia> dual_set(ExponentialCone())\nDualExponentialCone()\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.dual_set_type","page":"Reference","title":"MathOptInterface.dual_set_type","text":"dual_set_type(S::Type{<:AbstractSet})\n\nReturn the type of dual set of sets of type S, as returned by dual_set. If the dual cone is not defined it returns an error.\n\nExamples\n\njulia> dual_set_type(Reals)\nZeros\n\njulia> dual_set_type(SecondOrderCone)\nSecondOrderCone\n\njulia> dual_set_type(ExponentialCone)\nDualExponentialCone\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.constant-Tuple{MathOptInterface.EqualTo}","page":"Reference","title":"MathOptInterface.constant","text":"constant(s::Union{EqualTo, GreaterThan, LessThan})\n\nReturns the constant of the set.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.supports_dimension_update","page":"Reference","title":"MathOptInterface.supports_dimension_update","text":"supports_dimension_update(S::Type{<:MOI.AbstractVectorSet})\n\nReturn a Bool indicating whether the elimination of any dimension of n-dimensional sets of type S give an n-1-dimensional set S. By default, this function returns false so it should only be implemented for sets that supports dimension update.\n\nFor instance, supports_dimension_update(MOI.Nonnegatives} is true because the elimination of any dimension of the n-dimensional nonnegative orthant gives the n-1-dimensional nonnegative orthant. However supports_dimension_update(MOI.ExponentialCone} is false.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.update_dimension","page":"Reference","title":"MathOptInterface.update_dimension","text":"update_dimension(s::AbstractVectorSet, new_dim)\n\nReturns a set with the dimension modified to new_dim.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Scalar-sets-1","page":"Reference","title":"Scalar sets","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of recognized scalar sets.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"GreaterThan\nLessThan\nEqualTo\nInterval\nInteger\nZeroOne\nSemicontinuous\nSemiinteger","category":"page"},{"location":"apireference/#MathOptInterface.GreaterThan","page":"Reference","title":"MathOptInterface.GreaterThan","text":"GreaterThan{T <: Real}(lower::T)\n\nThe set lowerinfty) subseteq mathbbR.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.LessThan","page":"Reference","title":"MathOptInterface.LessThan","text":"LessThan{T <: Real}(upper::T)\n\nThe set (-inftyupper subseteq mathbbR.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.EqualTo","page":"Reference","title":"MathOptInterface.EqualTo","text":"EqualTo{T <: Number}(value::T)\n\nThe set containing the single point x in mathbbR where x is given by value.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Interval","page":"Reference","title":"MathOptInterface.Interval","text":"Interval{T <: Real}(lower::T,upper::T)\n\nThe interval lower upper subseteq mathbbR. If lower or upper is -Inf or Inf, respectively, the set is interpreted as a one-sided interval.\n\nInterval(s::GreaterThan{<:AbstractFloat})\n\nConstruct a (right-unbounded) Interval equivalent to the given GreaterThan set.\n\nInterval(s::LessThan{<:AbstractFloat})\n\nConstruct a (left-unbounded) Interval equivalent to the given LessThan set.\n\nInterval(s::EqualTo{<:Real})\n\nConstruct a (degenerate) Interval equivalent to the given EqualTo set.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Integer","page":"Reference","title":"MathOptInterface.Integer","text":"Integer()\n\nThe set of integers mathbbZ.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ZeroOne","page":"Reference","title":"MathOptInterface.ZeroOne","text":"ZeroOne()\n\nThe set  0 1 .\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Semicontinuous","page":"Reference","title":"MathOptInterface.Semicontinuous","text":"Semicontinuous{T <: Real}(lower::T,upper::T)\n\nThe set 0 cup lowerupper.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Semiinteger","page":"Reference","title":"MathOptInterface.Semiinteger","text":"Semiinteger{T <: Real}(lower::T,upper::T)\n\nThe set 0 cup lowerlower+1ldotsupper-1upper.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Vector-sets-1","page":"Reference","title":"Vector sets","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of recognized vector sets.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Reals\nZeros\nNonnegatives\nNonpositives\nNormInfinityCone\nNormOneCone\nSecondOrderCone\nRotatedSecondOrderCone\nGeometricMeanCone\nExponentialCone\nDualExponentialCone\nPowerCone\nDualPowerCone\nRelativeEntropyCone\nNormSpectralCone\nNormNuclearCone\nSOS1\nSOS2\nIndicatorSet\nComplements","category":"page"},{"location":"apireference/#MathOptInterface.Reals","page":"Reference","title":"MathOptInterface.Reals","text":"Reals(dimension)\n\nThe set mathbbR^dimension (containing all points) of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Zeros","page":"Reference","title":"MathOptInterface.Zeros","text":"Zeros(dimension)\n\nThe set  0 ^dimension (containing only the origin) of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Nonnegatives","page":"Reference","title":"MathOptInterface.Nonnegatives","text":"Nonnegatives(dimension)\n\nThe nonnegative orthant  x in mathbbR^dimension  x ge 0  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Nonpositives","page":"Reference","title":"MathOptInterface.Nonpositives","text":"Nonpositives(dimension)\n\nThe nonpositive orthant  x in mathbbR^dimension  x le 0  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NormInfinityCone","page":"Reference","title":"MathOptInterface.NormInfinityCone","text":"NormInfinityCone(dimension)\n\nThe ell_infty-norm cone  (tx) in mathbbR^dimension  t ge lVert x rVert_infty = max_i lvert x_i rvert  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NormOneCone","page":"Reference","title":"MathOptInterface.NormOneCone","text":"NormOneCone(dimension)\n\nThe ell_1-norm cone  (tx) in mathbbR^dimension  t ge lVert x rVert_1 = sum_i lvert x_i rvert  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SecondOrderCone","page":"Reference","title":"MathOptInterface.SecondOrderCone","text":"SecondOrderCone(dimension)\n\nThe second-order cone (or Lorenz cone or ell_2-norm cone)  (tx) in mathbbR^dimension  t ge lVert x rVert_2  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RotatedSecondOrderCone","page":"Reference","title":"MathOptInterface.RotatedSecondOrderCone","text":"RotatedSecondOrderCone(dimension)\n\nThe rotated second-order cone  (tux) in mathbbR^dimension  2tu ge lVert x rVert_2^2 tu ge 0  of dimension dimension.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.GeometricMeanCone","page":"Reference","title":"MathOptInterface.GeometricMeanCone","text":"GeometricMeanCone(dimension)\n\nThe geometric mean cone  (tx) in mathbbR^n+1  x ge 0 t le sqrtnx_1 x_2 cdots x_n  of dimension dimension=n+1.\n\nDuality note\n\nThe dual of the geometric mean cone is  (u v) in mathbbR^n+1  u le 0 v ge 0 -u le n sqrtnprod_i v_i  of dimension dimension=n+1.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ExponentialCone","page":"Reference","title":"MathOptInterface.ExponentialCone","text":"ExponentialCone()\n\nThe 3-dimensional exponential cone  (xyz) in mathbbR^3  y exp (xy) le z y  0 .\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.DualExponentialCone","page":"Reference","title":"MathOptInterface.DualExponentialCone","text":"DualExponentialCone()\n\nThe 3-dimensional dual exponential cone  (uvw) in mathbbR^3  -u exp (vu) le exp(1) w u  0 .\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.PowerCone","page":"Reference","title":"MathOptInterface.PowerCone","text":"PowerCone{T <: Real}(exponent::T)\n\nThe 3-dimensional power cone  (xyz) in mathbbR^3  x^exponent y^1-exponent ge z x ge 0 y ge 0  with parameter exponent.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.DualPowerCone","page":"Reference","title":"MathOptInterface.DualPowerCone","text":"DualPowerCone{T <: Real}(exponent::T)\n\nThe 3-dimensional power cone  (uvw) in mathbbR^3  (fracuexponent)^exponent (fracv1-exponent)^1-exponent ge w u ge 0 v ge 0  with parameter exponent.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RelativeEntropyCone","page":"Reference","title":"MathOptInterface.RelativeEntropyCone","text":"RelativeEntropyCone(dimension)\n\nThe relative entropy cone  (u v w) in mathbbR^1+2n  u ge sum_i=1^n w_i log (fracw_iv_i) v_i ge 0 w_i ge 0  of dimension dimension=2n+1.\n\nDuality note\n\nThe dual of the relative entropy cone is  (u v w) in mathbbR^1+2n  forall i w_i ge u (log (fracuv_i) - 1) v_i ge 0 u  0  of dimension dimension=2n+1.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NormSpectralCone","page":"Reference","title":"MathOptInterface.NormSpectralCone","text":"NormSpectralCone(row_dim, column_dim)\n\nThe epigraph of the matrix spectral norm (maximum singular value function)  (t X) in mathbbR^1 + row_dim times column_dim  t ge sigma_1(X)  where sigma_i is the ith singular value of the matrix X of row dimension row_dim and column dimension column_dim. The matrix X is vectorized by stacking the columns, matching the behavior of Julia's vec function.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NormNuclearCone","page":"Reference","title":"MathOptInterface.NormNuclearCone","text":"NormNuclearCone(row_dim, column_dim)\n\nThe epigraph of the matrix nuclear norm (sum of singular values function)  (t X) in mathbbR^1 + row_dim times column_dim  t ge sum_i sigma_i(X)  where sigma_i is the ith singular value of the matrix X of row dimension row_dim and column dimension column_dim. The matrix X is vectorized by stacking the columns, matching the behavior of Julia's vec function.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SOS1","page":"Reference","title":"MathOptInterface.SOS1","text":"SOS1{T <: Real}(weights::Vector{T})\n\nThe set corresponding to the special ordered set (SOS) constraint of type 1. Of the variables in the set, at most one can be nonzero. The weights induce an ordering of the variables; as such, they should be unique values. The kth element in the set corresponds to the kth weight in weights. See here for a description of SOS constraints and their potential uses.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SOS2","page":"Reference","title":"MathOptInterface.SOS2","text":"SOS2{T <: Real}(weights::Vector{T})\n\nThe set corresponding to the special ordered set (SOS) constraint of type 2. Of the variables in the set, at most two can be nonzero, and if two are nonzero, they must be adjacent in the ordering of the set. The weights induce an ordering of the variables; as such, they should be unique values. The kth element in the set corresponds to the kth weight in weights. See here for a description of SOS constraints and their potential uses.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.IndicatorSet","page":"Reference","title":"MathOptInterface.IndicatorSet","text":"IndicatorSet{A, S <: AbstractScalarSet}(set::S)\n\n(y x) in 0 1 times mathbbR^n  y = 0 implies x in set when A is ACTIVATE_ON_ZERO and (y x) in 0 1 times mathbbR^n  y = 1 implies x in set when A is ACTIVATE_ON_ONE.\n\nS has to be a sub-type of AbstractScalarSet. A is one of the value of the ActivationCond enum. IndicatorSet is used with a VectorAffineFunction holding the indicator variable first.\n\nExample: (y x) in 0 1 times mathbbR^2  y = 1 implies x_1 + x_2 leq 9 \n\nf = MOI.VectorAffineFunction(\n    [MOI.VectorAffineTerm(1, MOI.ScalarAffineTerm(1.0, y)),\n     MOI.VectorAffineTerm(2, MOI.ScalarAffineTerm(1.0, x1)),\n     MOI.VectorAffineTerm(2, MOI.ScalarAffineTerm(1.0, x2)),\n    ],\n    [0.0, 0.0],\n)\n\nindicator_set = MOI.IndicatorSet{MOI.ACTIVATE_ON_ONE}(MOI.LessThan(9.0))\n\nMOI.add_constraint(model, f, indicator_set)\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Complements","page":"Reference","title":"MathOptInterface.Complements","text":"Complements(dimension::Int)\n\nThe set corresponding to a mixed complementarity constraint.\n\nComplementarity constraints should be specified with an AbstractVectorFunction-in-Complements(dimension) constraint.\n\nThe dimension of the vector-valued function F must be 2 * dimension. This defines a complementarity constraint between the scalar function F[i] and the variable in F[i + dimension]. Thus, F[i + dimension] must be interpretable as a single variable x_i (e.g., 1.0 * x + 0.0).\n\nThe mixed complementarity problem consists of finding x_i in the interval [lb, ub] (i.e., in the set Interval(lb, ub)), such that the following holds:\n\nF_i(x) == 0 if lb_i < x_i < ub_i\nF_i(x) >= 0 if lb_i == x_i\nF_i(x) <= 0 if x_i == ub_i\n\nClassically, the bounding set for x_i is Interval(0, Inf), which recovers: 0 <= F_i(x)  x_i >= 0, where the  operator implies F_i(x) * x_i = 0.\n\nExamples\n\nThe problem:\n\nx -in- Interval(-1, 1)\n[-4 * x - 3, x] -in- Complements(1)\n\ndefines the mixed complementarity problem where the following holds:\n\n-4 * x - 3 == 0 if -1 < x < 1\n-4 * x - 3 >= 0 if x == -1\n-4 * x - 3 <= 0 if x == 1\n\nThere are three solutions:\n\nx = -3/4 with F(x) = 0\nx = -1 with F(x) = 1\nx = 1 with F(x) = -7\n\nThe function F can also be defined in terms of single variables. For example, the problem:\n\n[x_3, x_4] -in- Nonnegatives(2)\n[x_1, x_2, x_3, x_4] -in- Complements(2)\n\ndefines the complementarity problem where 0 <= x_1  x_3 >= 0 and 0 <= x_2  x_4 >= 0.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Matrix-sets-1","page":"Reference","title":"Matrix sets","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Matrix sets are vectorized in order to be subtypes of AbstractVectorSet. For sets of symmetric matrices, storing both the (i, j) and (j, i) elements is redundant so there exists the AbstractSymmetricMatrixSetTriangle set to represent only the vectorization of the upper triangular part of the matrix. When the matrix of expressions constrained to be in the set is not symmetric and hence the (i, j) and (j, i) elements should be constrained to be symmetric, the AbstractSymmetricMatrixSetSquare set can be used. The Bridges.Constraint.SquareBridge can transform a set from the square form to the triangular_form by adding appropriate constraints if the (i, j) and (j, i) expressions are different.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractSymmetricMatrixSetTriangle\nAbstractSymmetricMatrixSetSquare\nside_dimension\ntriangular_form","category":"page"},{"location":"apireference/#MathOptInterface.AbstractSymmetricMatrixSetTriangle","page":"Reference","title":"MathOptInterface.AbstractSymmetricMatrixSetTriangle","text":"abstract type AbstractSymmetricMatrixSetTriangle <: AbstractVectorSet end\n\nAbstract supertype for subsets of the (vectorized) cone of symmetric matrices, with side_dimension rows and columns. The entries of the upper-right triangular part of the matrix are given column by column (or equivalently, the entries of the lower-left triangular part are given row by row). A vectorized cone of dimension n corresponds to a square matrix with side dimension sqrt14 + 2 n - 12. (Because a d times d matrix has d(d + 1)  2 elements in the upper or lower triangle.)\n\nExamples\n\nThe matrix\n\nbeginbmatrix\n  1  2  4\n  2  3  5\n  4  5  6\nendbmatrix\n\nhas side_dimension 3 and vectorization (1 2 3 4 5 6).\n\nNote\n\nTwo packed storage formats exist for symmetric matrices, the respective orders of the entries are:\n\nupper triangular column by column (or lower triangular row by row);\nlower triangular column by column (or upper triangular row by row).\n\nThe advantage of the first format is the mapping between the (i, j) matrix indices and the k index of the vectorized form. It is simpler and does not depend on the side dimension of the matrix. Indeed,\n\nthe entry of matrix indices (i, j) has vectorized index k = div((j - 1) * j, 2) + i if i leq j and k = div((i - 1) * i, 2) + j if j leq i;\nand the entry with vectorized index k has matrix indices i = div(1 + isqrt(8k - 7), 2) and j = k - div((i - 1) * i, 2) or j = div(1 + isqrt(8k - 7), 2) and i = k - div((j - 1) * j, 2).\n\nDuality note\n\nThe scalar product for the symmetric matrix in its vectorized form is the sum of the pairwise product of the diagonal entries plus twice the sum of the pairwise product of the upper diagonal entries; see [p. 634, 1]. This has important consequence for duality.\n\nConsider for example the following problem (PositiveSemidefiniteConeTriangle is a subtype of AbstractSymmetricMatrixSetTriangle)\n\nbeginalign*\n     max_x in mathbbR  x\n    \n     textst \n    (1 -x 1)  in textPositiveSemidefiniteConeTriangle(2)\nendalign*\n\nThe dual is the following problem\n\nbeginalign*\n     min_x in mathbbR^3  y_1 + y_3\n    \n     textst  2y_2  = 1\n      y  in textPositiveSemidefiniteConeTriangle(2)\nendalign*\n\nWhy do we use 2y_2 in the dual constraint instead of y_2 ? The reason is that 2y_2 is the scalar product between y and the symmetric matrix whose vectorized form is (0 1 0). Indeed, with our modified scalar products we have\n\nlangle\n(0 1 0)\n(y_1 y_2 y_3)\nrangle\n=\nmathrmtrace\nbeginpmatrix\n  0  1\n  1  0\nendpmatrix\nbeginpmatrix\n  y_1  y_2\n  y_2  y_3\nendpmatrix\n= 2y_2\n\nReferences\n\n[1] Boyd, S. and Vandenberghe, L.. Convex optimization. Cambridge university press, 2004.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AbstractSymmetricMatrixSetSquare","page":"Reference","title":"MathOptInterface.AbstractSymmetricMatrixSetSquare","text":"abstract type AbstractSymmetricMatrixSetSquare <: AbstractVectorSet end\n\nAbstract supertype for subsets of the (vectorized) cone of symmetric matrices, with side_dimension rows and columns. The entries of the matrix are given column by column (or equivalently, row by row). The matrix is both constrained to be symmetric and to have its triangular_form belong to the corresponding set. That is, if the functions in entries (i j) and (j i) are different, then a constraint will be added to make sure that the entries are equal.\n\nExamples\n\nPositiveSemidefiniteConeSquare is a subtype of AbstractSymmetricMatrixSetSquare and constraining the matrix\n\nbeginbmatrix\n  1  -y\n  -z  0\nendbmatrix\n\nto be symmetric positive semidefinite can be achieved by constraining the vector (1 -z -y 0) (or (1 -y -z 0)) to belong to the PositiveSemidefiniteConeSquare(2). It both constrains y = z and (1 -y 0) (or (1 -z 0)) to be in PositiveSemidefiniteConeTriangle(2), since triangular_form(PositiveSemidefiniteConeSquare) is PositiveSemidefiniteConeTriangle.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.side_dimension","page":"Reference","title":"MathOptInterface.side_dimension","text":"side_dimension(set::Union{AbstractSymmetricMatrixSetTriangle,\n                          AbstractSymmetricMatrixSetSquare})\n\nSide dimension of the matrices in set. By convention, it should be stored in the side_dimension field but if it is not the case for a subtype of AbstractSymmetricMatrixSetTriangle, the method should be implemented for this subtype.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.triangular_form","page":"Reference","title":"MathOptInterface.triangular_form","text":"triangular_form(S::Type{<:AbstractSymmetricMatrixSetSquare})\ntriangular_form(set::AbstractSymmetricMatrixSetSquare)\n\nReturn the AbstractSymmetricMatrixSetTriangle corresponding to the vectorization of the upper triangular part of matrices in the AbstractSymmetricMatrixSetSquare set.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"List of recognized matrix sets.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"PositiveSemidefiniteConeTriangle\nPositiveSemidefiniteConeSquare\nLogDetConeTriangle\nLogDetConeSquare\nRootDetConeTriangle\nRootDetConeSquare","category":"page"},{"location":"apireference/#MathOptInterface.PositiveSemidefiniteConeTriangle","page":"Reference","title":"MathOptInterface.PositiveSemidefiniteConeTriangle","text":"PositiveSemidefiniteConeTriangle(side_dimension) <: AbstractSymmetricMatrixSetTriangle\n\nThe (vectorized) cone of symmetric positive semidefinite matrices, with side_dimension rows and columns. See AbstractSymmetricMatrixSetTriangle for more details on the vectorized form.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.PositiveSemidefiniteConeSquare","page":"Reference","title":"MathOptInterface.PositiveSemidefiniteConeSquare","text":"PositiveSemidefiniteConeSquare(side_dimension) <: AbstractSymmetricMatrixSetSquare\n\nThe cone of symmetric positive semidefinite matrices, with side length side_dimension.  See AbstractSymmetricMatrixSetSquare for more details on the vectorized form.\n\nThe entries of the matrix are given column by column (or equivalently, row by row). The matrix is both constrained to be symmetric and to be positive semidefinite. That is, if the functions in entries (i j) and (j i) are different, then a constraint will be added to make sure that the entries are equal.\n\nExamples\n\nConstraining the matrix\n\nbeginbmatrix\n  1  -y\n  -z  0\nendbmatrix\n\nto be symmetric positive semidefinite can be achieved by constraining the vector (1 -z -y 0) (or (1 -y -z 0)) to belong to the PositiveSemidefiniteConeSquare(2). It both constrains y = z and (1 -y 0) (or (1 -z 0)) to be in PositiveSemidefiniteConeTriangle(2).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.LogDetConeTriangle","page":"Reference","title":"MathOptInterface.LogDetConeTriangle","text":"LogDetConeTriangle(side_dimension)\n\nThe log-determinant cone  (t u X) in mathbbR^2 + d(d+1)2  t le u log(det(Xu)) u  0  where the matrix X is represented in the same symmetric packed format as in the PositiveSemidefiniteConeTriangle. The argument side_dimension is the side dimension of the matrix X, i.e., its number of rows or columns.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.LogDetConeSquare","page":"Reference","title":"MathOptInterface.LogDetConeSquare","text":"LogDetConeSquare(side_dimension)\n\nThe log-determinant cone  (t u X) in mathbbR^2 + d^2  t le u log(det(Xu)) X text symmetric u  0  where the matrix X is represented in the same format as in the PositiveSemidefiniteConeSquare. Similarly to PositiveSemidefiniteConeSquare, constraints are added to ensures that X is symmetric. The argument side_dimension is the side dimension of the matrix X, i.e., its number of rows or columns.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RootDetConeTriangle","page":"Reference","title":"MathOptInterface.RootDetConeTriangle","text":"RootDetConeTriangle(side_dimension)\n\nThe root-determinant cone  (t X) in mathbbR^1 + d(d+1)2  t le det(X)^1d  where the matrix X is represented in the same symmetric packed format as in the PositiveSemidefiniteConeTriangle. The argument side_dimension is the side dimension of the matrix X, i.e., its number of rows or columns.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.RootDetConeSquare","page":"Reference","title":"MathOptInterface.RootDetConeSquare","text":"RootDetConeSquare(side_dimension)\n\nThe root-determinant cone  (t X) in mathbbR^1 + d^2  t le det(X)^1d X text symmetric  where the matrix X is represented in the same format as in the PositiveSemidefiniteConeSquare. Similarly to PositiveSemidefiniteConeSquare, constraints are added to ensure that X is symmetric. The argument side_dimension is the side dimension of the matrix X, i.e., its number of rows or columns.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Modifications-1","page":"Reference","title":"Modifications","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions for modifying objective and constraint functions.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"modify\nAbstractFunctionModification\nScalarConstantChange\nVectorConstantChange\nScalarCoefficientChange\nMultirowChange","category":"page"},{"location":"apireference/#MathOptInterface.modify","page":"Reference","title":"MathOptInterface.modify","text":"Constraint Function\n\nmodify(model::ModelLike, ci::ConstraintIndex, change::AbstractFunctionModification)\n\nApply the modification specified by change to the function of constraint ci.\n\nAn ModifyConstraintNotAllowed error is thrown if modifying constraints is not supported by the model model.\n\nExamples\n\nmodify(model, ci, ScalarConstantChange(10.0))\n\nObjective Function\n\nmodify(model::ModelLike, ::ObjectiveFunction, change::AbstractFunctionModification)\n\nApply the modification specified by change to the objective function of model. To change the function completely, call set instead.\n\nAn ModifyObjectiveNotAllowed error is thrown if modifying objectives is not supported by the model model.\n\nExamples\n\nmodify(model, ObjectiveFunction{ScalarAffineFunction{Float64}}(), ScalarConstantChange(10.0))\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.AbstractFunctionModification","page":"Reference","title":"MathOptInterface.AbstractFunctionModification","text":"AbstractFunctionModification\n\nAn abstract supertype for structs which specify partial modifications to functions, to be used for making small modifications instead of replacing the functions entirely.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarConstantChange","page":"Reference","title":"MathOptInterface.ScalarConstantChange","text":"ScalarConstantChange{T}(new_constant::T)\n\nA struct used to request a change in the constant term of a scalar-valued function. Applicable to ScalarAffineFunction and ScalarQuadraticFunction.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.VectorConstantChange","page":"Reference","title":"MathOptInterface.VectorConstantChange","text":"VectorConstantChange{T}(new_constant::Vector{T})\n\nA struct used to request a change in the constant vector of a vector-valued function. Applicable to VectorAffineFunction and VectorQuadraticFunction.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ScalarCoefficientChange","page":"Reference","title":"MathOptInterface.ScalarCoefficientChange","text":"ScalarCoefficientChange{T}(variable::VariableIndex, new_coefficient::T)\n\nA struct used to request a change in the linear coefficient of a single variable in a scalar-valued function. Applicable to ScalarAffineFunction and ScalarQuadraticFunction.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.MultirowChange","page":"Reference","title":"MathOptInterface.MultirowChange","text":"MultirowChange{T}(variable::VariableIndex, new_coefficients::Vector{Tuple{Int64, T}})\n\nA struct used to request a change in the linear coefficients of a single variable in a vector-valued function. New coefficients are specified by (output_index, coefficient) tuples. Applicable to VectorAffineFunction and VectorQuadraticFunction.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Nonlinear-programming-(NLP)-1","page":"Reference","title":"Nonlinear programming (NLP)","text":"","category":"section"},{"location":"apireference/#Attributes-2","page":"Reference","title":"Attributes","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"NLPBlock\nNLPBoundsPair\nNLPBlockData\nNLPBlockDual\nNLPBlockDualStart","category":"page"},{"location":"apireference/#MathOptInterface.NLPBlock","page":"Reference","title":"MathOptInterface.NLPBlock","text":"NLPBlock()\n\nHolds the NLPBlockData that represents a set of nonlinear constraints, and optionally a nonlinear objective.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NLPBoundsPair","page":"Reference","title":"MathOptInterface.NLPBoundsPair","text":"NLPBoundsPair(lower,upper)\n\nA struct holding a pair of lower and upper bounds. -Inf and Inf can be used to indicate no lower or upper bound, respectively.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NLPBlockData","page":"Reference","title":"MathOptInterface.NLPBlockData","text":"struct NLPBlockData\n    constraint_bounds::Vector{NLPBoundsPair}\n    evaluator::AbstractNLPEvaluator\n    has_objective::Bool\nend\n\nA struct encoding a set of nonlinear constraints of the form lb le g(x) le ub and, if has_objective == true, a nonlinear objective function f(x). constraint_bounds holds the pairs of lb and ub elements. Nonlinear objectives override any objective set by using the ObjectiveFunction attribute. The evaluator is a callback object that is used to query function values, derivatives, and expression graphs. If has_objective == false, then it is an error to query properties of the objective function, and in Hessian-of-the-Lagrangian queries,  must be set to zero. Throughout the evaluator, all variables are ordered according to ListOfVariableIndices(). \n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NLPBlockDual","page":"Reference","title":"MathOptInterface.NLPBlockDual","text":"NLPBlockDual(N)\nNLPBlockDual()\n\nThe Lagrange multipliers on the constraints from the NLPBlock in result N. If N is omitted, it is 1 by default.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NLPBlockDualStart","page":"Reference","title":"MathOptInterface.NLPBlockDualStart","text":"NLPBlockDualStart()\n\nAn initial assignment of the Lagrange multipliers on the constraints from the NLPBlock that the solver may use to warm-start the solve.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#NLP-evaluator-methods-1","page":"Reference","title":"NLP evaluator methods","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"AbstractNLPEvaluator\ninitialize\nfeatures_available\neval_objective\neval_constraint\neval_objective_gradient\njacobian_structure\nhessian_lagrangian_structure\neval_constraint_jacobian\neval_constraint_jacobian_product\neval_constraint_jacobian_transpose_product\neval_hessian_lagrangian\neval_hessian_lagrangian_product\nobjective_expr\nconstraint_expr","category":"page"},{"location":"apireference/#MathOptInterface.AbstractNLPEvaluator","page":"Reference","title":"MathOptInterface.AbstractNLPEvaluator","text":"AbstractNLPEvaluator\n\nAbstract supertype for the callback object used in NLPBlock.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.initialize","page":"Reference","title":"MathOptInterface.initialize","text":"initialize(d::AbstractNLPEvaluator, requested_features::Vector{Symbol})\n\nMust be called before any other methods. The vector requested_features lists features requested by the solver. These may include :Grad for gradients of f, :Jac for explicit Jacobians of g, :JacVec for Jacobian-vector products, :HessVec for Hessian-vector and Hessian-of-Lagrangian-vector products, :Hess for explicit Hessians and Hessian-of-Lagrangians, and :ExprGraph for expression graphs.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.features_available","page":"Reference","title":"MathOptInterface.features_available","text":"features_available(d::AbstractNLPEvaluator)\n\nReturns the subset of features available for this problem instance, as a list of symbols in the same format as in initialize.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_objective","page":"Reference","title":"MathOptInterface.eval_objective","text":"eval_objective(d::AbstractNLPEvaluator, x)\n\nEvaluate the objective f(x), returning a scalar value.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_constraint","page":"Reference","title":"MathOptInterface.eval_constraint","text":"eval_constraint(d::AbstractNLPEvaluator, g, x)\n\nEvaluate the constraint function g(x), storing the result in the vector g which must be of the appropriate size.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_objective_gradient","page":"Reference","title":"MathOptInterface.eval_objective_gradient","text":"eval_objective_gradient(d::AbstractNLPEvaluator, g, x)\n\nEvaluate nabla f(x) as a dense vector, storing the result in the vector g which must be of the appropriate size.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.jacobian_structure","page":"Reference","title":"MathOptInterface.jacobian_structure","text":"jacobian_structure(d::AbstractNLPEvaluator)::Vector{Tuple{Int64,Int64}}\n\nReturns the sparsity structure of the Jacobian matrix J_g(x) = left beginarrayc nabla g_1(x)  nabla g_2(x)  vdots  nabla g_m(x) endarrayright where g_i is the itextth component of g. The sparsity structure is assumed to be independent of the point x. Returns a vector of tuples, (row, column), where each indicates the position of a structurally nonzero element. These indices are not required to be sorted and can contain duplicates, in which case the solver should combine the corresponding elements by adding them together.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.hessian_lagrangian_structure","page":"Reference","title":"MathOptInterface.hessian_lagrangian_structure","text":"hessian_lagrangian_structure(d::AbstractNLPEvaluator)::Vector{Tuple{Int64,Int64}}\n\nReturns the sparsity structure of the Hessian-of-the-Lagrangian matrix nabla^2 f + sum_i=1^m nabla^2 g_i as a vector of tuples, where each indicates the position of a structurally nonzero element. These indices are not required to be sorted and can contain duplicates, in which case the solver should combine the corresponding elements by adding them together. Any mix of lower and upper-triangular indices is valid. Elements (i,j) and (j,i), if both present, should be treated as duplicates.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_constraint_jacobian","page":"Reference","title":"MathOptInterface.eval_constraint_jacobian","text":"eval_constraint_jacobian(d::AbstractNLPEvaluator, J, x)\n\nEvaluates the sparse Jacobian matrix J_g(x) = left beginarrayc nabla g_1(x)  nabla g_2(x)  vdots  nabla g_m(x) endarrayright. The result is stored in the vector J in the same order as the indices returned by jacobian_structure.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_constraint_jacobian_product","page":"Reference","title":"MathOptInterface.eval_constraint_jacobian_product","text":"eval_constraint_jacobian_product(d::AbstractNLPEvaluator, y, x, w)\n\nComputes the Jacobian-vector product J_g(x)w, storing the result in the vector y.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_constraint_jacobian_transpose_product","page":"Reference","title":"MathOptInterface.eval_constraint_jacobian_transpose_product","text":"eval_constraint_jacobian_transpose_product(d::AbstractNLPEvaluator, y, x, w)\n\nComputes the Jacobian-transpose-vector product J_g(x)^Tw, storing the result in the vector y.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_hessian_lagrangian","page":"Reference","title":"MathOptInterface.eval_hessian_lagrangian","text":"eval_hessian_lagrangian(d::AbstractNLPEvaluator, H, x, , )\n\nGiven scalar weight  and vector of constraint weights , computes the sparse Hessian-of-the-Lagrangian matrix sigmanabla^2 f(x) + sum_i=1^m mu_i nabla^2 g_i(x), storing the result in the vector H in the same order as the indices returned by hessian_lagrangian_structure.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.eval_hessian_lagrangian_product","page":"Reference","title":"MathOptInterface.eval_hessian_lagrangian_product","text":"eval_hessian_lagrangian_product(d::AbstractNLPEvaluator, h, x, v, , )\n\nGiven scalar weight  and vector of constraint weights , computes the Hessian-of-the-Lagrangian-vector product left(sigmanabla^2 f(x) + sum_i=1^m mu_i nabla^2 g_i(x)right)v, storing the result in the vector h.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.objective_expr","page":"Reference","title":"MathOptInterface.objective_expr","text":"objective_expr(d::AbstractNLPEvaluator)\n\nReturns an expression graph for the objective function as a standard Julia Expr object. All sums and products are flattened out as simple Expr(:+,...) and Expr(:*,...) objects. The symbol x is used as a placeholder for the vector of decision variables. No other undefined symbols are permitted; coefficients are embedded as explicit values. For example, the expression x_1+sin(x_2exp(x_3)) would be represented as the Julia object :(x[1] + sin(x[2]/exp(x[3]))). Each integer index is wrapped in a VariableIndex. See the Julia manual for more information on the structure of Expr objects. There are currently no restrictions on recognized functions; typically these will be built-in Julia functions like ^, exp, log, cos, tan, sqrt, etc., but modeling interfaces may choose to extend these basic functions.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.constraint_expr","page":"Reference","title":"MathOptInterface.constraint_expr","text":"constraint_expr(d::AbstractNLPEvaluator, i)\n\nReturns an expression graph for the itextth constraint in the same format as described above, with an additional comparison operator indicating the sense of and bounds on the constraint. The right-hand side of the comparison must be a constant; that is, :(x[1]^3 <= 1) is allowed, while :(1 <= x[1]^3) is not valid. Double-sided constraints are allowed, in which case both the lower bound and upper bounds should be constants; for example, :(-1 <= cos(x[1]) + sin(x[2]) <= 1) is valid.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Errors-1","page":"Reference","title":"Errors","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When an MOI call fails on a model, precise errors should be thrown when possible instead of simply calling error with a message. The docstrings for the respective methods describe the errors that the implementation should thrown in certain situations. This error-reporting system allows code to distinguish between internal errors (that should be shown to the user) and unsupported operations which may have automatic workarounds.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When an invalid index is used in an MOI call, an InvalidIndex should be thrown:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"InvalidIndex","category":"page"},{"location":"apireference/#MathOptInterface.InvalidIndex","page":"Reference","title":"MathOptInterface.InvalidIndex","text":"struct InvalidIndex{IndexType<:Index} <: Exception\n    index::IndexType\nend\n\nAn error indicating that the index index is invalid.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"As discussed in JuMP mapping, for scalar constraint with a nonzero function constant, a ScalarFunctionConstantNotZero exception may be thrown:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"ScalarFunctionConstantNotZero","category":"page"},{"location":"apireference/#MathOptInterface.ScalarFunctionConstantNotZero","page":"Reference","title":"MathOptInterface.ScalarFunctionConstantNotZero","text":"struct ScalarFunctionConstantNotZero{T, F, S} <: Exception\n    constant::T\nend\n\nAn error indicating that the constant part of the function in the constraint F-in-S is nonzero.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Some SingleVariable constraints cannot be combined on the same variable:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"LowerBoundAlreadySet\nUpperBoundAlreadySet","category":"page"},{"location":"apireference/#MathOptInterface.LowerBoundAlreadySet","page":"Reference","title":"MathOptInterface.LowerBoundAlreadySet","text":"LowerBoundAlreadySet{S1, S2}\n\nError thrown when setting a SingleVariable-in-S2 when a SingleVariable-in-S1 has already been added and the sets S1, S2 both set a lower bound, i.e. they are EqualTo, GreaterThan, Interval, Semicontinuous or Semiinteger.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.UpperBoundAlreadySet","page":"Reference","title":"MathOptInterface.UpperBoundAlreadySet","text":"UpperBoundAlreadySet{S1, S2}\n\nError thrown when setting a SingleVariable-in-S2 when a SingleVariable-in-S1 has already been added and the sets S1, S2 both set an upper bound, i.e. they are EqualTo, LessThan, Interval, Semicontinuous or Semiinteger.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"As discussed in AbstractCallback, trying to get attributes inside a callback may throw:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"OptimizeInProgress","category":"page"},{"location":"apireference/#MathOptInterface.OptimizeInProgress","page":"Reference","title":"MathOptInterface.OptimizeInProgress","text":"struct OptimizeInProgress{AttrType<:AnyAttribute} <: Exception\n    attr::AttrType\nend\n\nError thrown from optimizer when MOI.get(optimizer, attr) is called inside an AbstractCallback while it is only defined once optimize! has completed. This can only happen when is_set_by_optimize(attr) is true.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Trying to submit the wrong type of AbstractSubmittable inside an AbstractCallback (e.g., a UserCut inside a LazyConstraintCallback) will throw:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"InvalidCallbackUsage","category":"page"},{"location":"apireference/#MathOptInterface.InvalidCallbackUsage","page":"Reference","title":"MathOptInterface.InvalidCallbackUsage","text":"struct InvalidCallbackUsage{C, S} <: Exception\n    callback::C\n    submittable::S\nend\n\nAn error indicating that submittable cannot be submitted inside callback.\n\nFor example, UserCut cannot be submitted inside LazyConstraintCallback.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The rest of the errors defined in MOI fall in two categories represented by the following two abstract types:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"UnsupportedError\nNotAllowedError","category":"page"},{"location":"apireference/#MathOptInterface.UnsupportedError","page":"Reference","title":"MathOptInterface.UnsupportedError","text":"UnsupportedError <: Exception\n\nAbstract type for error thrown when an element is not supported by the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.NotAllowedError","page":"Reference","title":"MathOptInterface.NotAllowedError","text":"NotAllowedError <: Exception\n\nAbstract type for error thrown when an operation is supported but cannot be applied in the current state of the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The different UnsupportedError and NotAllowedError are the following errors:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"UnsupportedAttribute\nSetAttributeNotAllowed\nAddVariableNotAllowed\nUnsupportedConstraint\nAddConstraintNotAllowed\nModifyConstraintNotAllowed\nModifyObjectiveNotAllowed\nDeleteNotAllowed\nUnsupportedSubmittable\nSubmitNotAllowed","category":"page"},{"location":"apireference/#MathOptInterface.UnsupportedAttribute","page":"Reference","title":"MathOptInterface.UnsupportedAttribute","text":"struct UnsupportedAttribute{AttrType} <: UnsupportedError\n    attr::AttrType\n    message::String\nend\n\nAn error indicating that the attribute attr is not supported by the model, i.e. that supports returns false.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SetAttributeNotAllowed","page":"Reference","title":"MathOptInterface.SetAttributeNotAllowed","text":"struct SetAttributeNotAllowed{AttrType} <: NotAllowedError\n    attr::AttrType\n    message::String # Human-friendly explanation why the attribute cannot be set\nend\n\nAn error indicating that the attribute attr is supported (see supports) but cannot be set for some reason (see the error string).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AddVariableNotAllowed","page":"Reference","title":"MathOptInterface.AddVariableNotAllowed","text":"struct AddVariableNotAllowed <: NotAllowedError\n    message::String # Human-friendly explanation why the attribute cannot be set\nend\n\nAn error indicating that variables cannot be added to the model.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.UnsupportedConstraint","page":"Reference","title":"MathOptInterface.UnsupportedConstraint","text":"struct UnsupportedConstraint{F<:AbstractFunction, S<:AbstractSet} <: UnsupportedError\n    message::String # Human-friendly explanation why the attribute cannot be set\nend\n\nAn error indicating that constraints of type F-in-S are not supported by the model, i.e. that supports_constraint returns false.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.AddConstraintNotAllowed","page":"Reference","title":"MathOptInterface.AddConstraintNotAllowed","text":"struct AddConstraintNotAllowed{F<:AbstractFunction, S<:AbstractSet} <: NotAllowedError\n    message::String # Human-friendly explanation why the attribute cannot be set\nend\n\nAn error indicating that constraints of type F-in-S are supported (see supports_constraint) but cannot be added.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ModifyConstraintNotAllowed","page":"Reference","title":"MathOptInterface.ModifyConstraintNotAllowed","text":"struct ModifyConstraintNotAllowed{F<:AbstractFunction, S<:AbstractSet,\n                                  C<:AbstractFunctionModification} <: NotAllowedError\n    constraint_index::ConstraintIndex{F, S}\n    change::C\n    message::String\nend\n\nAn error indicating that the constraint modification change cannot be applied to the constraint of index ci.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.ModifyObjectiveNotAllowed","page":"Reference","title":"MathOptInterface.ModifyObjectiveNotAllowed","text":"struct ModifyObjectiveNotAllowed{C<:AbstractFunctionModification} <: NotAllowedError\n    change::C\n    message::String\nend\n\nAn error indicating that the objective modification change cannot be applied to the objective.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.DeleteNotAllowed","page":"Reference","title":"MathOptInterface.DeleteNotAllowed","text":"struct DeleteNotAllowed{IndexType <: Index} <: NotAllowedError\n    index::IndexType\n    message::String\nend\n\nAn error indicating that the index index cannot be deleted.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.UnsupportedSubmittable","page":"Reference","title":"MathOptInterface.UnsupportedSubmittable","text":"struct UnsupportedSubmittable{SubmitType} <: UnsupportedError\n    sub::SubmitType\n    message::String\nend\n\nAn error indicating that the submittable sub is not supported by the model, i.e. that supports returns false.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.SubmitNotAllowed","page":"Reference","title":"MathOptInterface.SubmitNotAllowed","text":"struct SubmitNotAllowed{SubmitTyp<:AbstractSubmittable} <: NotAllowedError\n    sub::SubmitType\n    message::String # Human-friendly explanation why the attribute cannot be set\nend\n\nAn error indicating that the submittable sub is supported (see supports) but cannot be added for some reason (see the error string).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#Models-1","page":"Reference","title":"Models","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.Model provides an implementation of a ModelLike that efficiently supports all functions and sets defined within MOI. However, given the extensibility of MOI, this might not over all use cases.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.UniversalFallback is a layer that sits on top of any ModelLike and provides non-specialized (slower) fallbacks for constraints and attributes that the underlying ModeLike does not support.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"For advanced use cases that need efficient support for functions and sets defined outside of MOI (but still known at compile time), we provide the Utilities.@model macro.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.Model\nUtilities.UniversalFallback\nUtilities.@model","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.Model","page":"Reference","title":"MathOptInterface.Utilities.Model","text":"An implementation of ModelLike that supports all functions and sets defined in MOI. It is parameterized by the coefficient type.\n\nExamples\n\nmodel = Model{Float64}()\nx = add_variable(model)\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Utilities.UniversalFallback","page":"Reference","title":"MathOptInterface.Utilities.UniversalFallback","text":"UniversalFallback\n\nThe UniversalFallback can be applied on a MathOptInterface.ModelLike model to create the model UniversalFallback(model) supporting any constraint and attribute. This allows to have a specialized implementation in model for performance critical constraints and attributes while still supporting other attributes with a small performance penalty. Note that model is unaware of constraints and attributes stored by UniversalFallback so this is not appropriate if model is an optimizer (for this reason, MathOptInterface.optimize! has not been implemented). In that case, optimizer bridges should be used instead.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Utilities.@model","page":"Reference","title":"MathOptInterface.Utilities.@model","text":"macro model(\n    model_name,\n    scalar_sets,\n    typed_scalar_sets,\n    vector_sets,\n    typed_vector_sets,\n    scalar_functions,\n    typed_scalar_functions,\n    vector_functions,\n    typed_vector_functions,\n    is_optimizer = false\n)\n\nCreates a type model_name implementing the MOI model interface and containing scalar_sets scalar sets typed_scalar_sets typed scalar sets, vector_sets vector sets, typed_vector_sets typed vector sets, scalar_functions scalar functions, typed_scalar_functions typed scalar functions, vector_functions vector functions and typed_vector_functions typed vector functions. To give no set/function, write (), to give one set S, write (S,).\n\nThe function MathOptInterface.SingleVariable should not be given in scalar_functions. The model supports MathOptInterface.SingleVariable-in-F constraints where F is MathOptInterface.EqualTo, MathOptInterface.GreaterThan, MathOptInterface.LessThan, MathOptInterface.Interval, MathOptInterface.Integer, MathOptInterface.ZeroOne, MathOptInterface.Semicontinuous or MathOptInterface.Semiinteger. The sets supported with the MathOptInterface.SingleVariable cannot be controlled from the macro, use the UniversalFallback to support more sets.\n\nThis macro creates a model specialized for specific types of constraint, by defining specialized structures and methods. To create a model that, in addition to be optimized for specific constraints, also support arbitrary constraints and attributes, use UniversalFallback.\n\nThis implementation of the MOI model certifies that the constraint indices, in addition to being different between constraints F-in-S for the same types F and S, are also different between constraints for different types F and S. This means that for constraint indices ci1, ci2 of this model, ci1 == ci2 if and only if ci1.value == ci2.value. This fact can be used to use the the value of the index directly in a dictionary representing a mapping between constraint indices and something else.\n\nIf is_optimizer = true, the resulting struct is a subtype of of MOIU.AbstractOptimizer, which is a subtype of MathOptInterface.AbstractOptimizer, otherwise, it is a subtype of MOIU.AbstractModelLike, which is a subtype of MathOptInterface.ModelLike.\n\nExamples\n\nThe model describing an linear program would be:\n\n@model(LPModel,                                                   # Name of model\n      (),                                                         # untyped scalar sets\n      (MOI.EqualTo, MOI.GreaterThan, MOI.LessThan, MOI.Interval), #   typed scalar sets\n      (MOI.Zeros, MOI.Nonnegatives, MOI.Nonpositives),            # untyped vector sets\n      (),                                                         #   typed vector sets\n      (),                                                         # untyped scalar functions\n      (MOI.ScalarAffineFunction,),                                #   typed scalar functions\n      (MOI.VectorOfVariables,),                                   # untyped vector functions\n      (MOI.VectorAffineFunction,),                                #   typed vector functions\n      false\n    )\n\nLet MOI denote MathOptInterface, MOIU denote MOI.Utilities and MOIU.ConstraintEntry{F, S} be defined as MOI.Tuple{MOI.ConstraintIndex{F, S}, F, S}. The macro would create the types:\n\nstruct LPModelScalarConstraints{T, F <: MOI.AbstractScalarFunction} <: MOIU.Constraints{F}\n    equalto::Vector{MOIU.ConstraintEntry{F, MOI.EqualTo{T}}}\n    greaterthan::Vector{MOIU.ConstraintEntry{F, MOI.GreaterThan{T}}}\n    lessthan::Vector{MOIU.ConstraintEntry{F, MOI.LessThan{T}}}\n    interval::Vector{MOIU.ConstraintEntry{F, MOI.Interval{T}}}\nend\nstruct LPModelVectorConstraints{T, F <: MOI.AbstractVectorFunction} <: MOIU.Constraints{F}\n    zeros::Vector{MOIU.ConstraintEntry{F, MOI.Zeros}}\n    nonnegatives::Vector{MOIU.ConstraintEntry{F, MOI.Nonnegatives}}\n    nonpositives::Vector{MOIU.ConstraintEntry{F, MOI.Nonpositives}}\nend\nmutable struct LPModel{T} <: MOIU.AbstractModel{T}\n    name::String\n    sense::MOI.OptimizationSense\n    objective::Union{MOI.SingleVariable, MOI.ScalarAffineFunction{T}, MOI.ScalarQuadraticFunction{T}}\n    num_variables_created::Int64\n    # If nothing, no variable has been deleted so the indices of the\n    # variables are VI.(1:num_variables_created)\n    variable_indices::Union{Nothing, Set{MOI.VariableIndex}}\n    # Union of flags of `S` such that a `SingleVariable`-in-`S`\n    # constraint was added to the model and not deleted yet.\n    single_variable_mask::Vector{UInt8}\n    # Lower bound set by `SingleVariable`-in-`S` where `S`is\n    # `GreaterThan{T}`, `EqualTo{T}` or `Interval{T}`.\n    lower_bound::Vector{T}\n    # Lower bound set by `SingleVariable`-in-`S` where `S`is\n    # `LessThan{T}`, `EqualTo{T}` or `Interval{T}`.\n    upper_bound::Vector{T}\n    var_to_name::Dict{MOI.VariableIndex, String}\n    # If `nothing`, the dictionary hasn't been constructed yet.\n    name_to_var::Union{Dict{String, MOI.VariableIndex}, Nothing}\n    nextconstraintid::Int64\n    con_to_name::Dict{MOI.ConstraintIndex, String}\n    name_to_con::Union{Dict{String, MOI.ConstraintIndex}, Nothing}\n    constrmap::Vector{Int}\n    scalaraffinefunction::LPModelScalarConstraints{T, MOI.ScalarAffineFunction{T}}\n    vectorofvariables::LPModelVectorConstraints{T, MOI.VectorOfVariables}\n    vectoraffinefunction::LPModelVectorConstraints{T, MOI.VectorAffineFunction{T}}\nend\n\nThe type LPModel implements the MathOptInterface API except methods specific to solver models like optimize! or getattribute with VariablePrimal.\n\n\n\n\n\n","category":"macro"},{"location":"apireference/#Bridges-1","page":"Reference","title":"Bridges","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges can be used for automatic reformulation of constrained variables (i.e. variables added with add_constrained_variable/add_constrained_variables) or constraints into equivalent formulations using constrained variables and constraints of different types. There are two important concepts to distinguish:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.AbstractBridges are recipes implementing a specific reformulation. Bridges are not directly subtypes of Bridges.AbstractBridge, they are either Bridges.Variable.AbstractBridge or Bridges.Constraint.AbstractBridge.\nBridges.AbstractBridgeOptimizer is a layer that can be applied to another ModelLike to apply the reformulation. The Bridges.LazyBridgeOptimizer automatically chooses the appropriate bridges to use when a constrained variable or constraint is not supported by using the list of bridges that were added to it by Bridges.add_bridge. Bridges.full_bridge_optimizer wraps a model in a Bridges.LazyBridgeOptimizer where all the bridges defined in MOI are added. This is the recommended way to use bridges in the Testing guideline, and JuMP automatically calls Bridges.full_bridge_optimizer when attaching an optimizer. Bridges.debug_supports_constraint and Bridges.debug_supports allow introspection into the bridge selection rationale of Bridges.LazyBridgeOptimizer.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Most bridges are added by default in Bridges.full_bridge_optimizer. However, for technical reasons, some bridges are not added by default, for instance: Bridges.Constraint.SOCtoPSDBridge, Bridges.Constraint.SOCtoNonConvexQuadBridge and Bridges.Constraint.RSOCtoNonConvexQuadBridge. See the docs of those bridges for more information.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"It is possible to add those bridges and also user defined bridges, following one of the two methods. We present the examples for: Bridges.Constraint.SOCtoNonConvexQuadBridge.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The first option is to add the specific bridges to a bridged_model optimizer, with coefficient type T. The bridged_model optimizer itself must have been constructed with a Bridges.LazyBridgeOptimizer. Once such a optimizer is available, we can proceed using using Bridges.add_bridge:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOIB.add_bridge(bridged_model, SOCtoNonConvexQuadBridge{T})","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Alternatively, it is possible to create a Bridges.Constraint.SingleBridgeOptimizer and wrap an existing model with it:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"const SOCtoNonConvexQuad{T, OT<:ModelLike} = Bridges.Constraint.SingleBridgeOptimizer{Bridges.Constraint.SOCtoNonConvexQuadBridge{T}, OT}\nbridged_model = SOCtoNonConvexQuad{Float64}(model)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Those procedures could be applied to user define bridges. For the bridges defined in MathOptInterface, the Bridges.Constraint.SingleBridgeOptimizer's are already created, therefore, for the case of Bridges.Constraint.SOCtoNonConvexQuadBridge, one could simply use the existing optimizer:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"bridged_model = Bridges.Constraint.SOCtoNonConvexQuad{Float64}(model)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.AbstractBridge\nBridges.AbstractBridgeOptimizer\nBridges.LazyBridgeOptimizer\nBridges.add_bridge\nBridges.remove_bridge\nBridges.has_bridge\nBridges.full_bridge_optimizer\nBridges.debug_supports_constraint\nBridges.debug_supports","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.AbstractBridge","page":"Reference","title":"MathOptInterface.Bridges.AbstractBridge","text":"AbstractBridge\n\nRepresents a bridged constraint or variable in a MathOptInterface.Bridges.AbstractBridgeOptimizer. It contains the indices of the variables and constraints that it has created in the model. These can be obtained using MathOptInterface.NumberOfVariables, MathOptInterface.ListOfVariableIndices, MathOptInterface.NumberOfConstraints and MathOptInterface.ListOfConstraintIndices using MathOptInterface.get with the bridge in place of the MathOptInterface.ModelLike. Attributes of the bridged model such as MathOptInterface.ConstraintDual and MathOptInterface.ConstraintPrimal, can be obtained using MathOptInterface.get with the bridge in place of the constraint index. These calls are used by the MathOptInterface.Bridges.AbstractBridgeOptimizer to communicate with the bridge so they should be implemented by the bridge.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.AbstractBridgeOptimizer","page":"Reference","title":"MathOptInterface.Bridges.AbstractBridgeOptimizer","text":"AbstractBridgeOptimizer\n\nA bridge optimizer applies given constraint bridges to a given optimizer thus extending the types of supported constraints. The attributes of the inner optimizer are automatically transformed to make the bridges transparent, e.g. the variables and constraints created by the bridges are hidden.\n\nBy convention, the inner optimizer should be stored in a model field and the dictionary mapping constraint indices to bridges should be stored in a bridges field. If a bridge optimizer deviates from these conventions, it should implement the functions MOI.optimize! and bridge respectively.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.LazyBridgeOptimizer","page":"Reference","title":"MathOptInterface.Bridges.LazyBridgeOptimizer","text":"LazyBridgeOptimizer{OT<:MOI.ModelLike} <: AbstractBridgeOptimizer\n\nThe LazyBridgeOptimizer combines several bridges, which are added using the add_bridge function. Whenever a constraint is added, it only attempts to bridge it if it is not supported by the internal model (hence its name Lazy). When bridging a constraint, it selects the minimal number of bridges needed. For instance, a constraint F-in-S can be bridged into a constraint F1-in-S1 (supported by the internal model) using bridge 1 or bridged into a constraint F2-in-S2 (unsupported by the internal model) using bridge 2 which can then be bridged into a constraint F3-in-S3 (supported by the internal model) using bridge 3, it will choose bridge 1 as it allows to bridge F-in-S using only one bridge instead of two if it uses bridge 2 and 3.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.add_bridge","page":"Reference","title":"MathOptInterface.Bridges.add_bridge","text":"add_bridge(b::LazyBridgeOptimizer, BT::Type{<:AbstractBridge})\n\nEnable the use of the bridges of type BT by b.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.remove_bridge","page":"Reference","title":"MathOptInterface.Bridges.remove_bridge","text":"remove_bridge(b::LazyBridgeOptimizer, BT::Type{<:AbstractBridge})\n\nDisable the use of the bridges of type BT by b.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.has_bridge","page":"Reference","title":"MathOptInterface.Bridges.has_bridge","text":"has_bridge(b::LazyBridgeOptimizer, BT::Type{<:AbstractBridge})\n\nReturn a Bool indicating whether the bridges of type BT are used by b.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.full_bridge_optimizer","page":"Reference","title":"MathOptInterface.Bridges.full_bridge_optimizer","text":"full_bridge_optimizer(model::MOI.ModelLike, ::Type{T}) where T\n\nReturns a LazyBridgeOptimizer bridging model for every bridge defined in this package and for the coefficient type T.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.debug_supports_constraint","page":"Reference","title":"MathOptInterface.Bridges.debug_supports_constraint","text":"debug_supports_constraint(\n    b::LazyBridgeOptimizer, F::Type{<:MOI.AbstractFunction},\n    S::Type{<:MOI.AbstractSet}; io::IO = Base.stdout)\n\nPrints to io explanations for the value of MOI.supports_constraint with the same arguments.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.debug_supports","page":"Reference","title":"MathOptInterface.Bridges.debug_supports","text":"debug_supports(b::LazyBridgeOptimizer, ::MOI.ObjectiveFunction{F}; io::IO = Base.stdout) where F\n\nPrints to io explanations for the value of MOI.supports with the same arguments.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#variable_bridges-1","page":"Reference","title":"Variable bridges","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When variables are added, either free with add_variable/add_variables, or constrained with add_constrained_variable/add_constrained_variables, variable bridges allow to return bridged variables that do not correspond to variables of the underlying model. These variables are parametrized by variables of the underlying model and this parametrization can be obtained with Bridges.bridged_variable_function. Similarly, the variables of the underlying model that were created by the bridge can be expressed in terms of the bridged variables and this expression can be obtained with Bridges.unbridged_variable_function. For instance, consider a model bridged by the Bridges.Variable.VectorizeBridge:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"model = MOI.Utilities.Model{Float64}()\nbridged_model = MOI.Bridges.Variable.Vectorize{Float64}(model)\nbridged_variable, bridged_constraint = MOI.add_constrained_variable(bridged_model, MOI.GreaterThan(1.0))\n\n# output\n\n(VariableIndex(-1), MOI.ConstraintIndex{MOI.SingleVariable,MOI.GreaterThan{Float64}}(-1))","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The constrained variable in MOI.GreaterThan(1.0) returned is a bridged variable as its index in negative. In model, a constrained variable in MOI.Nonnegatives is created:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"inner_variables = MOI.get(model, MOI.ListOfVariableIndices())\n\n# output\n\n1-element Array{VariableIndex,1}:\n VariableIndex(1)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"In the functions used for adding constraints or setting the objective to bridged_model, bridged_variable is substituted for inner_variables[1] plus 1:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOI.Bridges.bridged_variable_function(bridged_model, bridged_variable)\n\n# output\n\nMOI.ScalarAffineFunction{Float64}(MOI.ScalarAffineTerm{Float64}[ScalarAffineTerm{Float64}(1.0, VariableIndex(1))], 1.0)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When getting ConstraintFunction or ObjectiveFunction, inner_variables[1] is substituted for bridged_variable minus 1:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOI.Bridges.unbridged_variable_function(bridged_model, inner_variables[1])\n\n# output\n\nMOI.ScalarAffineFunction{Float64}(MOI.ScalarAffineTerm{Float64}[ScalarAffineTerm{Float64}(1.0, VariableIndex(-1))], -1.0)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"note: Note\nA notable exception is with Bridges.Variable.ZerosBridge where no variable is created in the underlying model as the variables are simply transformed to zeros. When this bridge is used, it is not possible to recover functions with bridged variables from functions of the inner model. Consider for instance that we create two zero variables:model = MOI.Utilities.Model{Float64}()\nbridged_model = MOI.Bridges.Variable.Zeros{Float64}(model)\nbridged_variables, bridged_constraint = MOI.add_constrained_variables(bridged_model, MOI.Zeros(2))\n\n# output\n\n(MOI.VariableIndex[VariableIndex(-1), VariableIndex(-2)], MOI.ConstraintIndex{MOI.VectorOfVariables,MOI.Zeros}(-1))Consider the following functions in the variables of bridged_model:func = MOI.Utilities.operate(+, Float64, MOI.SingleVariable.(bridged_variables)...)\n\n# output\n\nMOI.ScalarAffineFunction{Float64}(MOI.ScalarAffineTerm{Float64}[ScalarAffineTerm{Float64}(1.0, VariableIndex(-1)), ScalarAffineTerm{Float64}(1.0, VariableIndex(-2))], 0.0)We can obtain the equivalent function in the variables of model as follows:inner_func = MOI.Bridges.bridged_function(bridged_model, func)\n\n# output\n\nMOI.ScalarAffineFunction{Float64}(MOI.ScalarAffineTerm{Float64}[], 0.0)However, it's not possible to invert this operation. Indeed, since the bridged variables are substituted for zeros, we cannot deduce whether they were present in the initial function.MOI.Bridges.unbridged_function(bridged_model, inner_func)\n\n# output\n\nERROR: Cannot unbridge function because some variables are bridged by variable bridges that do not support reverse mapping, e.g., `ZerosBridge`.\nStacktrace:\n [1] error(::String, ::String, ::String) at ./error.jl:42\n [2] throw_if_cannot_unbridge at /home/blegat/.julia/dev/MathOptInterface/src/Bridges/Variable/map.jl:343 [inlined]\n [3] unbridged_function(::MOI.Bridges.Variable.SingleBridgeOptimizer{MOI.Bridges.Variable.ZerosBridge{Float64},MOI.Utilities.Model{Float64}}, ::MOI.ScalarAffineFunction{Float64}) at /home/blegat/.julia/dev/MOI/src/Bridges/bridge_optimizer.jl:920\n [4] top-level scope at none:0","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Variable.AbstractBridge\nBridges.bridged_variable_function\nBridges.unbridged_variable_function","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Variable.AbstractBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.AbstractBridge","text":"AbstractBridge\n\nSubtype of MathOptInterface.Bridges.AbstractBridge for variable bridges.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.bridged_variable_function","page":"Reference","title":"MathOptInterface.Bridges.bridged_variable_function","text":"bridged_variable_function(b::AbstractBridgeOptimizer,\n                          vi::MOI.VariableIndex)\n\nReturn a MOI.AbstractScalarFunction of variables of b.model that equals vi. That is, if the variable vi is bridged, it returns its expression in terms of the variables of b.model. Otherwise, it returns MOI.SingleVariable(vi).\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.unbridged_variable_function","page":"Reference","title":"MathOptInterface.Bridges.unbridged_variable_function","text":"unbridged_variable_function(b::AbstractBridgeOptimizer,\n                            vi::MOI.VariableIndex)\n\nReturn a MOI.AbstractScalarFunction of variables of b that equals vi. That is, if the variable vi is an internal variable of b.model created by a bridge but not visible to the user, it returns its expression in terms of the variables of bridged variables. Otherwise, it returns MOI.SingleVariable(vi).\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Below is the list of variable bridges implemented in this package.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Variable.ZerosBridge\nBridges.Variable.FreeBridge\nBridges.Variable.NonposToNonnegBridge\nBridges.Variable.VectorizeBridge\nBridges.Variable.SOCtoRSOCBridge\nBridges.Variable.RSOCtoSOCBridge\nBridges.Variable.RSOCtoPSDBridge","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Variable.ZerosBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.ZerosBridge","text":"ZerosBridge{T} <: Bridges.Variable.AbstractBridge\n\nTransforms constrained variables in MathOptInterface.Zeros to zeros, which ends up creating no variables in the underlying model. The bridged variables are therefore similar to parameters with zero values. Parameters with non-zero value can be created with constrained variables in MOI.EqualTo by combining a VectorizeBridge and this bridge. The functions cannot be unbridged, given a function, we cannot determine, if the bridged variables were used. The dual values cannot be determined by the bridge but they can be determined by the bridged optimizer using MathOptInterface.Utilities.get_fallback if a CachingOptimizer is used (since ConstraintFunction cannot be got as functions cannot be unbridged).\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.FreeBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.FreeBridge","text":"FreeBridge{T} <: Bridges.Variable.AbstractBridge\n\nTransforms constrained variables in MOI.Reals to the difference of constrained variables in MOI.Nonnegatives.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.NonposToNonnegBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.NonposToNonnegBridge","text":"NonposToNonnegBridge{T, F<:MOI.AbstractVectorFunction, G<:MOI.AbstractVectorFunction} <:\n    FlipSignBridge{T, MOI.Nonpositives, MOI.Nonnegatives, F, G}\n\nTransforms constrained variables in Nonpositives into constrained variables in Nonnegatives.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.VectorizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.VectorizeBridge","text":"VectorizeBridge{T, S}\n\nTransforms a constrained variable in scalar_set_type(S, T) where S <: VectorLinearSet into a constrained vector of one variable in S. For instance, VectorizeBridge{Float64, MOI.Nonnegatives} transforms a constrained variable in MOI.GreaterThan{Float64} into a constrained vector of one variable in MOI.Nonnegatives.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.SOCtoRSOCBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.SOCtoRSOCBridge","text":"SOCtoRSOCBridge{T} <: Bridges.Variable.AbstractBridge\n\nSame transformation as MOI.Bridges.Constraint.SOCRBridge.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.RSOCtoSOCBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.RSOCtoSOCBridge","text":"RSOCtoSOCBridge{T} <: Bridges.Variable.AbstractBridge\n\nSame transformation as MOI.Bridges.Constraint.RSOCBridge.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.RSOCtoPSDBridge","page":"Reference","title":"MathOptInterface.Bridges.Variable.RSOCtoPSDBridge","text":"RSOCtoPSDBridge{T} <: Bridges.Variable.AbstractBridge\n\nTransforms constrained variables in MathOptInterface.RotatedSecondOrderCone to constrained variables in MathOptInterface.PositiveSemidefiniteConeTriangle.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"For each bridge defined in this package, a corresponding Bridges.Variable.SingleBridgeOptimizer is available with the same name without the \"Bridge\" suffix, e.g., SplitInterval is a SingleBridgeOptimizer for the SplitIntervalBridge. Moreover, they are all added in the Bridges.LazyBridgeOptimizer returned by Bridges.full_bridge_optimizer as it calls Bridges.Variable.add_all_bridges.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Variable.SingleBridgeOptimizer\nBridges.Variable.add_all_bridges","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Variable.SingleBridgeOptimizer","page":"Reference","title":"MathOptInterface.Bridges.Variable.SingleBridgeOptimizer","text":"SingleBridgeOptimizer{BT<:AbstractBridge, OT<:MOI.ModelLike} <: AbstractBridgeOptimizer\n\nThe SingleBridgeOptimizer bridges any constrained variables supported by the bridge BT. This is in contrast with the MathOptInterface.Bridges.LazyBridgeOptimizer which only bridges the constrained variables that are unsupported by the internal model, even if they are supported by one of its bridges.\n\nnote: Note\nTwo bridge optimizers using variable bridges cannot be used together as both of them assume that the underlying model only returns variable indices with nonnegative values.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Variable.add_all_bridges","page":"Reference","title":"MathOptInterface.Bridges.Variable.add_all_bridges","text":"add_all_bridges(bridged_model, T::Type)\n\nAdd all bridges defined in the Bridges.Variable submodule to bridged_model. The coefficient type used is T.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Constraint-bridges-1","page":"Reference","title":"Constraint bridges","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When constraints are added with add_constraint, constraint bridges allow to return bridged constraints that do not correspond to constraints of the underlying model. These constraints were enforced by an equivalent formulation that added constraints (and possibly also variables) in the underlying model. For instance, consider a model bridged by the Bridges.Constraint.SplitIntervalBridge:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"model = MOI.Utilities.Model{Float64}()\nbridged_model = MOI.Bridges.Constraint.SplitInterval{Float64}(model)\nx, y = MOI.add_variables(bridged_model, 2)\nfunc = MOI.Utilities.operate(+, Float64, MOI.SingleVariable(x), MOI.SingleVariable(y))\nc = MOI.add_constraint(bridged_model, func, MOI.Interval(1.0, 2.0))\n\n# output\n\nMOI.ConstraintIndex{MOI.ScalarAffineFunction{Float64},MOI.Interval{Float64}}(1)","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"We can see the constraint was bridged to two constraints, one for each bound, in the inner model.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOI.get(model, MOI.ListOfConstraints())\n\n# output\n\n2-element Array{Tuple{DataType,DataType},1}:\n (MOI.ScalarAffineFunction{Float64}, MOI.GreaterThan{Float64})\n (MOI.ScalarAffineFunction{Float64}, MOI.LessThan{Float64})","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"However, bridged_model transparently hides these constraints and creates the illusion that an interval constraint was created.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOI.get(bridged_model, MOI.ListOfConstraints())\n\n# output\n\n1-element Array{Tuple{DataType,DataType},1}:\n (MOI.ScalarAffineFunction{Float64}, MOI.Interval{Float64})","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"It is nevertheless possible to differentiate this constraint from a constraint added to the inner model by asking whether it is bridged:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"MOI.Bridges.is_bridged(bridged_model, c)\n\n# output\n\ntrue","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Constraint.AbstractBridge","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.AbstractBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.AbstractBridge","text":"AbstractBridge\n\nSubtype of MathOptInterface.Bridges.AbstractBridge for constraint bridges.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Below is the list of constraint bridges implemented in this package.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Constraint.GreaterToLessBridge\nBridges.Constraint.LessToGreaterBridge\nBridges.Constraint.NonnegToNonposBridge\nBridges.Constraint.NonposToNonnegBridge\nBridges.Constraint.VectorizeBridge\nBridges.Constraint.ScalarizeBridge\nBridges.Constraint.ScalarSlackBridge\nBridges.Constraint.VectorSlackBridge\nBridges.Constraint.ScalarFunctionizeBridge\nBridges.Constraint.VectorFunctionizeBridge\nBridges.Constraint.SplitIntervalBridge\nBridges.Constraint.RSOCBridge\nBridges.Constraint.SOCRBridge\nBridges.Constraint.QuadtoSOCBridge\nBridges.Constraint.SOCtoNonConvexQuadBridge\nBridges.Constraint.RSOCtoNonConvexQuadBridge\nBridges.Constraint.NormInfinityBridge\nBridges.Constraint.NormOneBridge\nBridges.Constraint.GeoMeantoRelEntrBridge\nBridges.Constraint.GeoMeanBridge\nBridges.Constraint.RelativeEntropyBridge\nBridges.Constraint.NormSpectralBridge\nBridges.Constraint.NormNuclearBridge\nBridges.Constraint.SquareBridge\nBridges.Constraint.RootDetBridge\nBridges.Constraint.LogDetBridge\nBridges.Constraint.SOCtoPSDBridge\nBridges.Constraint.RSOCtoPSDBridge\nBridges.Constraint.IndicatorActiveOnFalseBridge\nBridges.Constraint.IndicatorSOS1Bridge\nBridges.Constraint.SemiToBinaryBridge\nBridges.Constraint.ZeroOneBridge","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.GreaterToLessBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.GreaterToLessBridge","text":"GreaterToLessBridge{T, F<:MOI.AbstractScalarFunction, G<:MOI.AbstractScalarFunction} <:\n    FlipSignBridge{T, MOI.GreaterThan{T}, MOI.LessThan{T}, F, G}\n\nTransforms a G-in-GreaterThan{T} constraint into an F-in-LessThan{T} constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.LessToGreaterBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.LessToGreaterBridge","text":"LessToGreaterBridge{T, F<:MOI.AbstractScalarFunction, G<:MOI.AbstractScalarFunction} <:\n    FlipSignBridge{T, MOI.LessThan{T}, MOI.GreaterThan{T}, F, G}\n\nTransforms a G-in-LessThan{T} constraint into an F-in-GreaterThan{T} constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NonnegToNonposBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NonnegToNonposBridge","text":"NonnegToNonposBridge{T, F<:MOI.AbstractVectorFunction, G<:MOI.AbstractVectorFunction} <:\n    FlipSignBridge{T, MOI.Nonnegatives, MOI.Nonpositives, F, G}\n\nTransforms a G-in-Nonnegatives constraint into a F-in-Nonpositives constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NonposToNonnegBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NonposToNonnegBridge","text":"NonposToNonnegBridge{T, F<:MOI.AbstractVectorFunction, G<:MOI.AbstractVectorFunction} <:\n    FlipSignBridge{T, MOI.Nonpositives, MOI.Nonnegatives, F, G}\n\nTransforms a G-in-Nonpositives constraint into a F-in-Nonnegatives constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.VectorizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.VectorizeBridge","text":"VectorizeBridge{T, F, S, G}\n\nTransforms a constraint G-in-scalar_set_type(S, T) where S <: VectorLinearSet to F-in-S.\n\nExamples\n\nThe constraint SingleVariable-in-LessThan{Float64} becomes VectorAffineFunction{Float64}-in-Nonpositives, where T = Float64, F = VectorAffineFunction{Float64}, S = Nonpositives, and G = SingleVariable.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.ScalarizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.ScalarizeBridge","text":"ScalarizeBridge{T, F, S}\n\nTransforms a constraint AbstractVectorFunction-in-vector_set_type(S) where S <: LPCone{T} to F-in-S.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.ScalarSlackBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.ScalarSlackBridge","text":"ScalarSlackBridge{T, F, S}\n\nThe ScalarSlackBridge converts a constraint G-in-S where G is a function different from SingleVariable into the constraints F-in-EqualTo{T} and SingleVariable-in-S. F is the result of subtracting a SingleVariable from G. Typically G is the same as F, but that is not mandatory.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.VectorSlackBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.VectorSlackBridge","text":"VectorSlackBridge{T, F, S}\n\nThe VectorSlackBridge converts a constraint G-in-S where G is a function different from VectorOfVariables into the constraints Fin-Zeros and VectorOfVariables-in-S. F is the result of subtracting a VectorOfVariables from G. Tipically G is the same as F, but that is not mandatory.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.ScalarFunctionizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.ScalarFunctionizeBridge","text":"ScalarFunctionizeBridge{T, S}\n\nThe ScalarFunctionizeBridge converts a constraint SingleVariable-in-S into the constraint ScalarAffineFunction{T}-in-S.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.VectorFunctionizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.VectorFunctionizeBridge","text":"VectorFunctionizeBridge{T, S}\n\nThe VectorFunctionizeBridge converts a constraint VectorOfVariables-in-S into the constraint VectorAffineFunction{T}-in-S.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SplitIntervalBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SplitIntervalBridge","text":"SplitIntervalBridge{T, F, S, LS, US}\n\nThe SplitIntervalBridge splits a F-in-S constraint into a F-in-LS and a F-in-US constraint where we have either:\n\nS = MOI.Interval{T}, LS = MOI.GreaterThan{T} and US = MOI.LessThan{T},\nS = MOI.EqualTo{T}, LS = MOI.GreaterThan{T} and US = MOI.LessThan{T}, or\nS = MOI.Zeros, LS = MOI.Nonnegatives and US = MOI.Nonpositives.\n\nFor instance, if F is MOI.ScalarAffineFunction and S is MOI.Interval, it transforms the constraint l  a x +   u into the constraints a x +   l and a x +   u.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.RSOCBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.RSOCBridge","text":"RSOCBridge{T, F, G}\n\nThe RotatedSecondOrderCone is SecondOrderCone representable; see [1, p. 104]. Indeed, we have 2tu = (t2 + u2)^2 - (t2 - u2)^2 hence\n\n2tu ge lVert x rVert_2^2\n\nis equivalent to\n\n(t2 + u2)^2 ge lVert x rVert_2^2 + (t2 - u2)^2\n\nWe can therefore use the transformation (t u x) mapsto (t2+u2 t2-u2 x). Note that the linear transformation is a symmetric involution (i.e. it is its own transpose and its own inverse). That means in particular that the norm is of constraint primal and duals are preserved by the tranformation.\n\n[1] Ben-Tal, Aharon, and Arkadi Nemirovski. Lectures on modern convex optimization: analysis, algorithms, and engineering applications. Society for Industrial and Applied Mathematics, 2001.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SOCRBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SOCRBridge","text":"SOCRBridge{T, F, G}\n\nWe simply do the inverse transformation of RSOCBridge. In fact, as the transformation is an involution, we do the same transformation.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.QuadtoSOCBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.QuadtoSOCBridge","text":"QuadtoSOCBridge{T}\n\nThe set of points x satisfying the constraint\n\nfrac12x^T Q x + a^T x + b le 0\n\nis a convex set if Q is positive semidefinite and is the union of two convex cones if a and b are zero (i.e. homogeneous case) and Q has only one negative eigenvalue. Currently, only the non-homogeneous transformation is implemented, see the Note section below for more details.\n\nNon-homogeneous case\n\nIf Q is positive semidefinite, there exists U such that Q = U^T U, the inequality can then be rewritten as\n\nU x_2^2 le 2 (-a^T x - b)\n\nwhich is equivalent to the membership of (1, -a^T x - b, Ux) to the rotated second-order cone.\n\nHomogeneous case\n\nIf Q has only one negative eigenvalue, the set of x such that x^T Q x le 0 is the union of a convex cone and its opposite. We can choose which one to model by checking the existence of bounds on variables as shown below.\n\nSecond-order cone\n\nIf Q is diagonal and has eigenvalues (1, 1, -1), the inequality x^2 + x^2 le z^2 combined with z ge 0 defines the Lorenz cone (i.e. the second-order cone) but when combined with z le 0, it gives the opposite of the second order cone. Therefore, we need to check if the variable z has a lower bound 0 or an upper bound 0 in order to determine which cone is\n\nRotated second-order cone\n\nThe matrix Q corresponding to the inequality x^2 le 2yz has one eigenvalue 1 with eigenvectors (1, 0, 0) and (0, 1, -1) and one eigenvalue -1 corresponding to the eigenvector (0, 1, 1). Hence if we intersect this union of two convex cone with the halfspace x + y ge 0, we get the rotated second-order cone and if we intersect it with the halfspace x + y le 0 we get the opposite of the rotated second-order cone. Note that y and z have the same sign since yz is nonnegative hence x + y ge 0 is equivalent to x ge 0 and y ge 0.\n\nNote\n\nThe check for existence of bound can be implemented (but inefficiently) with the current interface but if bound is removed or transformed (e.g.  0 transformed into  0) then the bridge is no longer valid. For this reason the homogeneous version of the bridge is not implemented yet.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SOCtoNonConvexQuadBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SOCtoNonConvexQuadBridge","text":"SOCtoNonConvexQuadBridge{T}\n\nConstraints of the form VectorOfVariables-in-SecondOrderCone can be transformed into a ScalarQuadraticFunction-in-LessThan and a ScalarAffineFunction-in-GreaterThan. Indeed, the definition of the second-order cone\n\nt ge lVert x rVert_2   (1)\n\nis equivalent to\n\nsum x_i^2 le t^2  (2)\n\nwith t ge 0.  (3)\n\nWARNING This transformation starts from a convex constraint (1) and creates a non-convex constraint (2), because the Q matrix associated with the constraint 2 has one negative eigenvalue. This might be wrongly interpreted by a solver. Some solvers can look at (2) and understand that it is a second order cone, but this is not a general rule. For these reasons this bridge is not automatically added by MOI.Bridges.full_bridge_optimizer. Care is recommended when adding this bridge to a optimizer.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.RSOCtoNonConvexQuadBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.RSOCtoNonConvexQuadBridge","text":"RSOCtoNonConvexQuadBridge{T}\n\nConstraints of the form VectorOfVariables-in-SecondOrderCone can be transformed into a ScalarQuadraticFunction-in-LessThan and a ScalarAffineFunction-in-GreaterThan. Indeed, the definition of the second-order cone\n\n2tu ge lVert x rVert_2^2 tu ge 0  (1)\n\nis equivalent to\n\nsum x_i^2 le 2tu  (2)\n\nwith tu ge 0.  (3)\n\nWARNING This transformation starts from a convex constraint (1) and creates a non-convex constraint (2), because the Q matrix associated with the constraint 2 has two negative eigenvalues. This might be wrongly interpreted by a solver. Some solvers can look at (2) and understand that it is a rotated second order cone, but this is not a general rule. For these reasons, this bridge is not automatically added by MOI.Bridges.full_bridge_optimizer. Care is recommended when adding this bridge to an optimizer.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NormInfinityBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NormInfinityBridge","text":"NormInfinityBridge{T}\n\nThe NormInfinityCone is representable with LP constraints, since t ge max_i lvert x_i rvert if and only if t ge x_i and t ge -x_i for all i.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NormOneBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NormOneBridge","text":"NormOneBridge{T}\n\nThe NormOneCone is representable with LP constraints, since t ge sum_i lvert x_i rvert if and only if there exists a vector y such that t ge sum_i y_i and y_i ge x_i, y_i ge -x_i for all i.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.GeoMeantoRelEntrBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.GeoMeantoRelEntrBridge","text":"GeoMeantoRelEntrBridge{T}\n\nThe geometric mean cone is representable with a relative entropy constraint and a nonnegative auxiliary variable, since u le prod_i=1^n w_i^1n is equivalent to y ge 0 and 0 le u + y le prod_i=1^n w_i^1n, and the latter inequality is equivalent to 1 le prod_i=1^n (fracw_iu + y)^1n, which is equivalent to 0 le sum_i=1^n log (fracw_iu + y)^1n, which is equivalent to 0 ge sum_i=1^n (u + y) log (fracu + yw_i). Thus (u w) in GeometricMeanCone(1 + n) is representable as y ge 0, (0 w (u + y) e) in RelativeEntropyCone(1 + 2n), where e is a vector of ones.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.GeoMeanBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.GeoMeanBridge","text":"GeoMeanBridge{T, F, G, H}\n\nThe GeometricMeanCone is SecondOrderCone representable; see [1, p. 105]. The reformulation is best described in an example. Consider the cone of dimension 4\n\nt le sqrt3x_1 x_2 x_3\n\nThis can be rewritten as exists x_21 ge 0 such that\n\nbeginalign*\n  t  le x_21\n  x_21^4  le x_1 x_2 x_3 x_21\nendalign*\n\nNote that we need to create x_21 and not use t^4 directly as t is allowed to be negative. Now, this is equivalent to\n\nbeginalign*\n  t  le x_21sqrt4\n  x_21^2  le 2x_11 x_12\n  x_11^2  le 2x_1 x_2  x_12^2  le 2x_3(x_21sqrt4)\nendalign*\n\n[1] Ben-Tal, Aharon, and Arkadi Nemirovski. Lectures on modern convex optimization: analysis, algorithms, and engineering applications. Society for Industrial and Applied Mathematics, 2001.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.RelativeEntropyBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.RelativeEntropyBridge","text":"RelativeEntropyBridge{T}\n\nThe RelativeEntropyCone is representable with exponential cone and LP constraints, since u ge sum_i=1^n w_i log (fracw_iv_i) if and only if there exists a vector y such that u ge sum_i y_i and y_i ge w_i log (fracw_iv_i) or equivalently v_i ge w_i exp (frac-y_iw_i) or equivalently (-y_i w_i v_i) in ExponentialCone, for all i.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NormSpectralBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NormSpectralBridge","text":"NormSpectralBridge{T}\n\nThe NormSpectralCone is representable with a PSD constraint, since t ge sigma_1(X) if and only if tI X^top X tI succ 0.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.NormNuclearBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.NormNuclearBridge","text":"NormNuclearBridge{T}\n\nThe NormNuclearCone is representable with an SDP constraint and extra variables, since t ge sum_i sigma_i (X) if and only if there exists symmetric matrices U V such that U X^top X V succ 0 and t ge (tr(U) + tr(V))  2.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SquareBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SquareBridge","text":"SquareBridge{T, F<:MOI.AbstractVectorFunction,\n             G<:MOI.AbstractScalarFunction,\n             TT<:MOI.AbstractSymmetricMatrixSetTriangle,\n             ST<:MOI.AbstractSymmetricMatrixSetSquare} <: AbstractBridge\n\nThe SquareBridge reformulates the constraint of a square matrix to be in ST to a list of equality constraints for pair or off-diagonal entries with different expressions and a TT constraint the upper triangular part of the matrix.\n\nFor instance, the constraint for the matrix\n\nbeginpmatrix\n  1       1 + x  2 - 3x\n  1 +  x  2 + x  3 -  x\n  2 - 3x  2 + x      2x\nendpmatrix\n\nto be PSD can be broken down to the constraint of the symmetric matrix\n\nbeginpmatrix\n  1       1 + x  2 - 3x\n  cdot  2 + x  3 -  x\n  cdot  cdot     2x\nendpmatrix\n\nand the equality constraint between the off-diagonal entries (2, 3) and (3, 2) 2x == 1. Note that now symmetrization constraint need to be added between the off-diagonal entries (1, 2) and (2, 1) or between (1, 3) and (3, 1) since the expressions are the same.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.RootDetBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.RootDetBridge","text":"RootDetBridge{T}\n\nThe RootDetConeTriangle is representable by a PositiveSemidefiniteConeTriangle and an GeometricMeanCone constraints; see [1, p. 149]. Indeed, t le det(X)^1n if and only if there exists a lower triangular matrix  such that\n\nbeginalign*\n  beginpmatrix\n    X  \n    ^top  mathrmDiag()\n  endpmatrix  succeq 0\n  t  le (_11 _22 cdots _nn)^1n\nendalign*\n\n[1] Ben-Tal, Aharon, and Arkadi Nemirovski. Lectures on modern convex optimization: analysis, algorithms, and engineering applications. Society for Industrial and Applied Mathematics, 2001.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.LogDetBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.LogDetBridge","text":"LogDetBridge{T}\n\nThe LogDetConeTriangle is representable by a PositiveSemidefiniteConeTriangle and ExponentialCone constraints. Indeed, logdet(X) = log(delta_1) + cdots + log(delta_n) where delta_1, ..., delta_n are the eigenvalues of X. Adapting the method from [1, p. 149], we see that t le u log(det(Xu)) for u  0 if and only if there exists a lower triangular matrix  such that\n\nbeginalign*\n  beginpmatrix\n    X  \n    ^top  mathrmDiag()\n  endpmatrix  succeq 0\n  t  le u log(_11u) + u log(_22u) + cdots + u log(_nnu)\nendalign*\n\n[1] Ben-Tal, Aharon, and Arkadi Nemirovski. Lectures on modern convex optimization: analysis, algorithms, and engineering applications. Society for Industrial and Applied Mathematics, 2001. ```\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SOCtoPSDBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SOCtoPSDBridge","text":"The SOCtoPSDBridge transforms the second order cone constraint lVert x rVert le t into the semidefinite cone constraints\n\nbeginpmatrix\n  t  x^top\n  x  tI\nendpmatrix succeq 0\n\nIndeed by the Schur Complement, it is positive definite iff\n\nbeginalign*\n  tI  succ 0\n  t - x^top (tI)^-1 x  succ 0\nendalign*\n\nwhich is equivalent to\n\nbeginalign*\n  t   0\n  t^2   x^top x\nendalign*\n\nThis bridge is not added by default by MOI.Bridges.full_bridge_optimizer as bridging second order cone constraints to semidefinite constraints can be achieved by the SOCRBridge followed by the RSOCtoPSDBridge while creating a smaller semidefinite constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.RSOCtoPSDBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.RSOCtoPSDBridge","text":"The RSOCtoPSDBridge transforms the second order cone constraint lVert x rVert le 2tu with u ge 0 into the semidefinite cone constraints\n\nbeginpmatrix\n  t  x^top\n  x  2uI\nendpmatrix succeq 0\n\nIndeed by the Schur Complement, it is positive definite iff\n\nbeginalign*\n  uI  succ 0\n  t - x^top (2uI)^-1 x  succ 0\nendalign*\n\nwhich is equivalent to\n\nbeginalign*\n  u   0\n  2tu   x^top x\nendalign*\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.IndicatorActiveOnFalseBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.IndicatorActiveOnFalseBridge","text":"IndicatorActiveOnFalseBridge{T}\n\nThe IndicatorActiveOnFalseBridge replaces an indicator constraint activated on 0 with a variable z_0 with the constraint activated on 1, with a variable z_1. It stores the added variable_index and added constraints:\n\nz_1 in mathbbB in zero_one_cons\nz_0 + z_1 == 1 in `indisjunction_cons`\nThe added ACTIVATE_ON_ONE indicator constraint in indicator_cons_index.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.IndicatorSOS1Bridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.IndicatorSOS1Bridge","text":"IndicatorSOS1Bridge{T, BC <: MOI.AbstractScalarSet}\n\nThe IndicatorSOS1Bridge replaces an indicator constraint of the following form: z in mathbbB z == 1 implies f(x) leq b with a SOS1 constraint: z in mathbbB w leq 0 f(x) + w leq b SOS1(w z). GreaterThan constraints are handled in a symmetric way: z in mathbbB z == 1 implies f(x) geq b is reformulated as: z in mathbbB w geq 0 f(x) + w geq b SOS1(w z). Other scalar sets are handled without a bound constraint: z in mathbbB z == 1 implies f(x) == b is reformulated as: z in mathbbB w text free f(x) + w == b SOS1(w z).\n\nIf BC !<: Union{LessThan, GreaterThan}, bound_constraint_index is nothing.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SemiToBinaryBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SemiToBinaryBridge","text":"SemiToBinaryBridge{T, S <: MOI.AbstractScalarSet}\n\nThe SemiToBinaryBridge replaces an Semicontinuous constraint: x in mathsfSemicontinuous(l u) is replaced by: z in 0 1, x leq z cdot u, x geq z cdot l.\n\nThe SemiToBinaryBridge replaces an Semiinteger constraint: x in Semiinteger(l u) is replaced by: z in 0 1, x in mathbbZ, x leq z cdot u, x geq z cdot l.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.ZeroOneBridge","page":"Reference","title":"MathOptInterface.Bridges.Constraint.ZeroOneBridge","text":"ZeroOneBridge{T}\n\nThe ZeroOneBridge splits a MOI.SingleVariable-in-MOI.ZeroOne constraint into a MOI.SingleVariable-in-MOI.Integer constraint and a MOI.SingleVariable-in-MOI.Interval(0, 1) constraint.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"For each bridge defined in this package, a corresponding Bridges.Constraint.SingleBridgeOptimizer is available with the same name without the \"Bridge\" suffix, e.g., SplitInterval is a SingleBridgeOptimizer for the SplitIntervalBridge. Moreover, they are all added in the Bridges.LazyBridgeOptimizer returned by Bridges.full_bridge_optimizer as it calls Bridges.Constraint.add_all_bridges.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Constraint.SingleBridgeOptimizer\nBridges.Constraint.add_all_bridges","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.SingleBridgeOptimizer","page":"Reference","title":"MathOptInterface.Bridges.Constraint.SingleBridgeOptimizer","text":"SingleBridgeOptimizer{BT<:AbstractBridge, OT<:MOI.ModelLike} <: AbstractBridgeOptimizer\n\nThe SingleBridgeOptimizer bridges any constraint supported by the bridge BT. This is in contrast with the MathOptInterface.Bridges.LazyBridgeOptimizer which only bridges the constraints that are unsupported by the internal model, even if they are supported by one of its bridges.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.add_all_bridges","page":"Reference","title":"MathOptInterface.Bridges.Constraint.add_all_bridges","text":"add_all_bridges(bridged_model, ::Type{T})\n\nAdd all bridges defined in the Bridges.Constraint submodule to bridged_model. The coefficient type used is T.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Objective-bridges-1","page":"Reference","title":"Objective bridges","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When an objective is set with set, objective bridges allow to set a bridged objective to the underlying model that do not correspond to the objective set by the user. This equivalent formulation may add constraints (and possibly also variables) in the underlying model in addition to setting an objective function.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Objective.AbstractBridge","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Objective.AbstractBridge","page":"Reference","title":"MathOptInterface.Bridges.Objective.AbstractBridge","text":"AbstractBridge\n\nSubtype of MathOptInterface.Bridges.AbstractBridge for objective bridges.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Below is the list of objective bridges implemented in this package.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Objective.SlackBridge\nBridges.Objective.FunctionizeBridge","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Objective.SlackBridge","page":"Reference","title":"MathOptInterface.Bridges.Objective.SlackBridge","text":"SlackBridge{T, F, G}\n\nThe SlackBridge converts an objective function of type G into a MOI.SingleVariable objective by creating a slack variable and a F-in-MOI.LessThan constraint for minimization or F-in-MOI.LessThan constraint for maximization where F is MOI.Utilities.promote_operation(-, T, G, MOI.SingleVariable}. Note that when using this bridge, changing the optimization sense is not supported. Set the sense to MOI.FEASIBILITY_SENSE first to delete the bridge in order to change the sense, then re-add the objective.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Objective.FunctionizeBridge","page":"Reference","title":"MathOptInterface.Bridges.Objective.FunctionizeBridge","text":"FunctionizeBridge{T}\n\nThe FunctionizeBridge converts a SingleVariable objective into a ScalarAffineFunction{T} objective.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"For each bridge defined in this package, a corresponding Bridges.Objective.SingleBridgeOptimizer is available with the same name without the \"Bridge\" suffix, e.g., Slack is a SingleBridgeOptimizer for the SlackBridge. Moreover, they are all added in the Bridges.LazyBridgeOptimizer returned by Bridges.full_bridge_optimizer as it calls Bridges.Objective.add_all_bridges.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Objective.SingleBridgeOptimizer\nBridges.Objective.add_all_bridges","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Objective.SingleBridgeOptimizer","page":"Reference","title":"MathOptInterface.Bridges.Objective.SingleBridgeOptimizer","text":"SingleBridgeOptimizer{BT<:AbstractBridge, OT<:MOI.ModelLike} <: AbstractBridgeOptimizer\n\nThe SingleBridgeOptimizer bridges any objective functions supported by the bridge BT. This is in contrast with the MathOptInterface.Bridges.LazyBridgeOptimizer which only bridges the objective functions that are unsupported by the internal model, even if they are supported by one of its bridges.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Bridges.Objective.add_all_bridges","page":"Reference","title":"MathOptInterface.Bridges.Objective.add_all_bridges","text":"add_all_bridges(bridged_model, T::Type)\n\nAdd all bridges defined in the Bridges.Objective submodule to bridged_model. The coefficient type used is T.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Bridge-interface-1","page":"Reference","title":"Bridge interface","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"A bridge should implement the following functions to be usable by a bridge optimizer:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.added_constrained_variable_types\nBridges.added_constraint_types","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.added_constrained_variable_types","page":"Reference","title":"MathOptInterface.Bridges.added_constrained_variable_types","text":"added_constrained_variable_types(BT::Type{<:Variable.AbstractBridge})::Vector{Tuple{DataType}}\n\nReturn a list of the types of constrained variables that bridges of concrete type BT add. This is used by the LazyBridgeOptimizer.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.added_constraint_types","page":"Reference","title":"MathOptInterface.Bridges.added_constraint_types","text":"added_constraint_types(BT::Type{<:Constraint.AbstractBridge})::Vector{Tuple{DataType, DataType}}\n\nReturn a list of the types of constraints that bridges of concrete type BT add. This is used by the LazyBridgeOptimizer.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Additionally, variable bridges should implement:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.Variable.supports_constrained_variable\nBridges.Variable.concrete_bridge_type\nBridges.Variable.bridge_constrained_variable","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.Variable.supports_constrained_variable","page":"Reference","title":"MathOptInterface.Bridges.Variable.supports_constrained_variable","text":"supports_constrained_variable(::Type{<:AbstractBridge},\n                               ::Type{<:MOI.AbstractSet})::Bool\n\nReturn a Bool indicating whether the bridges of type BT support bridging constrained variables in S.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.Variable.concrete_bridge_type","page":"Reference","title":"MathOptInterface.Bridges.Variable.concrete_bridge_type","text":"concrete_bridge_type(BT::Type{<:AbstractBridge},\n                     S::Type{<:MOI.AbstractSet})::DataType\n\nReturn the concrete type of the bridge supporting variables in S constraints. This function can only be called if MOI.supports_constrained_variable(BT, S) is true.\n\nExamples\n\nAs a variable in MathOptInterface.GreaterThan is bridged into variables in MathOptInterface.Nonnegatives by the VectorizeBridge,\n\nBT = MOI.Bridges.Variable.VectorizeBridge{Float64}\nS = MOI.GreaterThan{Float64}\nMOI.Bridges.Variable.concrete_bridge_type(BT, S)\n\n# output\n\nMOI.Bridges.Variable.VectorizeBridge{Float64,MOI.Nonnegatives}\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.Variable.bridge_constrained_variable","page":"Reference","title":"MathOptInterface.Bridges.Variable.bridge_constrained_variable","text":"bridge_constrained_variable(BT::Type{<:AbstractBridge}, model::MOI.ModelLike,\n                            set::MOI.AbstractSet)\n\nBridge the constrained variable in set using bridge BT to model and returns a bridge object of type BT. The bridge type BT should be a concrete type, that is, all the type parameters of the bridge should be set. Use concrete_bridge_type to obtain a concrete type for given set types.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"constraint bridges should implement:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"supports_constraint(::Type{<:Bridges.Constraint.AbstractBridge}, ::Type{<:AbstractFunction}, ::Type{<:AbstractSet})\nBridges.Constraint.concrete_bridge_type\nBridges.Constraint.bridge_constraint","category":"page"},{"location":"apireference/#MathOptInterface.supports_constraint-Tuple{Type{#s1} where #s1<:MathOptInterface.Bridges.Constraint.AbstractBridge,Type{#s2} where #s2<:MathOptInterface.AbstractFunction,Type{#s3} where #s3<:MathOptInterface.AbstractSet}","page":"Reference","title":"MathOptInterface.supports_constraint","text":"MOI.supports_constraint(BT::Type{<:AbstractBridge}, F::Type{<:MOI.AbstractFunction}, S::Type{<:MOI.AbstractSet})::Bool\n\nReturn a Bool indicating whether the bridges of type BT support bridging F-in-S constraints.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.concrete_bridge_type","page":"Reference","title":"MathOptInterface.Bridges.Constraint.concrete_bridge_type","text":"concrete_bridge_type(BT::Type{<:AbstractBridge},\n                     F::Type{<:MOI.AbstractFunction},\n                     S::Type{<:MOI.AbstractSet})::DataType\n\nReturn the concrete type of the bridge supporting F-in-S constraints. This function can only be called if MOI.supports_constraint(BT, F, S) is true.\n\nExamples\n\nAs a MathOptInterface.SingleVariable-in-MathOptInterface.Interval constraint is bridged into a MathOptInterface.SingleVariable-in-MathOptInterface.GreaterThan and a MathOptInterface.SingleVariable-in-MathOptInterface.LessThan by the SplitIntervalBridge,\n\nBT = MOI.Bridges.Constraint.SplitIntervalBridge{Float64}\nF = MOI.SingleVariable\nS = MOI.Interval{Float64}\nMOI.Bridges.Constraint.concrete_bridge_type(BT, F, S)\n\n# output\n\nMOI.Bridges.Constraint.SplitIntervalBridge{Float64,MOI.SingleVariable}\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.Constraint.bridge_constraint","page":"Reference","title":"MathOptInterface.Bridges.Constraint.bridge_constraint","text":"bridge_constraint(BT::Type{<:AbstractBridge}, model::MOI.ModelLike,\n                  func::AbstractFunction, set::MOI.AbstractSet)\n\nBridge the constraint func-in-set using bridge BT to model and returns a bridge object of type BT. The bridge type BT should be a concrete type, that is, all the type parameters of the bridge should be set. Use concrete_bridge_type to obtain a concrete type for given function and set types.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"and objective bridges should implement:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Bridges.set_objective_function_type\nBridges.Objective.concrete_bridge_type\nBridges.Objective.bridge_objective","category":"page"},{"location":"apireference/#MathOptInterface.Bridges.set_objective_function_type","page":"Reference","title":"MathOptInterface.Bridges.set_objective_function_type","text":"set_objective_function_type(BT::Type{<:Objective.AbstractBridge})::Type{<:MOI.AbstractScalarFunction}\n\nReturn the type of objective function that bridges of concrete type BT set. This is used by the LazyBridgeOptimizer.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.Objective.concrete_bridge_type","page":"Reference","title":"MathOptInterface.Bridges.Objective.concrete_bridge_type","text":"concrete_bridge_type(BT::Type{<:MOI.Bridges.Objective.AbstractBridge},\n                     F::Type{<:MOI.AbstractScalarFunction})::DataType\n\nReturn the concrete type of the bridge supporting objective functions of type F. This function can only be called if MOI.supports_objective_function(BT, F) is true.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Bridges.Objective.bridge_objective","page":"Reference","title":"MathOptInterface.Bridges.Objective.bridge_objective","text":"bridge_objective(BT::Type{<:MOI.Bridges.Objective.AbstractBridge},\n                 model::MOI.ModelLike,\n                 func::MOI.AbstractScalarFunction)\n\nBridge the objective function func using bridge BT to model and returns a bridge object of type BT. The bridge type BT should be a concrete type, that is, all the type parameters of the bridge should be set. Use concrete_bridge_type to obtain a concrete type for a given function type.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When querying the NumberOfVariables, NumberOfConstraints and ListOfConstraintIndices, the variables and constraints created by the bridges in the underlying model are hidden by the bridge optimizer. For this purpose, the bridge should provide access to the variables and constraints it has creates by implemented the following methods of get:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"get(::Bridges.Constraint.AbstractBridge, ::NumberOfVariables)\nget(::Bridges.Constraint.AbstractBridge, ::ListOfVariableIndices)\nget(::Bridges.AbstractBridge, ::NumberOfConstraints)\nget(::Bridges.AbstractBridge, ::ListOfConstraintIndices)","category":"page"},{"location":"apireference/#MathOptInterface.get-Tuple{MathOptInterface.Bridges.Constraint.AbstractBridge,MathOptInterface.NumberOfVariables}","page":"Reference","title":"MathOptInterface.get","text":"MOI.get(b::AbstractBridge, ::MOI.NumberOfVariables)\n\nThe number of variables created by the bridge b in the model.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.get-Tuple{MathOptInterface.Bridges.Constraint.AbstractBridge,MathOptInterface.ListOfVariableIndices}","page":"Reference","title":"MathOptInterface.get","text":"MOI.get(b::AbstractBridge, ::MOI.NumberOfVariables)\n\nThe list of variables created by the bridge b in the model.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.get-Tuple{MathOptInterface.Bridges.AbstractBridge,MathOptInterface.NumberOfConstraints}","page":"Reference","title":"MathOptInterface.get","text":"MOI.get(b::AbstractBridge, ::MOI.NumberOfConstraints{F, S}) where {F, S}\n\nThe number of constraints of the type F-in-S created by the bridge b in the model.\n\n\n\n\n\n","category":"method"},{"location":"apireference/#MathOptInterface.get-Tuple{MathOptInterface.Bridges.AbstractBridge,MathOptInterface.ListOfConstraintIndices}","page":"Reference","title":"MathOptInterface.get","text":"MOI.get(b::AbstractBridge, ::MOI.ListOfConstraintIndices{F, S}) where {F, S}\n\nA Vector{ConstraintIndex{F,S}} with indices of all constraints of type F-inS created by the bride b in the model (i.e., of length equal to the value of NumberOfConstraints{F,S}()).\n\n\n\n\n\n","category":"method"},{"location":"apireference/#Copy-utilities-1","page":"Reference","title":"Copy utilities","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following utilities can be used to implement copy_to. See Implementing copy for more details.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.automatic_copy_to\nUtilities.default_copy_to\nUtilities.supports_default_copy_to","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.automatic_copy_to","page":"Reference","title":"MathOptInterface.Utilities.automatic_copy_to","text":"automatic_copy_to(dest::MOI.ModelLike, src::MOI.ModelLike;\n                  copy_names::Bool=true, \n                  filter_constraints::Union{Nothing, Function}=nothing)\n\nUse Utilities.supports_default_copy_to and Utilities.supports_allocate_load to automatically choose between Utilities.default_copy_to or Utilities.allocate_load to apply the copy operation.\n\nIf the filter_constraints arguments is given, only the constraints for which this function returns true will be copied. This function is given a  constraint index as argument. \n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.default_copy_to","page":"Reference","title":"MathOptInterface.Utilities.default_copy_to","text":"default_copy_to(dest::MOI.ModelLike, src::MOI.ModelLike, copy_names::Bool,\n                filter_constraints::Union{Nothing, Function}=nothing)\n\nImplements MOI.copy_to(dest, src) by adding the variables and then the constraints and attributes incrementally. The function supports_default_copy_to can be used to check whether dest supports the copying a model incrementally.\n\nIf the filter_constraints arguments is given, only the constraints for which this function returns true will be copied. This function is given a  constraint index as argument. \n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.supports_default_copy_to","page":"Reference","title":"MathOptInterface.Utilities.supports_default_copy_to","text":"supports_default_copy_to(model::ModelLike, copy_names::Bool)\n\nReturn a Bool indicating whether the model model supports default_copy_to(model, src, copy_names=copy_names) if all the attributes set to src and constraints added to src are supported by model.\n\nThis function can be used to determine whether a model can be loaded into model incrementally or whether it should be cached and copied at once instead. This is used by JuMP to determine whether to add a cache or not in two situations:\n\nA first cache can be used to store the model as entered by the user as well as the names of variables and constraints. This cache is created if this function returns false when copy_names is true.\nIf bridges are used, then a second cache can be used to store the bridged model with unnamed variables and constraints. This cache is created if this function returns false when copy_names is false.\n\nExamples\n\nIf MathOptInterface.set, MathOptInterface.add_variable and MathOptInterface.add_constraint are implemented for a model of type MyModel and names are supported, then MathOptInterface.copy_to can be implemented as\n\nMOI.Utilities.supports_default_copy_to(model::MyModel, copy_names::Bool) = true\nfunction MOI.copy_to(dest::MyModel, src::MOI.ModelLike; kws...)\n    return MOI.Utilities.automatic_copy_to(dest, src; kws...)\nend\n\nThe Utilities.automatic_copy_to function automatically redirects to Utilities.default_copy_to.\n\nIf names are not supported, simply change the first line by\n\nMOI.supports_default_copy_to(model::MyModel, copy_names::Bool) = !copy_names\n\nThe Utilities.default_copy_to function automatically throws an helpful error in case copy_to is called with copy_names equal to true.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Allocate-Load-API-1","page":"Reference","title":"Allocate-Load API","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The Allocate-Load API allows solvers that do not support loading the problem incrementally to implement copy_to in a way that still allows transformations to be applied in the copy between the cache and the model if the transformations are implemented as MOI layers implementing the Allocate-Load API, see Implementing copy for more details.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Loading a model using the Allocate-Load interface consists of two passes through the model data:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"the allocate pass where the model typically records the necessary information about the constraints and attributes such as their number and size. This information may be used by the solver to allocate datastructures of appropriate size.\nthe load pass where the model typically loads the constraint and attribute data to the model.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The description above only gives a suggestion of what to achieve in each pass. In fact the exact same constraint and attribute data is provided to each pass, so an implementation of the Allocate-Load API is free to do whatever is more convenient in each pass.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The main difference between each pass, apart from the fact that one is executed before the other during a copy, is that the allocate pass needs to create and return new variable and constraint indices, while during the load pass the appropriate constraint indices are provided.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The Allocate-Load API is not meant to be used outside a copy operation, that is, the interface is not meant to be used to create new constraints with Utilities.allocate_constraint followed by Utilities.load_constraint after a solve. This means that the order in which the different functions of the API are called is fixed by Utilities.allocate_load and models implementing the API can rely on the fact that functions will be called in this order. That is, it can be assumed that the different functions will the called in the following order:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.allocate_variables\nUtilities.allocate and Utilities.allocate_constraint\nUtilities.load_variables\nUtilities.load and Utilities.load_constraint","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.allocate_load\nUtilities.supports_allocate_load\nUtilities.allocate_variables\nUtilities.allocate\nUtilities.allocate_constraint\nUtilities.load_variables\nUtilities.load\nUtilities.load_constraint","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.allocate_load","page":"Reference","title":"MathOptInterface.Utilities.allocate_load","text":"allocate_load(dest::MOI.ModelLike, src::MOI.ModelLike, \n              filter_constraints::Union{Nothing, Function}=nothing\n              )\n\nImplements MOI.copy_to(dest, src) using the Allocate-Load API. The function supports_allocate_load can be used to check whether dest supports the Allocate-Load API.\n\nIf the filter_constraints arguments is given, only the constraints for which this function returns true will be copied. This function is given a  constraint index as argument. \n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.supports_allocate_load","page":"Reference","title":"MathOptInterface.Utilities.supports_allocate_load","text":"supports_allocate_load(model::MOI.ModelLike, copy_names::Bool)::Bool\n\nReturn a Bool indicating whether model supports allocate_load(model, src, copy_names=copy_names) if all the attributes set to src and constraints added to src are supported by model.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.allocate_variables","page":"Reference","title":"MathOptInterface.Utilities.allocate_variables","text":"allocate_variables(model::MOI.ModelLike, nvars::Integer)\n\nCreates nvars variables and returns a vector of nvars variable indices.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.allocate","page":"Reference","title":"MathOptInterface.Utilities.allocate","text":"allocate(model::ModelLike, attr::ModelLikeAttribute, value)\nallocate(model::ModelLike, attr::AbstractVariableAttribute, v::VariableIndex, value)\nallocate(model::ModelLike, attr::AbstractConstraintAttribute, c::ConstraintIndex, value)\n\nInforms model that load will be called with the same arguments after load_variables is called.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.allocate_constraint","page":"Reference","title":"MathOptInterface.Utilities.allocate_constraint","text":"allocate_constraint(model::MOI.ModelLike, f::MOI.AbstractFunction, s::MOI.AbstractSet)\n\nReturns the index for the constraint to be used in load_constraint that will be called after load_variables is called.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.load_variables","page":"Reference","title":"MathOptInterface.Utilities.load_variables","text":"load_variables(model::MOI.ModelLike, nvars::Integer)\n\nPrepares model for load and load_constraint.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.load","page":"Reference","title":"MathOptInterface.Utilities.load","text":"load(model::ModelLike, attr::ModelLikeAttribute, value)\nload(model::ModelLike, attr::AbstractVariableAttribute, v::VariableIndex, value)\nload(model::ModelLike, attr::AbstractConstraintAttribute, c::ConstraintIndex, value)\n\nThis has the same effect that set with the same arguments except that allocate should be called first before load_variables.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.load_constraint","page":"Reference","title":"MathOptInterface.Utilities.load_constraint","text":"load_constraint(model::MOI.ModelLike, ci::MOI.ConstraintIndex, f::MOI.AbstractFunction, s::MOI.AbstractSet)\n\nSets the constraint function and set for the constraint of index ci.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Caching-optimizer-1","page":"Reference","title":"Caching optimizer","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Some solvers do not support incremental definition of optimization models. Nevertheless, you are still able to build incrementally an optimization model with such solvers. MathOptInterface provides a utility, Utilities.CachingOptimizer, that will store in a ModelLike the optimization model during its incremental definition. Once the model is completely defined, the CachingOptimizer specifies all problem information to the underlying solver, all at once.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The function Utilities.state allows to query the state of the optimizer cached inside a CachingOptimizer. The state could be:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"NO_OPTIMIZER, if no optimizer is attached;\nEMPTY_OPTIMIZER, if the attached optimizer is empty;\nATTACHED_OPTIMIZER, if the attached optimizer is synchronized with the cached model defined in CachingOptimizer.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following methods modify the state of the attached optimizer:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.attach_optimizer attachs a new optimizer to a cached_optimizer with state EMPTY_OPTIMIZER. The state of cached_optimizer is set to ATTACHED_OPTIMIZER after the call.\nUtilities.drop_optimizer drops the underlying optimizer from cached_optimizer, without emptying it. The state of cached_optimizer is set to NO_OPTIMIZER after the call.\nUtilities.reset_optimizer empties optimizer inside cached_optimizer, without droping it. The state of cached_optimizer is set to EMPTY_OPTIMIZER after the call.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The way to operate a CachingOptimizer depends whether the mode is set to AUTOMATIC or to MANUAL.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"In MANUAL mode, the state of the CachingOptimizer changes only if the methods Utilities.attach_optimizer, Utilities.reset_optimizer or Utilities.drop_optimizer are being called. Any unattended operation results in an error.\nIn AUTOMATIC mode, the state of the CachingOptimizer changes when necessary. Any modification not supported by the solver (e.g. dropping a constraint) results in a drop to the state EMPTY_OPTIMIZER.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"When calling Utilities.attach_optimizer, the CachingOptimizer copies the cached model to the optimizer with copy_to. We refer to Implementing copy for more details.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.CachingOptimizer\nUtilities.attach_optimizer\nUtilities.reset_optimizer\nUtilities.drop_optimizer\nUtilities.state\nUtilities.mode","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.CachingOptimizer","page":"Reference","title":"MathOptInterface.Utilities.CachingOptimizer","text":"CachingOptimizer\n\nCachingOptimizer is an intermediate layer that stores a cache of the model and links it with an optimizer. It supports incremental model construction and modification even when the optimizer doesn't.\n\nA CachingOptimizer may be in one of three possible states (CachingOptimizerState):\n\nNO_OPTIMIZER: The CachingOptimizer does not have any optimizer.\nEMPTY_OPTIMIZER: The CachingOptimizer has an empty optimizer. The optimizer is not synchronized with the cached model.\nATTACHED_OPTIMIZER: The CachingOptimizer has an optimizer, and it is synchronized with the cached model.\n\nA CachingOptimizer has two modes of operation (CachingOptimizerMode):\n\nMANUAL: The only methods that change the state of the CachingOptimizer are Utilities.reset_optimizer, Utilities.drop_optimizer, and Utilities.attach_optimizer. Attempting to perform an operation in the incorrect state results in an error.\nAUTOMATIC: The CachingOptimizer changes its state when necessary. For example, optimize! will automatically call attach_optimizer (an optimizer must have been previously set). Attempting to add a constraint or perform a modification not supported by the optimizer results in a drop to EMPTY_OPTIMIZER mode.\n\n\n\n\n\n","category":"type"},{"location":"apireference/#MathOptInterface.Utilities.attach_optimizer","page":"Reference","title":"MathOptInterface.Utilities.attach_optimizer","text":"attach_optimizer(model::CachingOptimizer)\n\nAttaches the optimizer to model, copying all model data into it. Can be called only from the EMPTY_OPTIMIZER state. If the copy succeeds, the CachingOptimizer will be in state ATTACHED_OPTIMIZER after the call, otherwise an error is thrown; see MathOptInterface.copy_to for more details on which errors can be thrown.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.reset_optimizer","page":"Reference","title":"MathOptInterface.Utilities.reset_optimizer","text":"reset_optimizer(m::CachingOptimizer, optimizer::MOI.AbstractOptimizer)\n\nSets or resets m to have the given empty optimizer. Can be called from any state. The CachingOptimizer will be in state EMPTY_OPTIMIZER after the call.\n\n\n\n\n\nreset_optimizer(m::CachingOptimizer)\n\nDetaches and empties the current optimizer. Can be called from ATTACHED_OPTIMIZER or EMPTY_OPTIMIZER state. The CachingOptimizer will be in state EMPTY_OPTIMIZER after the call.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.drop_optimizer","page":"Reference","title":"MathOptInterface.Utilities.drop_optimizer","text":"drop_optimizer(m::CachingOptimizer)\n\nDrops the optimizer, if one is present. Can be called from any state. The CachingOptimizer will be in state NO_OPTIMIZER after the call.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.state","page":"Reference","title":"MathOptInterface.Utilities.state","text":"state(m::CachingOptimizer)::CachingOptimizerState\n\nReturns the state of the CachingOptimizer m. See Utilities.CachingOptimizer.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.mode","page":"Reference","title":"MathOptInterface.Utilities.mode","text":"mode(m::CachingOptimizer)::CachingOptimizerMode\n\nReturns the operating mode of the CachingOptimizer m. See Utilities.CachingOptimizer.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Function-utilities-1","page":"Reference","title":"Function utilities","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following utilities are available for functions:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.eval_variables\nUtilities.map_indices\nUtilities.substitute_variables\nUtilities.filter_variables\nUtilities.remove_variable\nUtilities.all_coefficients\nUtilities.unsafe_add\nUtilities.isapprox_zero\nUtilities.modify_function","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.eval_variables","page":"Reference","title":"MathOptInterface.Utilities.eval_variables","text":"eval_variables(varval::Function, f::AbstractFunction)\n\nReturns the value of function f if each variable index vi is evaluated as varval(vi). Note that varval should return a number, see substitute_variables for a similar function where varval returns a function.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.map_indices","page":"Reference","title":"MathOptInterface.Utilities.map_indices","text":"map_indices(index_map::Function, x)\n\nSubstitute any MOI.VariableIndex (resp. MOI.ConstraintIndex) in x by the MOI.VariableIndex (resp. MOI.ConstraintIndex) of the same type given by index_map(x).\n\nThis function is used by implementations of MOI.copy_to on constraint functions, attribute values and submittable values hence it needs to be implemented for custom types that are meant to be used as attribute or submittable value.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.substitute_variables","page":"Reference","title":"MathOptInterface.Utilities.substitute_variables","text":"substitute_variables(variable_map::Function, x)\n\nSubstitute any MOI.VariableIndex in x by variable_map(x). The variable_map function returns either MOI.SingleVariable or MOI.ScalarAffineFunction, see eval_variables for a similar function where variable_map returns a number.\n\nThis function is used by bridge optimizers on constraint functions, attribute values and submittable values when at least one variable bridge is used hence it needs to be implemented for custom types that are meant to be used as attribute or submittable value.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.filter_variables","page":"Reference","title":"MathOptInterface.Utilities.filter_variables","text":"filter_variables(keep::Function, f::AbstractFunction)\n\nReturn a new function f with the variable vi such that !keep(vi) removed.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.remove_variable","page":"Reference","title":"MathOptInterface.Utilities.remove_variable","text":"remove_variable(f::AbstractFunction, vi::VariableIndex)\n\nReturn a new function f with the variable vi removed.\n\n\n\n\n\nremove_variable(f::MOI.AbstractFunction, s::MOI.AbstractSet, vi::MOI.VariableIndex)\n\nReturn a tuple (g, t) representing the constraint f-in-s with the variable vi removed. That is, the terms containing the variable vi in the function f are removed and the dimension of the set s is updated if needed (e.g. when f is a VectorOfVariables with vi being one of the variables).\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.all_coefficients","page":"Reference","title":"MathOptInterface.Utilities.all_coefficients","text":"all_coefficients(p::Function, f::MOI.AbstractFunction)\n\nDetermine whether predicate p returns true for all coefficients of f, returning false as soon as the first coefficient of f for which p returns false is encountered (short-circuiting). Similar to all.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.unsafe_add","page":"Reference","title":"MathOptInterface.Utilities.unsafe_add","text":"unsafe_add(t1::MOI.ScalarAffineTerm, t2::MOI.ScalarAffineTerm)\n\nSums the coefficients of t1 and t2 and returns an output MOI.ScalarAffineTerm. It is unsafe because it uses the variable_index of t1 as the variable_index of the output without checking that it is equal to that of t2.\n\n\n\n\n\nunsafe_add(t1::MOI.ScalarQuadraticTerm, t2::MOI.ScalarQuadraticTerm)\n\nSums the coefficients of t1 and t2 and returns an output MOI.ScalarQuadraticTerm. It is unsafe because it uses the variable_index's of t1 as the variable_index's of the output without checking that they are the same (up to permutation) to those of t2.\n\n\n\n\n\nunsafe_add(t1::MOI.VectorAffineTerm, t2::MOI.VectorAffineTerm)\n\nSums the coefficients of t1 and t2 and returns an output MOI.VectorAffineTerm. It is unsafe because it uses the output_index and variable_index of t1 as the output_index and variable_index of the output term without checking that they are equal to those of t2.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.isapprox_zero","page":"Reference","title":"MathOptInterface.Utilities.isapprox_zero","text":"isapprox_zero(f::MOI.AbstractFunction, tol)\n\nReturn a Bool indicating whether the function f is approximately zero using tol as a tolerance.\n\nImportant note\n\nThis function assumes that f does not contain any duplicate terms, you might want to first call canonical if that is not guaranteed. For instance, given\n\nf = MOI.ScalarAffineFunction(MOI.ScalarAffineTerm.([1, -1], [x, x]), 0)`.\n\nthen isapprox_zero(f) is false but isapprox_zero(MOIU.canonical(f)) is true.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.modify_function","page":"Reference","title":"MathOptInterface.Utilities.modify_function","text":"modify_function(f::AbstractFunction, change::AbstractFunctionModification)\n\nReturn a new function f modified according to change.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following functions can be used to canonicalize a function:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.is_canonical\nUtilities.canonical\nUtilities.canonicalize!","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.is_canonical","page":"Reference","title":"MathOptInterface.Utilities.is_canonical","text":"is_canonical(f::Union{ScalarAffineFunction, VectorAffineFunction})\n\nReturns a Bool indicating whether the function is in canonical form. See canonical.\n\n\n\n\n\nis_canonical(f::Union{ScalarQuadraticFunction, VectorQuadraticFunction})\n\nReturns a Bool indicating whether the function is in canonical form. See canonical.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.canonical","page":"Reference","title":"MathOptInterface.Utilities.canonical","text":"canonical(f::Union{ScalarAffineFunction, VectorAffineFunction,\n                   ScalarQuadraticFunction, VectorQuadraticFunction})\n\nReturns the function in a canonical form, i.e.\n\nA term appear only once.\nThe coefficients are nonzero.\nThe terms appear in increasing order of variable where there the order of the variables is the order of their value.\nFor a AbstractVectorFunction, the terms are sorted in ascending order of output index.\n\nThe output of canonical can be assumed to be a copy of f, even for VectorOfVariables.\n\nExamples\n\nIf x (resp. y, z) is VariableIndex(1) (resp. 2, 3). The canonical representation of ScalarAffineFunction([y, x, z, x, z], [2, 1, 3, -2, -3], 5) is ScalarAffineFunction([x, y], [-1, 2], 5).\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.canonicalize!","page":"Reference","title":"MathOptInterface.Utilities.canonicalize!","text":"canonicalize!(f::Union{ScalarAffineFunction, VectorAffineFunction})\n\nConvert a function to canonical form in-place, without allocating a copy to hold the result. See canonical.\n\n\n\n\n\ncanonicalize!(f::Union{ScalarQuadraticFunction, VectorQuadraticFunction})\n\nConvert a function to canonical form in-place, without allocating a copy to hold the result. See canonical.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following functions can be used to manipulate functions with basic algebra:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.scalar_type\nUtilities.promote_operation\nUtilities.operate\nUtilities.operate!\nUtilities.operate_output_index!\nUtilities.vectorize","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.scalar_type","page":"Reference","title":"MathOptInterface.Utilities.scalar_type","text":"scalar_type(F::Type{<:MOI.AbstractVectorFunction})\n\nType of functions obtained by indexing objects obtained by calling eachscalar on functions of type F.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.promote_operation","page":"Reference","title":"MathOptInterface.Utilities.promote_operation","text":"promote_operation(op::Function, ::Type{T},\n                  ArgsTypes::Type{<:Union{T, MOI.AbstractFunction}}...) where T\n\nReturns the type of the MOI.AbstractFunction returned to the call operate(op, T, args...) where the types of the arguments args are ArgsTypes.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.operate","page":"Reference","title":"MathOptInterface.Utilities.operate","text":"operate(op::Function, ::Type{T},\n        args::Union{T, MOI.AbstractFunction}...)::MOI.AbstractFunction where T\n\nReturns an MOI.AbstractFunction representing the function resulting from the operation op(args...) on functions of coefficient type T. No argument can be modified.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.operate!","page":"Reference","title":"MathOptInterface.Utilities.operate!","text":"operate!(op::Function, ::Type{T},\n         args::Union{T, MOI.AbstractFunction}...)::MOI.AbstractFunction where T\n\nReturns an MOI.AbstractFunction representing the function resulting from the operation op(args...) on functions of coefficient type T. The first argument can be modified. The return type is the same than the method operate(op, T, args...) without !.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.operate_output_index!","page":"Reference","title":"MathOptInterface.Utilities.operate_output_index!","text":"operate_output_index!(\n    op::Function, ::Type{T}, output_index::Integer,\n    func::MOI.AbstractVectorFunction\n    args::Union{T, MOI.AbstractScalarFunction}...)::MOI.AbstractFunction where T\n\nReturns an MOI.AbstractVectorFunction where the function at output_index is the result of the operation op applied to the function at output_index of func and args. The functions at output index different to output_index are the same as the functions at the same output index in func. The first argument can be modified.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.vectorize","page":"Reference","title":"MathOptInterface.Utilities.vectorize","text":"vectorize(funcs::AbstractVector{MOI.SingleVariable})\n\nReturns the vector of scalar affine functions in the form of a MOI.VectorAffineFunction{T}.\n\n\n\n\n\nvectorize(funcs::AbstractVector{MOI.ScalarAffineFunction{T}}) where T\n\nReturns the vector of scalar affine functions in the form of a MOI.VectorAffineFunction{T}.\n\n\n\n\n\nvectorize(funcs::AbstractVector{MOI.ScalarQuadraticFunction{T}}) where T\n\nReturns the vector of scalar quadratic functions in the form of a MOI.VectorQuadraticFunction{T}.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Constraint-utilities-1","page":"Reference","title":"Constraint utilities","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following utilities are available for moving the function constant to the set for scalar constraints:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.shift_constant\nUtilities.normalize_and_add_constraint\nUtilities.normalize_constant","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.shift_constant","page":"Reference","title":"MathOptInterface.Utilities.shift_constant","text":"shift_constant(set::MOI.AbstractScalarSet,\n               offset)\n\nReturns a new scalar set new_set such that func-in-set is equivalent to func + offset-in-new_set.\n\nExamples\n\nThe call shift_constant(MOI.Interval(-2, 3), 1) is equal to MOI.Interval(-1, 4).\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.normalize_and_add_constraint","page":"Reference","title":"MathOptInterface.Utilities.normalize_and_add_constraint","text":"normalize_and_add_constraint(model::MOI.ModelLike,\n                             func::MOI.AbstractScalarFunction,\n                             set::MOI.AbstractScalarSet;\n                             allow_modify_function::Bool=false)\n\nAdds the scalar constraint obtained by moving the constant term in func to the set in model. If allow_modify_function is true then the function func can be modified.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.normalize_constant","page":"Reference","title":"MathOptInterface.Utilities.normalize_constant","text":"normalize_constant(func::MOI.AbstractScalarFunction,\n                   set::MOI.AbstractScalarSet;\n                   allow_modify_function::Bool=false)\n\nReturn the func-in-set constraint in normalized form. That is, if func is MOI.ScalarQuadraticFunction or MOI.ScalarAffineFunction, the constant is moved to the set. If allow_modify_function is true then the function func can be modified.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following utility identifies those constraints imposing bounds on a given variable, and returns those bound values:","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.get_bounds","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.get_bounds","page":"Reference","title":"MathOptInterface.Utilities.get_bounds","text":"get_bounds(model::MOI.ModelLike, ::Type{T}, x::MOI.VariableIndex)\n\nReturn a tuple (lb, ub) of type Tuple{T, T}, where lb and ub are lower  and upper bounds, respectively, imposed on x in model.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"The following utilities are useful when working with symmetric matrix cones.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Utilities.is_diagonal_vectorized_index\nUtilities.side_dimension_for_vectorized_dimension","category":"page"},{"location":"apireference/#MathOptInterface.Utilities.is_diagonal_vectorized_index","page":"Reference","title":"MathOptInterface.Utilities.is_diagonal_vectorized_index","text":"is_diagonal_vectorized_index(index::Base.Integer)\n\nReturn whether index is the index of a diagonal element in a MOI.AbstractSymmetricMatrixSetTriangle set.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Utilities.side_dimension_for_vectorized_dimension","page":"Reference","title":"MathOptInterface.Utilities.side_dimension_for_vectorized_dimension","text":"side_dimension_for_vectorized_dimension(n::Integer)\n\nReturn the dimension d such that MOI.dimension(MOI.PositiveSemidefiniteConeTriangle(d)) is n.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#Benchmarks-1","page":"Reference","title":"Benchmarks","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions to help benchmark the performance of solver wrappers. See Benchmarking for more details.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Benchmarks.suite\nBenchmarks.create_baseline\nBenchmarks.compare_against_baseline","category":"page"},{"location":"apireference/#MathOptInterface.Benchmarks.suite","page":"Reference","title":"MathOptInterface.Benchmarks.suite","text":"suite(\n    new_model::Function;\n    exclude::Vector{Regex} = Regex[]\n)\n\nCreate a suite of benchmarks. new_model should be a function that takes no arguments, and returns a new instance of the optimizer you wish to benchmark.\n\nUse exclude to exclude a subset of benchmarks.\n\nExamples\n\nsuite() do\n    GLPK.Optimizer()\nend\nsuite(exclude = [r\"delete\"]) do\n    Gurobi.Optimizer(OutputFlag=0)\nend\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Benchmarks.create_baseline","page":"Reference","title":"MathOptInterface.Benchmarks.create_baseline","text":"create_baseline(suite, name::String; directory::String = \"\"; kwargs...)\n\nRun all benchmarks in suite and save to files called name in directory.\n\nExtra kwargs are based to BenchmarkTools.run.\n\nExamples\n\nmy_suite = suite(() -> GLPK.Optimizer())\ncreate_baseline(my_suite, \"glpk_master\"; directory = \"/tmp\", verbose = true)\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.Benchmarks.compare_against_baseline","page":"Reference","title":"MathOptInterface.Benchmarks.compare_against_baseline","text":"compare_against_baseline(\n    suite, name::String; directory::String = \"\",\n    report_filename::String = \"report.txt\"\n)\n\nRun all benchmarks in suite and compare against files called name in directory that were created by a call to create_baseline.\n\nA report summarizing the comparison is written to report_filename in directory.\n\nExtra kwargs are based to BenchmarkTools.run.\n\nExamples\n\nmy_suite = suite(() -> GLPK.Optimizer())\ncompare_against_baseline(\n    my_suite, \"glpk_master\"; directory = \"/tmp\", verbose = true\n)\n\n\n\n\n\n","category":"function"},{"location":"apireference/#File-Formats-1","page":"Reference","title":"File Formats","text":"","category":"section"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"Functions to help read and write MOI models to/from various file formats. See File Formats for more details.","category":"page"},{"location":"apireference/#","page":"Reference","title":"Reference","text":"FileFormats.Model\nFileFormats.FileFormat","category":"page"},{"location":"apireference/#MathOptInterface.FileFormats.Model","page":"Reference","title":"MathOptInterface.FileFormats.Model","text":"Model(\n    ;\n    format::FileFormat = FORMAT_AUTOMATIC,\n    filename::Union{Nothing, String} = nothing,\n    kwargs...\n)\n\nReturn model corresponding to the FileFormat format, or, if format == FORMAT_AUTOMATIC, guess the format from filename.\n\nThe filename argument is only needed if format == FORMAT_AUTOMATIC.\n\nkwargs are passed to the underlying model constructor.\n\n\n\n\n\n","category":"function"},{"location":"apireference/#MathOptInterface.FileFormats.FileFormat","page":"Reference","title":"MathOptInterface.FileFormats.FileFormat","text":"FileFormat\n\nList of accepted export formats.\n\nFORMAT_AUTOMATIC: try to detect the file format based on the file name\nFORMAT_CBF: the Conic Benchmark format\nFORMAT_LP: the LP file format\nFORMAT_MOF: the MathOptFormat file format\nFORMAT_MPS: the MPS file format\nFORMAT_SDPA: the SemiDefinite Programming Algorithm format\n\n\n\n\n\n","category":"type"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"CurrentModule = MathOptInterface\nDocTestSetup = quote\n    using MathOptInterface\n    const MOI = MathOptInterface\nend\nDocTestFilters = [r\"MathOptInterface|MOI\"]","category":"page"},{"location":"apimanual/#Manual-1","page":"Manual","title":"Manual","text":"","category":"section"},{"location":"apimanual/#Purpose-1","page":"Manual","title":"Purpose","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Each mathematical optimization solver API has its own concepts and data structures for representing optimization models and obtaining results. However, it is often desirable to represent an instance of an optimization problem at a higher level so that it is easy to try using different solvers. MathOptInterface (MOI) is an abstraction layer designed to provide a unified interface to mathematical optimization solvers so that users do not need to understand multiple solver-specific APIs. MOI can be used directly, or through a higher-level modeling interface like JuMP.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI has been designed to replace MathProgBase, which has been used by modeling packages such as JuMP and Convex.jl. This second-generation abstraction layer addresses a number of limitations of MathProgBase. MOI is designed to:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Be simple and extensible, unifying linear, quadratic, and conic optimization, and seamlessly facilitate extensions to essentially arbitrary constraints and functions (e.g., indicator constraints, complementarity constraints, and piecewise linear functions)\nBe fast by allowing access to a solver's in-memory representation of a problem without writing intermediate files (when possible) and by using multiple dispatch and avoiding requiring containers of nonconcrete types\nAllow a solver to return multiple results (e.g., a pool of solutions)\nAllow a solver to return extra arbitrary information via attributes (e.g., variable- and constraint-wise membership in an irreducible inconsistent subset for infeasibility analysis)\nProvide a greatly expanded set of status codes explaining what happened during the optimization procedure\nEnable a solver to more precisely specify which problem classes it supports\nEnable both primal and dual warm starts\nEnable adding and removing both variables and constraints by indices that are not required to be consecutive\nEnable any modification that the solver supports to an existing model\nAvoid requiring the solver wrapper to store an additional copy of the problem data","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"This manual introduces the concepts needed to understand MOI and give a high-level picture of how all of the pieces fit together. The primary focus is on MOI from the perspective of a user of the interface. At the end of the manual we have a section on Implementing a solver interface. The API Reference page lists the complete API.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI does not export functions, but for brevity we often omit qualifying names with the MOI module. Best practice is to have","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"using MathOptInterface\nconst MOI = MathOptInterface","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"and prefix all MOI methods with MOI. in user code. If a name is also available in base Julia, we always explicitly use the module prefix, for example, with MOI.get.","category":"page"},{"location":"apimanual/#Standard-form-problem-1","page":"Manual","title":"Standard form problem","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The standard form problem is:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n     min_x in mathbbR^n  f_0(x)\n    \n     textst  f_i(x)  in mathcalS_i  i = 1 ldots m\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"where:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"the functions f_0 f_1 ldots f_m are specified by AbstractFunction objects\nthe sets mathcalS_1 ldots mathcalS_m are specified by AbstractSet objects","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The current function types are:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"SingleVariable: x_j, i.e., projection onto a single coordinate defined by a variable index j\nVectorOfVariables: projection onto multiple coordinates (i.e., extracting a subvector)\nScalarAffineFunction: a^T x + b, where a is a vector and b scalar\nVectorAffineFunction: A x + b, where A is a matrix and b is a vector\nScalarQuadraticFunction: frac12 x^T Q x + a^T x + b, where Q is a symmetric matrix, a is a vector, and b is a constant\nVectorQuadraticFunction: a vector of scalar-valued quadratic functions","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Extensions for nonlinear programming are present but not yet well documented.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI defines some commonly used sets, but the interface is extensible to other sets recognized by the solver.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"LessThan(upper):  x in mathbbR  x le mboxupper \nGreaterThan(lower):  x in mathbbR  x ge mboxlower \nEqualTo(value):  x in mathbbR  x = mboxvalue \nInterval(lower, upper):  x in mathbbR  x in mboxlowermboxupper \nReals(dimension): mathbbR^mboxdimension\nZeros(dimension): 0^mboxdimension\nNonnegatives(dimension):  x in mathbbR^mboxdimension  x ge 0 \nNonpositives(dimension):  x in mathbbR^mboxdimension  x le 0 \nNormInfinityCone(dimension):  (tx) in mathbbR^mboxdimension  t ge lVert x rVert_infty = max_i lvert x_i rvert \nNormOneCone(dimension):  (tx) in mathbbR^mboxdimension  t ge lVert x rVert_1 = sum_i lvert x_i rvert \nSecondOrderCone(dimension):  (tx) in mathbbR^mboxdimension  t ge lVert x rVert_2 \nRotatedSecondOrderCone(dimension):  (tux) in mathbbR^mboxdimension  2tu ge lVert x rVert_2^2 tu ge 0 \nGeometricMeanCone(dimension):  (tx) in mathbbR^n+1  x ge 0 t le sqrtnx_1 x_2 cdots x_n  where n is dimension - 1\nExponentialCone():  (xyz) in mathbbR^3  y exp (xy) le z y  0 \nDualExponentialCone():  (uvw) in mathbbR^3  -u exp (vu) le exp(1) w u  0 \nPowerCone(exponent):  (xyz) in mathbbR^3  x^mboxexponent y^1-mboxexponent ge z xy ge 0 \nDualPowerCone(exponent):  (uvw) in mathbbR^3  fracumboxexponent^mboxexponent fracv1-mboxexponent^1-mboxexponent ge w uv ge 0 \nRelativeEntropyCone(dimension):  (u v w) in mathbbR^mboxdimension  u ge sum_i w_i log (fracw_iv_i) v_i ge 0 w_i ge 0 \nNormSpectralCone(row_dim, column_dim):  (t X) in mathbbR^1 + mboxrow_dim times mboxcolumn_dim  t ge sigma_1(X) X mboxis a matrix with row_dim rows and column_dim columns \nNormNuclearCone(row_dim, column_dim):  (t X) in mathbbR^1 + mboxrow_dim times mboxcolumn_dim  t ge sum_i sigma_i(X) X mboxis a matrix with row_dim rows and column_dim columns \nPositiveSemidefiniteConeTriangle(dimension):  X in mathbbR^mboxdimension(mboxdimension+1)2  X mboxis the upper triangle of a PSD matrix \nPositiveSemidefiniteConeSquare(dimension):  X in mathbbR^mboxdimension^2  X mboxis a PSD matrix \nLogDetConeTriangle(dimension):  (tuX) in mathbbR^2+mboxdimension(1+mboxdimension)2  t le ulog(det(Xu)) X mboxis the upper triangle of a PSD matrix u  0 \nLogDetConeSquare(dimension):  (tuX) in mathbbR^2+mboxdimension^2  t le u log(det(Xu)) X mboxis a PSD matrix u  0 \nRootDetConeTriangle(dimension):  (tX) in mathbbR^1+mboxdimension(1+mboxdimension)2  t le det(X)^1mboxdimension X mboxis the upper triangle of a PSD matrix \nRootDetConeSquare(dimension):  (tX) in mathbbR^1+mboxdimension^2  t le det(X)^1mboxdimension X mboxis a PSD matrix \nInteger(): mathbbZ\nZeroOne():  0 1 \nSemicontinuous(lower,upper):  0 cup lowerupper\nSemiinteger(lower,upper):  0 cup lowerlower+1ldotsupper-1upper","category":"page"},{"location":"apimanual/#The-ModelLike-and-AbstractOptimizer-APIs-1","page":"Manual","title":"The ModelLike and AbstractOptimizer APIs","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The most significant part of MOI is the definition of the model API that is used to specify an instance of an optimization problem (e.g., by adding variables and constraints). Objects that implement the model API should inherit from the ModelLike abstract type.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Notably missing from the model API is the method to solve an optimization problem. ModelLike objects may store an instance (e.g., in memory or backed by a file format) without being linked to a particular solver. In addition to the model API, MOI defines AbstractOptimizer. Optimizers (or solvers) implement the model API (inheriting from ModelLike) and additionally provide methods to solve the model.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Through the rest of the manual, model is used as a generic ModelLike, and optimizer is used as a generic AbstractOptimizer.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Models are constructed by","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"adding variables using add_variable (or add_variables), see Adding variables;\nsetting an objective sense and function using set, see Setting an objective;\nand adding constraints using add_constraint (or add_constraints), see Sets and Constraints.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The way the problem is solved by the optimimizer is controlled by AbstractOptimizerAttributes, see Solver-specific attributes.","category":"page"},{"location":"apimanual/#Adding-variables-1","page":"Manual","title":"Adding variables","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"All variables in MOI are scalar variables. New scalar variables are created with add_variable or add_variables, which return a VariableIndex or Vector{VariableIndex} respectively. VariableIndex objects are type-safe wrappers around integers that refer to a variable in a particular model.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"One uses VariableIndex objects to set and get variable attributes. For example, the VariablePrimalStart attribute is used to provide an initial starting point for a variable or collection of variables:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"v = add_variable(model)\nset(model, VariablePrimalStart(), v, 10.5)\nv2 = add_variables(model, 3)\nset(model, VariablePrimalStart(), v2, [1.3,6.8,-4.6])","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A variable can be deleted from a model with delete(::ModelLike, ::VariableIndex). Not all models support deleting variables; an DeleteNotAllowed error is thrown if this is not supported.","category":"page"},{"location":"apimanual/#Functions-1","page":"Manual","title":"Functions","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI defines six functions as listed in the definition of the Standard form problem. The simplest function is SingleVariable defined as:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"struct SingleVariable <: AbstractFunction\n    variable::VariableIndex\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If v is a VariableIndex object, then SingleVariable(v) is simply the scalar-valued function from the complete set of variables in a model that returns the value of variable v. One may also call this function a coordinate projection, which is more useful for defining constraints than as an objective function.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A more interesting function is ScalarAffineFunction, defined as","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"struct ScalarAffineFunction{T} <: AbstractScalarFunction\n    terms::Vector{ScalarAffineTerm{T}}\n    constant::T\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The ScalarAffineTerm struct defines a variable-coefficient pair:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"struct ScalarAffineTerm{T}\n    coefficient::T\n    variable_index::VariableIndex\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If x is a vector of VariableIndex objects, then ScalarAffineFunction(ScalarAffineTerm.([5.0,-2.3],[x[1],x[2]]),1.0) represents the function 5x_1 - 23x_2 + 1.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"note: Note\nScalarAffineTerm.([5.0,-2.3],[x[1],x[2]]) is a shortcut for [ScalarAffineTerm(5.0, x[1]), ScalarAffineTerm(-2.3, x[2])]. This is Julia's broadcast syntax and is used quite often.","category":"page"},{"location":"apimanual/#Setting-an-objective-1","page":"Manual","title":"Setting an objective","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Objective functions are assigned to a model by setting the ObjectiveFunction attribute. The ObjectiveSense attribute is used for setting the optimization sense. For example,","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x = add_variables(model, 2)\nset(model, ObjectiveFunction{ScalarAffineFunction{Float64}}(),\n            ScalarAffineFunction(ScalarAffineTerm.([5.0,-2.3],[x[1],x[2]]),1.0))\nset(model, ObjectiveSense(), MIN_SENSE)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"sets the objective to the function just discussed in the minimization sense.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"See Functions and function modifications for the complete list of functions.","category":"page"},{"location":"apimanual/#Sets-and-Constraints-1","page":"Manual","title":"Sets and Constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"All constraints are specified with add_constraint by restricting the output of some function to a set. The interface allows an arbitrary combination of functions and sets, but of course solvers may decide to support only a small number of combinations.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, linear programming solvers should support, at least, combinations of affine functions with the LessThan and GreaterThan sets. These are simply linear constraints. SingleVariable functions combined with these same sets are used to specify upper and lower bounds on variables.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The code example below encodes the linear optimization problem:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_x in mathbbR^2  3x_1 + 2x_2 \n\n textst  x_1 + x_2 le 5\n\n x_1  ge 0\n\nx_2  ge -1\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x = add_variables(model, 2)\nset(model, ObjectiveFunction{ScalarAffineFunction{Float64}}(),\n            ScalarAffineFunction(ScalarAffineTerm.([3.0, 2.0], x), 0.0))\nset(model, ObjectiveSense(), MAX_SENSE)\nadd_constraint(model, ScalarAffineFunction(ScalarAffineTerm.(1.0, x), 0.0),\n                      LessThan(5.0))\nadd_constraint(model, SingleVariable(x[1]), GreaterThan(0.0))\nadd_constraint(model, SingleVariable(x[2]), GreaterThan(-1.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Besides scalar-valued functions in scalar-valued sets, it's also possible to use vector-valued functions and sets.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The code example below encodes the convex optimization problem:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_xyz in mathbbR  y + z \n\n textst  3x = 2\n\n x  ge lVert (yz) rVert_2\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x,y,z = add_variables(model, 3)\nset(model, ObjectiveFunction{ScalarAffineFunction{Float64}}(),\n            ScalarAffineFunction(ScalarAffineTerm.(1.0, [y,z]), 0.0))\nset(model, ObjectiveSense(), MAX_SENSE)\nvector_terms = [VectorAffineTerm(1, ScalarAffineTerm(3.0, x))]\nadd_constraint(model, VectorAffineFunction(vector_terms,[-2.0]), Zeros(1))\nadd_constraint(model, VectorOfVariables([x,y,z]), SecondOrderCone(3))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"[Describe ConstraintIndex objects.]","category":"page"},{"location":"apimanual/#Constraints-by-function-set-pairs-1","page":"Manual","title":"Constraints by function-set pairs","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Below is a list of common constraint types and how they are represented as function-set pairs in MOI. In the notation below, x is a vector of decision variables, x_i is a scalar decision variable, alpha beta are scalar constants, a b are constant vectors, A is a constant matrix and mathbbR_+ (resp. mathbbR_-) is the set of nonnegative (resp. nonpositive) real numbers.","category":"page"},{"location":"apimanual/#Linear-constraints-1","page":"Manual","title":"Linear constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Mathematical Constraint MOI Function MOI Set\na^Tx le beta ScalarAffineFunction LessThan\na^Tx ge alpha ScalarAffineFunction GreaterThan\na^Tx = beta ScalarAffineFunction EqualTo\nalpha le a^Tx le beta ScalarAffineFunction Interval\nx_i le beta SingleVariable LessThan\nx_i ge alpha SingleVariable GreaterThan\nx_i = beta SingleVariable EqualTo\nalpha le x_i le beta SingleVariable Interval\nAx + b in mathbbR_+^n VectorAffineFunction Nonnegatives\nAx + b in mathbbR_-^n VectorAffineFunction Nonpositives\nAx + b = 0 VectorAffineFunction Zeros","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"By convention, solvers are not expected to support nonzero constant terms in the ScalarAffineFunctions the first four rows above, because they are redundant with the parameters of the sets. For example, 2x + 1 le 2 should be encoded as 2x le 1.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Constraints with SingleVariable in LessThan, GreaterThan, EqualTo, or Interval sets have a natural interpretation as variable bounds. As such, it is typically not natural to impose multiple lower or upper bounds on the same variable, and the solver interfaces should throw respectively LowerBoundAlreadySet or UpperBoundAlreadySet. Moreover, adding two SingleVariable constraints on the same variable with the same set is impossible because they share the same index as it is the index of the variable, see ConstraintIndex. It is natural, however, to impose upper and lower bounds separately as two different constraints on a single variable. The difference between imposing bounds by using a single Interval constraint and by using separate LessThan and GreaterThan constraints is that the latter will allow the solver to return separate dual multipliers for the two bounds, while the former will allow the solver to return only a single dual for the interval constraint.","category":"page"},{"location":"apimanual/#Conic-constraints-1","page":"Manual","title":"Conic constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Mathematical Constraint MOI Function MOI Set\nlVert Ax + brVert_2 le c^Tx + d VectorAffineFunction SecondOrderCone\ny ge lVert x rVert_2 VectorOfVariables SecondOrderCone\n2yz ge lVert x rVert_2^2 yz ge 0 VectorOfVariables RotatedSecondOrderCone\n(a_1^Tx + b_1a_2^Tx + b_2a_3^Tx + b_3) in mathcalE VectorAffineFunction ExponentialCone\nA(x) in mathcalS_+ VectorAffineFunction PositiveSemidefiniteConeTriangle\nB(x) in mathcalS_+ VectorAffineFunction PositiveSemidefiniteConeSquare\nx in mathcalS_+ VectorOfVariables PositiveSemidefiniteConeTriangle\nx in mathcalS_+ VectorOfVariables PositiveSemidefiniteConeSquare","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"where mathcalE is the exponential cone (see ExponentialCone), mathcalS_+ is the set of positive semidefinite symmetric matrices, A is an affine map that outputs symmetric matrices and B is an affine map that outputs square matrices.","category":"page"},{"location":"apimanual/#Quadratic-constraints-1","page":"Manual","title":"Quadratic constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Mathematical Constraint MOI Function MOI Set\nx^TQx + a^Tx + b ge 0 ScalarQuadraticFunction GreaterThan\nx^TQx + a^Tx + b le 0 ScalarQuadraticFunction LessThan\nx^TQx + a^Tx + b = 0 ScalarQuadraticFunction EqualTo\nBilinear matrix inequality VectorQuadraticFunction PositiveSemidefiniteCone...","category":"page"},{"location":"apimanual/#Discrete-and-logical-constraints-1","page":"Manual","title":"Discrete and logical constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Mathematical Constraint MOI Function MOI Set\nx_i in mathbbZ SingleVariable Integer\nx_i in 01 SingleVariable ZeroOne\nx_i in 0 cup lu SingleVariable Semicontinuous\nx_i in 0 cup ll+1ldotsu-1u SingleVariable Semiinteger\nAt most one component of x can be nonzero VectorOfVariables SOS1\nAt most two components of x can be nonzero, and if so they must be adjacent components VectorOfVariables SOS2\ny = 1 implies a^T x in S VectorAffineFunction IndicatorSet","category":"page"},{"location":"apimanual/#Solving-and-retrieving-the-results-1","page":"Manual","title":"Solving and retrieving the results","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Once an optimizer is loaded with the objective function and all of the constraints, we can ask the solver to solve the model by calling optimize!.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"optimize!(optimizer)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The optimization procedure may terminate for a number of reasons. The TerminationStatus attribute of the optimizer returns a TerminationStatusCode object which explains why the solver stopped. The termination statuses distinguish between proofs of optimality, infeasibility, local convergence, limits, and termination because of something unexpected like invalid problem data or failure to converge. A typical usage of the TerminationStatus attribute is as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"status = MOI.get(optimizer, TerminationStatus())\nif status == MOI.OPTIMAL\n    # Ok, we solved the problem!\nelse\n    # Handle other cases.\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"After checking the TerminationStatus, one should typically check ResultCount. This attribute returns the number of results that the solver has available to return. A result is defined as a primal-dual pair, but either the primal or the dual may be missing from the result. While the OPTIMAL termination status normally implies that at least one result is available, other statuses do not. For example, in the case of infeasiblity, a solver may return no result or a proof of infeasibility. The ResultCount distinguishes between these two cases.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The PrimalStatus and DualStatus attributes return a ResultStatusCode that indicates if that component of the result is present (i.e., not NO_SOLUTION) and explains how to interpret the result.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If PrimalStatus is not NO_SOLUTION, then the primal may be retrieved with the VariablePrimal attribute:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.get(optimizer, VariablePrimal(), x)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If x is a VariableIndex then the function call returns a scalar, and if x is a Vector{VariableIndex} then the call returns a vector of scalars. VariablePrimal() is equivalent to VariablePrimal(1), i.e., the variable primal vector of the first result. Use VariablePrimal(N) to access the Nth result.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"See also the attributes ConstraintPrimal, and ConstraintDual. See Duals for a discussion of the MOI conventions for primal-dual pairs and certificates.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"note: Note\nWe omit discussion of how to handle multiple results, i.e., when ResultCount is greater than 1. This is supported in the API but not yet implemented in any solver.","category":"page"},{"location":"apimanual/#Common-status-situations-1","page":"Manual","title":"Common status situations","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The sections below describe how to interpret typical or interesting status cases for three common classes of solvers. The example cases are illustrative, not comprehensive. Solver wrappers may provide additional information on how the solver's statuses map to MOI statuses.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"? in the tables indicate that multiple different values are possible.","category":"page"},{"location":"apimanual/#Primal-dual-convex-solver-1","page":"Manual","title":"Primal-dual convex solver","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Linear programming and conic optimization solvers fall into this category.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"What happened? TerminationStatus() ResultCount() PrimalStatus() DualStatus()\nProved optimality OPTIMAL 1 FEASIBLE_POINT FEASIBLE_POINT\nProved infeasible INFEASIBLE 1 NO_SOLUTION INFEASIBILITY_CERTIFICATE\nOptimal within relaxed tolerances ALMOST_OPTIMAL 1 FEASIBLE_POINT or ALMOST_FEASIBLE_POINT FEASIBLE_POINT or ALMOST_FEASIBLE_POINT\nDetected an unbounded ray of the primal DUAL_INFEASIBLE 1 INFEASIBILITY_CERTIFICATE NO_SOLUTION\nStall SLOW_PROGRESS 1 ? ?","category":"page"},{"location":"apimanual/#Global-branch-and-bound-solvers-1","page":"Manual","title":"Global branch-and-bound solvers","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Mixed-integer programming solvers fall into this category.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"What happened? TerminationStatus() ResultCount() PrimalStatus() DualStatus()\nProved optimality OPTIMAL 1 FEASIBLE_POINT NO_SOLUTION\nPresolve detected infeasibility or unboundedness INFEASIBLE_OR_UNBOUNDED 0 NO_SOLUTION NO_SOLUTION\nProved infeasibility INFEASIBLE 0 NO_SOLUTION NO_SOLUTION\nTimed out (no solution) TIME_LIMIT 0 NO_SOLUTION NO_SOLUTION\nTimed out (with a solution) TIME_LIMIT 1 FEASIBLE_POINT NO_SOLUTION\nCPXMIP_OPTIMAL_INFEAS ALMOST_OPTIMAL 1 INFEASIBLE_POINT NO_SOLUTION","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"CPXMIP_OPTIMAL_INFEAS is a CPLEX status that indicates that a preprocessed problem was solved to optimality, but the solver was unable to recover a feasible solution to the original problem.","category":"page"},{"location":"apimanual/#Local-search-solvers-1","page":"Manual","title":"Local search solvers","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Nonlinear programming solvers fall into this category. It also includes non-global tree search solvers like Juniper.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"What happened? TerminationStatus() ResultCount() PrimalStatus() DualStatus()\nConverged to a stationary point LOCALLY_SOLVED 1 FEASIBLE_POINT FEASIBLE_POINT\nCompleted a non-global tree search (with a solution) LOCALLY_SOLVED 1 FEASIBLE_POINT FEASIBLE_POINT\nConverged to an infeasible point LOCALLY_INFEASIBLE 1 INFEASIBLE_POINT ?\nCompleted a non-global tree search (no solution found) LOCALLY_INFEASIBLE 0 NO_SOLUTION NO_SOLUTION\nIteration limit ITERATION_LIMIT 1 ? ?\nDiverging iterates NORM_LIMIT or OBJECTIVE_LIMIT 1 ? ?","category":"page"},{"location":"apimanual/#A-complete-example:-solving-a-knapsack-problem-1","page":"Manual","title":"A complete example: solving a knapsack problem","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We first need to select a solver supporting the given problem (see supports and supports_constraint). In this example, we want to solve a binary-constrained knapsack problem: max c'x: w'x <= C, x binary. Suppose we choose GLPK:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"using GLPK\noptimizer = GLPK.Optimizer()","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We first define the constants of the problem:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = [1.0, 2.0, 3.0]\nw = [0.3, 0.5, 1.0]\nC = 3.2\n\n# output\n\n3.2","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We create the variables of the problem and set the objective function:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x = MOI.add_variables(optimizer, length(c))\nobjective_function = MOI.ScalarAffineFunction(MOI.ScalarAffineTerm.(c, x), 0.0)\nMOI.set(optimizer, MOI.ObjectiveFunction{MOI.ScalarAffineFunction{Float64}}(),\n        objective_function)\nMOI.set(optimizer, MOI.ObjectiveSense(), MOI.MAX_SENSE)\n\n# output\n\nMAX_SENSE::OptimizationSense = 1","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We add the knapsack constraint and integrality constraints:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"knapsack_function = MOI.ScalarAffineFunction(MOI.ScalarAffineTerm.(w, x), 0.0)\nMOI.add_constraint(optimizer, knapsack_function, MOI.LessThan(C))\nfor x_i in x\n    MOI.add_constraint(optimizer, MOI.SingleVariable(x_i), MOI.ZeroOne())\nend\n\n# output\n","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We are all set! We can now call optimize! and wait for the solver to find the solution:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.optimize!(optimizer)\n\n# output\n","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The first thing to check after optimization is why the solver stopped, e.g., did it stop because of a time limit or did it stop because it found the optimal solution?","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.get(optimizer, MOI.TerminationStatus())\n\n# output\n\n\nOPTIMAL::TerminationStatusCode = 1","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"It found the optimal solution! Now let's see what is that solution.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.get(optimizer, MOI.PrimalStatus())\n\n# output\n\nFEASIBLE_POINT::ResultStatusCode = 1","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"What is its objective value?","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.get(optimizer, MOI.ObjectiveValue())\n\n# output\n\n6.0","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"And what is the value of the variables x?","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI.get(optimizer, MOI.VariablePrimal(), x)\n\n# output\n\n3-element Array{Float64,1}:\n 1.0\n 1.0\n 1.0","category":"page"},{"location":"apimanual/#Problem-modification-1","page":"Manual","title":"Problem modification","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In addition to adding and deleting constraints and variables, MathOptInterface supports modifying, in-place, coefficients in the constraints and the objective function of a model. These modifications can be grouped into two categories: modifications which replace the set of function of a constraint with a new set or function; and modifications which change, in-place, a component of a function.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In the following, we detail the various ways this can be achieved. Readers should note that some solvers will not support problem modification.","category":"page"},{"location":"apimanual/#Replacements-1","page":"Manual","title":"Replacements","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"First, we discuss how to replace the set or function of a constraint with a new instance of the same type.","category":"page"},{"location":"apimanual/#The-set-of-a-constraint-1","page":"Manual","title":"The set of a constraint","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Given a constraint of type F-in-S (see Constraints by function-set pairs  above for an explanation), we can modify parameters (but not the type) of the  set S by replacing it with a new instance of the same type. For example,  given the variable bound x le 1:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = add_constraint(m, SingleVariable(x), LessThan(1.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"we can modify the set so that the bound now x le 2 as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"set(m, ConstraintSet(), c, LessThan(2.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"where m is our ModelLike model. However, the following will fail as the new set (GreaterThan) is of a different type to the original set (LessThan):","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"set(m, ConstraintSet(), c, GreaterThan(2.0))  # errors","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If our constraint is an affine inequality, then this corresponds to modifying the right-hand side of a constraint in linear programming.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In some special cases, solvers may support efficiently changing the set of a constraint (for example, from LessThan to GreaterThan). For these cases, MathOptInterface provides the transform method. For example, instead of the error we observed above, the following will work:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c2 = transform(m, c, GreaterThan(1.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The transform function returns a new constraint index, and the old constraint index (i.e., c) is no longer valid:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"is_valid(m, c)   # false\nis_valid(m, c2)  # true","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Also note that transform cannot be called with a set of the same type; set should be used instead.","category":"page"},{"location":"apimanual/#The-function-of-a-constraint-1","page":"Manual","title":"The function of a constraint","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Given a constraint of type F-in-S (see Constraints by function-set pairs above for an explanation), it is also  possible to modify the function of type F by replacing it with a new instance of the same type. For example, given the variable bound x le 1:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = add_constraint(m, SingleVariable(x), LessThan(1.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"we can modify the function so that the bound now y le 1 as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"set(m, ConstraintFunction(), c, SingleVariable(y))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"where m is our ModelLike model. However, the following will fail as the new function is of a different type to the original function:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"set(m, ConstraintFunction(), c,\n    ScalarAffineFunction([ScalarAffineTerm(1.0, x)], 0.0)\n)","category":"page"},{"location":"apimanual/#In-place-modification-1","page":"Manual","title":"In-place modification","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The second type of problem modifications allow the user to modify, in-place, the coefficients of a function. Currently, four modifications are supported by MathOptInterface. They are:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"change the constant term in a scalar function;\nchange the constant term in a vector function;\nchange the affine coefficients in a scalar function; and\nchange the affine coefficients in a vector function.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"To distinguish between the replacement of the function with a new instance (described above) and the modification of an existing function, the in-place modifications use the  modify method:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify(model, index, change::AbstractFunctionModification)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify takes three arguments. The first is the ModelLike model model, the second is the constraint index, and the third is an instance of an AbstractFunctionModification.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We now detail each of these four in-place modifications.","category":"page"},{"location":"apimanual/#Constant-term-in-a-scalar-function-1","page":"Manual","title":"Constant term in a scalar function","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MathOptInterface supports is the ability to modify the constant term within a ScalarAffineFunction and a ScalarQuadraticFunction using the ScalarConstantChange subtype of AbstractFunctionModification. This includes the objective function, as well as the function in a function-pair constraint.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, consider a problem m with the objective max 10x + 00:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"set(m,\n    ObjectiveFunction{ScalarAffineFunction{Float64}}(),\n    ScalarAffineFunction([ScalarAffineTerm(1.0, x)], 0.0)\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We can modify the constant term in the objective function as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify(m,\n    ObjectiveFunction{ScalarAffineFunction{Float64}}(),\n    ScalarConstantChange(1.0)\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The objective function will now be max 10x + 10.","category":"page"},{"location":"apimanual/#Constant-terms-in-a-vector-function-1","page":"Manual","title":"Constant terms in a vector function","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We can modify the constant terms in a VectorAffineFunction or a VectorQuadraticFunction using the VectorConstantChange subtype of AbstractFunctionModification.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, consider a model with the following VectorAffineFunction-in-Nonpositives constraint:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = add_constraint(m,\n    VectorAffineFunction([\n            VectorAffineTerm(1, ScalarAffineTerm(1.0, x)),\n            VectorAffineTerm(1, ScalarAffineTerm(2.0, y))\n        ],\n        [0.0, 0.0]\n    ),\n    Nonpositives(2)\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"We can modify the constant vector in the VectorAffineFunction from [0.0, 0.0] to [1.0, 2.0] as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify(m, c, VectorConstantChange([1.0, 2.0])\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The constraints are now 10x + 10 le 00 and 20y + 20 le 00.","category":"page"},{"location":"apimanual/#Affine-coefficients-in-a-scalar-function-1","page":"Manual","title":"Affine coefficients in a scalar function","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In addition to modifying the constant terms in a function, we can also modify the affine variable coefficients in an ScalarAffineFunction or a ScalarQuadraticFunction using the ScalarCoefficientChange subtype of AbstractFunctionModification.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, given the constraint 10x = 10:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = add_constraint(m,\n    ScalarAffineFunction([ScalarAffineTerm(1.0, x)], 0.0),\n    LessThan(1.0)\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"we can modify the coefficient of the x variable so that the constraint becomes 20x = 10 as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify(m, c, ScalarCoefficientChange(x, 2.0))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"ScalarCoefficientChange can also be used to modify the objective function by passing an instance of ObjectiveFunction instead of the constraint index c as we saw above.","category":"page"},{"location":"apimanual/#Affine-coefficients-in-a-vector-function-1","page":"Manual","title":"Affine coefficients in a vector function","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Finally, the last modification supported by MathOptInterface is the ability to modify the affine coefficients of a single variable in a VectorAffineFunction or a VectorQuadraticFunction using the MultirowChange subtype of AbstractFunctionModification.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, given the constraint Ax in mathbbR^2_+, where A = 10 20^top:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"c = add_constraint(m,\n    VectorAffineFunction([\n            VectorAffineTerm(1, ScalarAffineTerm(1.0, x)),\n            VectorAffineTerm(1, ScalarAffineTerm(2.0, x))\n        ],\n        [0.0, 0.0]\n    ),\n    Nonnegatives(2)\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"we can modify the coefficients of the x variable so that the A matrix becomes A = 30 40^top as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"modify(m, c, MultirowChange(x, [3.0, 4.0]))","category":"page"},{"location":"apimanual/#File-formats-1","page":"Manual","title":"File formats","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The FileFormats module provides functionality for reading and writing MOI models using write_to_file and read_from_file.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"To write a model src to a MathOptFormat file, use:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"src = # ...\ndest = FileFormats.Model(format = FileFormats.FORMAT_MOF)\nMOI.copy_to(dest, src)\nMOI.write_to_file(dest, \"file.mof.json\")","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The list of supported formats is given by the FileFormats.FileFormat enum.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Instead of the format keyword, you can also use the filename keyword argument to FileFormats.Model. This will attempt to automatically guess the format from the file extension. For example:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"src = # ...\nfilename = \"my_model.cbf.gz\"\ndest = FileFormats.Model(filename = filename)\nMOI.copy_to(dest, src)\nMOI.write_to_file(dest, filename)\n\nsrc_2 = FileFormats.Model(filename = filename)\nMOI.read_from_file(src_2, filename)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Note how the compression format (GZip) is also automatically detected from the filename.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In some cases src may contain constraints that are not supported by the file format (e.g., the CBF format supports integer variables but not binary). If so, you should copy src to a bridged model using Bridges.full_bridge_optimizer:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"src = # ... conic model ...\ndest = FileFormats.Model(format = FileFormats.FORMAT_CBF)\nbridged = MOI.Bridges.full_bridge_optimizer(dest, Float64)\nMOI.copy_to(bridged, src)\nMOI.write_to_file(dest, \"my_model.cbf\")","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"You should also note that even after bridging, it may still not be possible to write the model to file because of unsupported constraints (e.g., PSD variables in the LP file format).","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"In addition to write_to_file and read_from_file, you can read and write directly from IO streams using Base.write and Base.read!:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"src = # ...\nio = IOBuffer()\ndest = FileFormats.Model(format = FileFormats.FORMAT_MPS)\nMOI.copy_to(dest, src)\nwrite(io, dest)\n\nseekstart(io)\nsrc_2 = FileFormats.Model(format = FileFormats.FORMAT_MPS)\nread!(io, src_2)","category":"page"},{"location":"apimanual/#Advanced-1","page":"Manual","title":"Advanced","text":"","category":"section"},{"location":"apimanual/#Duals-1","page":"Manual","title":"Duals","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Conic duality is the starting point for MOI's duality conventions. When all functions are affine (or coordinate projections), and all constraint sets are closed convex cones, the model may be called a conic optimization problem. For a minimization problem in geometric conic form, the primal is:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n min_x in mathbbR^n  a_0^T x + b_0\n\n textst  A_i x + b_i  in mathcalC_i  i = 1 ldots m\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"and the dual is a maximization problem in standard conic form:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_y_1 ldots y_m  -sum_i=1^m b_i^T y_i + b_0\n\n textst  a_0 - sum_i=1^m A_i^T y_i  = 0\n\n  y_i  in mathcalC_i^*  i = 1 ldots m\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"where each mathcalC_i is a closed convex cone and mathcalC_i^* is its dual cone.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For a maximization problem in geometric conic form, the primal is:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_x in mathbbR^n  a_0^T x + b_0\n\n textst  A_i x + b_i  in mathcalC_i  i = 1 ldots m\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"and the dual is a minimization problem in standard conic form:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n min_y_1 ldots y_m  sum_i=1^m b_i^T y_i + b_0\n\n textst  a_0 + sum_i=1^m A_i^T y_i  = 0\n\n  y_i  in mathcalC_i^*  i = 1 ldots m\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A linear inequality constraint a^T x + b ge c should be interpreted as a^T x + b - c in mathbbR_+, and similarly a^T x + b le c should be interpreted as a^T x + b - c in mathbbR_-. Variable-wise constraints should be interpreted as affine constraints with the appropriate identity mapping in place of A_i.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For the special case of minimization LPs, the MOI primal form can be stated as","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n min_x in mathbbR^n  a_0^T x + b_0\n\n textst\nA_1 x  ge b_1\n A_2 x  le b_2\n A_3 x  = b_3\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"By applying the stated transformations to conic form, taking the dual, and transforming back into linear inequality form, one obtains the following dual:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_y_1y_2y_3  b_1^Ty_1 + b_2^Ty_2 + b_3^Ty_3 + b_0\n\n textst\nA_1^Ty_1 + A_2^Ty_2 + A_3^Ty_3  = a_0\n y_1 ge 0\n y_2 le 0\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For maximization LPs, the MOI primal form can be stated as:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n max_x in mathbbR^n  a_0^T x + b_0\n\n textst\nA_1 x  ge b_1\n A_2 x  le b_2\n A_3 x  = b_3\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"and similarly, the dual is:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign\n min_y_1y_2y_3  -b_1^Ty_1 - b_2^Ty_2 - b_3^Ty_3 + b_0\n\n textst\nA_1^Ty_1 + A_2^Ty_2 + A_3^Ty_3  = -a_0\n y_1 ge 0\n y_2 le 0\nendalign","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"An important note for the LP case is that the signs of the feasible duals depend only on the sense of the inequality and not on the objective sense.","category":"page"},{"location":"apimanual/#Duality-and-scalar-product-1","page":"Manual","title":"Duality and scalar product","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The scalar product is different from the canonical one for the sets PositiveSemidefiniteConeTriangle, LogDetConeTriangle, RootDetConeTriangle. If the set C_i of the section Duals is one of these three cones, then the rows of the matrix A_i corresponding to off-diagonal entries are twice the value of the coefficients field in the VectorAffineFunction for the corresponding rows. See PositiveSemidefiniteConeTriangle for details.","category":"page"},{"location":"apimanual/#Dual-for-problems-with-quadratic-functions-1","page":"Manual","title":"Dual for problems with quadratic functions","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Given a problem with quadratic functions:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"beginalign*\n min_x in mathbbR^n  frac12x^TQ_0x + a_0^T x + b_0\n\n textst  frac12x^TQ_ix + a_i^T x + b_i  in mathcalC_i  i = 1 ldots m\nendalign*","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Consider the Lagrangian function","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"L(x y) = frac12x^TQ_0x + a_0^T x + b_0 - sum_i = 1^m y_i (frac12x^TQ_ix + a_i^T x + b_i)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A pair of primal-dual variables (x^star y^star) is optimal if","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x^star is a minimizer of\nmin_x in mathbbR^n L(x y^star)\nThat is,\n0 = nabla_x L(x y^star) = Q_0x + a_0 - sum_i = 1^m y_i^star (Q_ix + a_i)\nand y^star is a maximizer of\nmax_y_i in mathcalC_i^* L(x^star y)\nThat is, for all i = 1 ldots m, frac12x^TQ_ix + a_i^T x + b_i is either zero or in the normal cone of mathcalC_i^* at y^star. For instance, if mathcalC_i is  x in mathbbR  x le 0 , it means that if frac12x^TQ_ix + a_i^T x + b_i is nonzero then lambda_i = 0, this is the classical complementary slackness condition.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If mathcalC_i is a vector set, the discussion remains valid with y_i(frac12x^TQ_ix + a_i^T x + b_i) replaced with the scalar product between y_i and the vector of scalar-valued quadratic functions.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"note: Note\nFor quadratic programs with only affine constraints, the optimality condition nabla_x L(x y^star) = 0 can be simplified as follows0 = nabla_x L(x y^star) = Q_0x + a_0 - sum_i = 1^m y_i^star a_iwhich givesQ_0x = sum_i = 1^m y_i^star a_i - a_0The Lagrangian functionL(x y) = frac12x^TQ_0x + a_0^T x + b_0 - sum_i = 1^m y_i (a_i^T x + b_i)can be rewritten asL(x y) = frac12x^TQ_0x - (sum_i = 1^m y_i a_i^T - a_0^T) x + b_0 - sum_i = 1^m y_i (a_i^T x + b_i)which, using the optimality condition nabla_x L(x y^star) = 0, can be simplified asL(x y) = -frac12x^TQ_0x + b_0 - sum_i = 1^m y_i (a_i^T x + b_i)","category":"page"},{"location":"apimanual/#Automatic-reformulation-1","page":"Manual","title":"Automatic reformulation","text":"","category":"section"},{"location":"apimanual/#Variable-reformulation-1","page":"Manual","title":"Variable reformulation","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A variable is often created constrained in a set unsupported by the solver while it could be parametrized by variables constrained in supported sets. For example, the Bridges.Variable.VectorizeBridge defines the reformulation of a constrained variable in GreaterThan into a constrained vector of one variable in Nonnegatives. The Bridges.Variable.Vectorize is the bridge optimizer that applies the Bridges.Variable.VectorizeBridge rewriting rule. Given an optimizer optimizer implementing constrained variables in Nonnegatives, the optimizer","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"bridged_optimizer = MOI.Bridges.Variable.Vectorize{Float64}(optimizer)\nMOI.supports_add_constrained_variable(bridged_optimizer, MOI.GreaterThan{Float64})\n\n# output\n\ntrue","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"will additionally support constrained variables in GreaterThan. Note that these Bridges.Variable.SingleBridgeOptimizer are mainly used for testing bridges. It is recommended to rather use Bridges.full_bridge_optimizer, which automatically selects the appropriate bridges for unsupported constrained variables.","category":"page"},{"location":"apimanual/#Constraint-reformulation-1","page":"Manual","title":"Constraint reformulation","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"A constraint can often be written in a number of equivalent formulations. For example, the constraint l le a^top x le u (ScalarAffineFunction-in-Interval) could be re-formulated as two constraints: a^top x ge l (ScalarAffineFunction-in-GreaterThan) and a^top x le u (ScalarAffineFunction-in-LessThan). An alternative re-formulation is to add a dummy variable y with the constraints l le y le u (SingleVariable-in-Interval) and a^top x - y = 0 (ScalarAffineFunction-in-EqualTo).","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"To avoid each solver having to code these transformations manually, MathOptInterface provides bridges. A bridge is a small transformation from one constraint type to another (potentially collection of) constraint type. Because these bridges are included in MathOptInterface, they can be re-used by any optimizer. Some bridges also implement constraint modifications and constraint primal and dual translations.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"For example, the SplitIntervalBridge defines the reformulation of a ScalarAffineFunction-in-Interval constraint into a ScalarAffineFunction-in-GreaterThan and a ScalarAffineFunction-in-LessThan constraint. SplitInterval is the bridge optimizer that applies the SplitIntervalBridge rewriting rule. Given an optimizer optimizer implementing ScalarAffineFunction-in-GreaterThan and ScalarAffineFunction-in-LessThan, the optimizer","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"bridged_optimizer = MOI.Bridges.Constraint.SplitInterval{Float64}(optimizer)\nMOI.supports_constraint(bridged_optimizer, MOI.ScalarAffineFunction{Float64}, MOI.Interval{Float64})\n\n# output\n\ntrue","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"will additionally support ScalarAffineFunction-in-Interval. Note that these Bridges.Constraint.SingleBridgeOptimizers are mainly used for testing bridges. It is recommended to rather use Bridges.full_bridge_optimizer which automatically selects the appropriate constraint bridges for unsupported constraints.","category":"page"},{"location":"apimanual/#Implementing-a-solver-interface-1","page":"Manual","title":"Implementing a solver interface","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"[The interface is designed for multiple dispatch, e.g., attributes, combinations of sets and functions.]","category":"page"},{"location":"apimanual/#Solver-specific-attributes-1","page":"Manual","title":"Solver-specific attributes","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Solver-specific attributes should be specified by creating an AbstractOptimizerAttribute. For example, inside MyPackage, we could add the following:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"struct PrintLevel <: MOI.AbstractOptimizerAttribute end\nfunction MOI.set(model::Optimizer, ::PrintLevel, level::Int)\n    # ... set the print level ...\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Then, the user can write:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"model = MyPackage.Optimizer()\nMOI.set(model, MyPackage.PrintLevel(), 0)","category":"page"},{"location":"apimanual/#Supported-constrained-variables-and-constraints-1","page":"Manual","title":"Supported constrained variables and constraints","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The solver interface should only implement support for variables constrained on creation (see add_constrained_variable/add_constrained_variables) or constraints that directly map to a structure exploited by the solver algorithm. There is no need to add support for additional types, this is handled by the Automatic reformulation. Furthermore, this allows supports_constraint to indicate which types are exploited by the solver and hence allows layers such as Bridges.LazyBridgeOptimizer to accurately select the most appropriate transformations.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"As add_constrained_variable (resp. add_constrained_variables) falls back to add_variable (resp. add_variables) followed by add_constraint, there is no need to implement this function if model does not require that variables be constrained when they are created. However, if model requires that variables be constrained when they're created, then it should only implement add_constrained_variable and not add_variable nor add_constraint for SingleVariable-in-typeof(set). In addition, it should implement supports_add_constrained_variables(::Optimizer, ::Type{Reals}) and return false so that these variables are bridged, see supports_add_constrained_variables.","category":"page"},{"location":"apimanual/#Handling-duplicate-coefficients-1","page":"Manual","title":"Handling duplicate coefficients","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Solvers should expect that functions such as ScalarAffineFunction and VectorQuadraticFunction may contain duplicate coefficents, for example, ScalarAffineFunction([ScalarAffineTerm(x, 1), ScalarAffineTerm(x, 1)], 0.0). These duplicate terms can be aggregated by calling Utilities.canonical.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"x = MathOptInterface.VariableIndex(1)\nterm = MathOptInterface.ScalarAffineTerm(1, x)\nfunc = MathOptInterface.ScalarAffineFunction([term, term], 0)\nfunc_canon = MathOptInterface.Utilities.canonical(func)\nfunc_canon  MathOptInterface.ScalarAffineFunction(\n    [MathOptInterface.ScalarAffineTerm(2, x)], 0)\n\n# output\n\ntrue","category":"page"},{"location":"apimanual/#Implementing-copy-1","page":"Manual","title":"Implementing copy","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Avoid storing extra copies of the problem when possible. This means that solver wrappers should not use Utilities.CachingOptimizer as part of the wrapper. Instead, do one of the following to load the problem (assuming the solver wrapper type is called Optimizer):","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If the solver supports loading the problem incrementally, implement add_variable, add_constraint for supported constraints and set for supported attributes and add:\nfunction MOI.copy_to(dest::Optimizer, src::MOI.ModelLike; kws...)\n    return MOI.Utilities.automatic_copy_to(dest, src; kws...)\nend\nwith\nMOI.Utilities.supports_default_copy_to(model::Optimizer, copy_names::Bool) = true\nor\nMOI.Utilities.supports_default_copy_to(model::Optimizer, copy_names::Bool) = !copy_names\ndepending on whether the solver support names; see Utilities.supports_default_copy_to for more details.\nIf the solver does not support loading the problem incrementally, do not implement add_variable and add_constraint as implementing them would require caching the problem. Let users or JuMP decide whether to use a CachingOptimizer instead. Write either a custom implementation of copy_to or implement the Allocate-Load API. If you choose to implement the Allocate-Load API, do\nfunction MOI.copy_to(dest::Optimizer, src::MOI.ModelLike; kws...)\n    return MOI.Utilities.automatic_copy_to(dest, src; kws...)\nend\nwith\nMOI.Utilities.supports_allocate_load(model::Optimizer, copy_names::Bool) = true\nor\nMOI.Utilities.supports_allocate_load(model::Optimizer, copy_names::Bool) = !copy_names\ndepending on whether the solver support names; see Utilities.supports_allocate_load for more details.\nNote that even if both writing a custom implementation of copy_to and implementing the Allocate-Load API requires the user to copy the model from a cache, the Allocate-Load API allows MOI layers to be added between the cache and the solver which allows transformations to be applied without the need for additional caching. For instance, with the proposed Light bridges, no cache will be needed to store the bridged model when bridges are used by JuMP so implementing the Allocate-Load API will allow JuMP to use only one cache instead of two.","category":"page"},{"location":"apimanual/#JuMP-mapping-1","page":"Manual","title":"JuMP mapping","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI defines a very general interface, with multiple possible ways to describe the same constraint. This is considered a feature, not a bug. MOI is designed to make it possible to experiment with alternative representations of an optimization problem at both the solving and modeling level. When implementing an interface, it is important to keep in mind that the way the user can express problems in JuMP is not directly limited by the constraints which a solver supports via MOI as JuMP performs Automatic reformulation. Therefore, we recommend to only support the constraint types that directly map to a structure exploited by the solver algorithm. The following bullet points show examples of how JuMP constraints are translated into MOI function-set pairs:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"@constraint(m, 2x + y <= 10) becomes ScalarAffineFunction-in-LessThan;\n@constraint(m, 2x + y >= 10) becomes ScalarAffineFunction-in-GreaterThan;\n@constraint(m, 2x + y == 10) becomes ScalarAffineFunction-in-EqualTo;\n@constraint(m, 0 <= 2x + y <= 10) becomes ScalarAffineFunction-in-Interval;\n@constraint(m, 2x + y in ArbitrarySet()) becomes ScalarAffineFunction-in-ArbitrarySet.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Variable bounds are handled in a similar fashion:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"@variable(m, x <= 1) becomes SingleVariable-in-LessThan;\n@variable(m, x >= 1) becomes SingleVariable-in-GreaterThan.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"One notable difference is that a variable with an upper and lower bound is translated into two constraints, rather than an interval. i.e.:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"@variable(m, 0 <= x <= 1) becomes SingleVariable-in-LessThan and SingleVariable-in-GreaterThan.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Solvers are not expected to support AbstractScalarFunction in GreaterThan, LessThan, EqualTo, or Interval with a nonzero constant in the function. Constants in the affine function should instead be moved into the parameters of the corresponding sets. The ScalarFunctionConstantNotZero exception may be thrown in this case.","category":"page"},{"location":"apimanual/#Column-Generation-1","page":"Manual","title":"Column Generation","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"There is no special interface for column generation. If the solver has a special API for setting coefficients in existing constraints when adding a new variable, it is possible to queue modifications and new variables and then call the solver's API once all of the new coefficients are known.","category":"page"},{"location":"apimanual/#Problem-data-1","page":"Manual","title":"Problem data","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"All data passed to the solver should be copied immediately to internal data structures. Solvers may not modify any input vectors and should assume that input vectors may be modified by users in the future. This applies, for example, to the terms vector in ScalarAffineFunction. Vectors returned to the user, e.g., via ObjectiveFunction or ConstraintFunction attributes, should not be modified by the solver afterwards. The in-place version of get! can be used by users to avoid extra copies in this case.","category":"page"},{"location":"apimanual/#Statuses-1","page":"Manual","title":"Statuses","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Solver wrappers should document how the low-level statuses map to the MOI statuses. Statuses like NEARLY_FEASIBLE_POINT and INFEASIBLE_POINT, are designed to be used when the solver explicitly indicates that relaxed tolerances are satisfied or the returned point is infeasible, respectively.","category":"page"},{"location":"apimanual/#Naming-1","page":"Manual","title":"Naming","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"MOI solver interfaces may be in the same package as the solver itself (either the C wrapper if the solver is accessible through C, or the Julia code if the solver is written in Julia, for example). The guideline for naming the file containing the MOI wrapper is src/MOI_wrapper.jl and test/MOI_wrapper.jl for the tests. If the MOI wrapper implementation is spread in several files, they should be stored in a src/MOI_wrapper folder and included by a src/MOI_wrapper/MOI_wrapper.jl file.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"By convention, optimizers should not be exported and should be named PackageName.Optimizer. For example, CPLEX.Optimizer, Gurobi.Optimizer, and Xpress.Optimizer.","category":"page"},{"location":"apimanual/#Testing-guideline-1","page":"Manual","title":"Testing guideline","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The skeleton below can be used for the wrapper test file of a solver named FooBar.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"using Test\n\nusing MathOptInterface\nconst MOI = MathOptInterface\nconst MOIT = MOI.Test\nconst MOIU = MOI.Utilities\nconst MOIB = MOI.Bridges\n\nimport FooBar\nconst OPTIMIZER_CONSTRUCTOR = MOI.OptimizerWithAttributes(FooBar.Optimizer, MOI.Silent() => true)\nconst OPTIMIZER = MOI.instantiate(OPTIMIZER_CONSTRUCTOR)\n\n@testset \"SolverName\" begin\n    @test MOI.get(OPTIMIZER, MOI.SolverName()) == \"FooBar\"\nend\n\n@testset \"supports_default_copy_to\" begin\n    @test MOIU.supports_default_copy_to(OPTIMIZER, false)\n    # Use `@test !...` if names are not supported\n    @test MOIU.supports_default_copy_to(OPTIMIZER, true)\nend\n\nconst BRIDGED = MOI.instantiate(OPTIMIZER_CONSTRUCTOR, with_bridge_type = Float64)\nconst CONFIG = MOIT.TestConfig(atol=1e-6, rtol=1e-6)\n\n@testset \"Unit\" begin\n    # Test all the functions included in dictionary `MOI.Test.unittests`,\n    # except functions \"number_threads\" and \"solve_qcp_edge_cases.\"\n    MOIT.unittest(\n        BRIDGED, \n        CONFIG, \n        [\"number_threads\", \"solve_qcp_edge_cases\"]\n    ) \nend\n\n@testset \"Modification\" begin\n    MOIT.modificationtest(BRIDGED, CONFIG)\nend\n\n@testset \"Continuous Linear\" begin\n    MOIT.contlineartest(BRIDGED, CONFIG)\nend\n\n@testset \"Continuous Conic\" begin\n    MOIT.contlineartest(BRIDGED, CONFIG)\nend\n\n@testset \"Integer Conic\" begin\n    MOIT.intconictest(BRIDGED, CONFIG)\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Test functions like MOI.Test.unittest and MOI.Test.modificationtest are  wrappers around corresponding dictionaries MOI.Test.unittests and  MOI.Test.modificationtests. The keys of each dictionary (strings describing  the test) map to functions that take two arguments: an optimizer and a  MOI.Test.TestConfig object. Exclude tests by passing a vector of strings  corresponding to the test keys you want to exclude as the third positional  argument to the test function (e.g., MOI.Test.unittest). ","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Print a list of all keys using println.(keys(MOI.Test.unittests))","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"The optimizer BRIDGED constructed with instantiate automatically bridges constraints that are not supported by OPTIMIZER using the bridges listed in Bridges. It is recommended for an implementation of MOI to only support constraints that are natively supported by the solver and let bridges transform the constraint to the appropriate form. For this reason it is expected that tests may not pass if OPTIMIZER is used instead of BRIDGED.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"To test that a specific problem can be solved without bridges, a specific test can be run with OPTIMIZER instead of BRIDGED. For instance","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"@testset \"Interval constraints\" begin\n    MOIT.linear10test(OPTIMIZER, CONFIG)\nend","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"checks that OPTIMIZER implements support for ScalarAffineFunction-in-Interval.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"If the wrapper does not support building the model incrementally (i.e. with add_variable and add_constraint), then supports_default_copy_to can be replaced by supports_allocate_load if appropriate (see Implementing copy).","category":"page"},{"location":"apimanual/#Benchmarking-1","page":"Manual","title":"Benchmarking","text":"","category":"section"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"To aid the development of efficient solver wrappers, MathOptInterface provides benchmarking functionality. Benchmarking a wrapper follows a two-step process.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"First, prior to making changes, run and save the benchmark results on a given benchmark suite as follows:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"using SolverPackage, MathOptInterface\n\nconst MOI = MathOptInterface\n\nsuite = MOI.Benchmarks.suite() do\n    SolverPackage.Optimizer()\nend\n\nMOI.Benchmarks.create_baseline(\n    suite, \"current\"; directory = \"/tmp\", verbose = true\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Use the exclude argument to Benchmarks.suite to exclude benchmarks that the solver doesn't support.","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"Second, after making changes to the package, re-run the benchmark suite and compare to the prior saved results:","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"using SolverPackage, MathOptInterface\n\nconst MOI = MathOptInterface\n\nsuite = MOI.Benchmarks.suite() do\n    SolverPackage.Optimizer()\nend\n\nMOI.Benchmarks.compare_against_baseline(\n    suite, \"current\"; directory = \"/tmp\", verbose = true\n)","category":"page"},{"location":"apimanual/#","page":"Manual","title":"Manual","text":"This comparison will create a report detailing improvements and regressions.","category":"page"},{"location":"#MathOptInterface-1","page":"Introduction","title":"MathOptInterface","text":"","category":"section"},{"location":"#","page":"Introduction","title":"Introduction","text":"MathOptInterface.jl is a standardized API for mathematical optimization solvers.","category":"page"},{"location":"#","page":"Introduction","title":"Introduction","text":"Pages = [\"apimanual.md\", \"apireference.md\"]\nDepth = 3","category":"page"}]
}
